        "1. Without color; pale; pallid. [Obs.] When she came out she looked as pale and as bleak as one that were laid out dead. Foxe. 2. Desolate and exposed; swept by cold winds. Wastes too bleak to rear The common growth of earth, the foodful ear. Wordsworth. At daybreak, on the bleak sea beach. Longfellow. 3. Cold and cutting; cheerless; as, a bleak blast. -- Bleak\"ish, a. -- Bleak\"ly, adv. -- Bleak\"ness, n.\n\nA small European river fish (Leuciscus alburnus), of the family Cyprinidæ; the blay. [Written also blick.] Note: The silvery pigment lining the scales of the bleak is used in the manufacture of artificial pearls. Baird.",
