    "bridesmaid": "A female friend who attends on a bride at her wedding.",
    "billet":
        "1. A small paper; a note; a short letter. \"I got your melancholy billet.\" Sterne. 2. A ticket from a public officer directing soldiers at what house to lodge; as, a billet of residence.\n\nTo direct, by a ticket or note, where to lodge. Hence: To quarter, or place in lodgings, as soldiers in private houses. Billeted in so antiquated a mansion. W. Irving.\n\n1. A small stick of wood, as for firewood. They shall beat out my brains with billets. Shak. 2. (Metal.)  A short bar of metal, as of gold or iron. 3. (Arch.)  An ornament in Norman work, resembling a billet of wood either square or round. 4. (Saddlery) (a) A strap which enters a buckle. (b) A loop which receives the end of a buckled strap. Knight. 5. (Her.)  A bearing in the form of an oblong rectangle.",
    "bittour": "The bittern. Dryden.",
    "blessed":
        "1. Hallowed; consecrated; worthy of blessing or adoration; heavenly; holy. O, run; prevent them with thy humble ode, And lay it lowly at his blessed feet. Milton. 2. Enjoying happiness or bliss; favored with blessings; happy; highly favored. All generations shall call me blessed. Luke i. 48. Towards England's blessed shore. Shak. 3. Imparting happiness or bliss; fraught with happiness; blissful; joyful. \"Then was a blessed time.\" \"So blessed a disposition.\" Shak. 4. Enjoying, or pertaining to, spiritual happiness, or heavenly felicity; as, the blessed in heaven. Reverenced like a blessed saint. Shak. Cast out from God and blessed vision. Milton. 5. (R. C. Ch.)  Beatified. 6. Used euphemistically, ironically, or intensively. Not a blessed man came to set her [a boat] free. R. D. Blackmore.",
