    "bedroom":
        "1. A room or apartment intended or used for a bed; a lodging room. 2. Room in a bed. Note: [In this sense preferably bed room.] Then by your side no bed room me deny. Shak.",
    "banquet":
        "1. A feast; a sumptuous entertainment of eating and drinking; often, a complimentary or ceremonious feast, followed by speeches. 2. A dessert; a course of sweetmeats; a sweetmeat or sweetmeats. [Obs.] We'll dine in the great room, but let the music And banquet be prepared here. Massinger.\n\nTo treat with a banquet or sumptuous entertainment of food; to feast. Just in time to banquet The illustrious company assembled there. Coleridge.\n\n1. To regale one's self with good eating and drinking; to feast. Were it a draught for Juno when she banquets, I would not taste thy treasonous offer. Milton. 2. To partake of a dessert after a feast. [Obs.] Where they did both sup and banquet. Cavendish.",
    "barberry":
        "A shrub of the genus Berberis, common along roadsides and in neglected fields. B. vulgaris is the species best known; its oblong red berries are made into a preserve or sauce, and have been deemed efficacious in fluxes and fevers. The bark dyes a fine yellow, esp. the bark of the root. [Also spelt berberry.]",
    "bullfaced": "Having a large face.",
    "buceros": "A genus of large perching birds; the hornbills.",
    "battering-ram":
        "1. (Mil.) An engine used in ancient times to beat down the walls of besieged places. Note: It was a large beam, with a head of iron, which was sometimes made to resemble the head of a ram. It was suspended by ropes t a beam supported by posts, and so balanced as to swing backward and forward, and was impelled by men against the wall. Grose. 2. A blacksmith's hammer, suspended, and worked horizontally.",
    "baron":
        "1. A title or degree of nobility; originally, the possessor of a fief, who had feudal tenants under him; in modern times, in France and Germany, a nobleman next in rank below a count; in England, a nobleman of the lowest grade in the House of Lords, being next below a viscount. Note: \"The tenants in chief from the Crown, who held lands of the annual value of four hundred pounds, were styled Barons; and it is to them, and not to the members of the lowest grade of the nobility (to whom the title at the present time belongs), that reference is made when we read of the Barons of the early days of England's history . . . . Barons are addressed as 'My Lord,' and are styled 'Right Honorable.' All their sons and daughters 'Honorable.'\" Cussans. 2. (Old Law)  A husband; as, baron and feme, husband and wife. [R.] Cowell. Baron of beef, two sirloins not cut asunder at the backbone. -- Barons of the Cinque Ports, formerly members of the House of Commons, elected by the seven Cinque Ports, two for each port. -- Baron of the exchequer, the judges of the Court of Exchequer, one of the three ancient courts of England, now abolished.",
    "beplaster":
