    "bivalency": "The quality of being bivalent.",
    "bolide": "A kind of meteor; a bolis.",
    "belletristical":
        "Occupied with, or pertaining to, belles-lettres. \"An unlearned, belletristic trifler.\" M. Arnold.",
    "barrier":
        "1. (Fort.)  A carpentry obstruction, stockade, or other obstacle made in a passage in order to stop an enemy. 2. A fortress or fortified town, on the frontier of a country, commanding an avenue of approach. 3. pl.  A fence or railing to mark the limits of a place, or to keep back a crowd. No sooner were the barriers opened, than he paced into the lists. Sir W. Scott. 4. An any obstruction; anything which hinders approach or attack. \"Constitutional barriers.\" Hopkinson. 5. Any limit or boundary; a line of separation. 'Twixt that [instinct] and reason, what a nice barrier ! Pope. Barrier gate, a heavy gate to close the opening through a barrier. -- Barrier reef, a form of coral reef which runs in the general direction of the shore, and incloses a lagoon channel more or less extensive. -- To fight at barriers, to fight with a barrier between, as a martial exercise. [Obs.]",
    "boom":
        "1. (Naut.)  A long pole or spar, run out for the purpose of extending the bottom of a particular sail; as, the jib boom, the studding-sail boom, etc. 2. (Mech.)  A long spar or beam, projecting from the mast of a derrick, from the outer end of which the body to be lifted is suspended. 3. A pole with a conspicuous top, set up to mark the channel in a river or harbor. [Obs.] 4. (Mil. & Naval)  A strong chain cable, or line of spars bound together, extended across a river or the mouth of a harbor, to obstruct navigation or passage. 5. (Lumbering)  A line of connected floating timbers stretched across a river, or inclosing an area of water, to keep saw logs, etc., from floating away. Boom iron, one of the iron rings on the yards through which the studding-sail booms traverse. -- The booms, that space on the upper deck of a ship between the foremast and mainmast, where the boats, spare spars, etc., are stowed. Totten.\n\nTo extend, or push, with a boom or pole; as, to boom out a sail; to boom off a boat.\n\n1. To cry with a hollow note; to make a hollow sound, as the bittern, and some insects. At eve the beetle boometh Athwart the thicket lone. Tennyson. 2. To make a hollow sound, as of waves or cannon. Alarm guns booming through the night air. W. Irving. 3. To rush with violence and noise, as a ship under a press of sail, before a free wind. She comes booming down before it. Totten. 4. To have a rapid growth in market value or in popular favor; to go on rushingly.\n\n1. A hollow roar, as of waves or cannon; also, the hollow cry of the bittern; a booming. 2. A strong and extensive advance, with more or less noisy excitement; -- applied colloquially or humorously to market prices, the demand for stocks or commodities and to political chances of aspirants to office; as, a boom in the stock market; a boom in coffee. [Colloq. U. S.]\n\nTo cause to advance rapidly in price; as, to boom railroad or mining shares; to create a \"boom\" for; as to boom Mr. C. for senator. [Colloq. U. S.]",
    "beadroll":
        "A catalogue of persons, for the rest of whose souls a certain number of prayers are to be said or counted off on the beads of a chaplet; hence, a catalogue in general. On Fame's eternal beadroll worthy to be field. Spenser. It is quite startling, on going over the beadroll of English worthies, to find how few are directly represented in the male line. Quart. Rev.",
    "birdcage": "A cage for confining birds.",
