    "bristol":
        "A seaport city in the west of England. Bristol board, a kind of fine pasteboard, made with a smooth but usually unglazed surface. -- Bristol brick, a brick of siliceous matter used for polishing cultery; -- originally manufactured at Bristol. -- Bristol stone, rock crystal, or brilliant crystals of quartz, found in the mountain limestone near Bristol, and used in making ornaments, vases, etc. When polished, it is called Bristol diamond.",
    "bet":
        "That which is laid, staked, or pledged, as between two parties, upon the event of a contest or any contingent issue; the act of giving such a pledge; a wager. \"Having made his bets.\" Goldsmith.\n\nTo stake or pledge upon the event of a contingent issue; to wager. John a Gaunt loved him well, and betted much money on his head. Shak. I'll bet you two to one I'll make him do it. O. W. Holmes.\n\nimp. & p. p. of Beat. [Obs.]\n\nAn early form of Better. [Obs.] To go bet, to go fast; to hurry. [Obs.] Chaucer.",
    "bitstock": "A stock or handle for holding and rotating a bit; a brace.",
    "bluff":
        "1. Having a broad, flattened front; as, the bluff bows of a ship. \"Bluff visages.\" Irving. 2. Rising steeply with a flat or rounded front. \"A bluff or bold shore.\" Falconer. Its banks, if not really steep, had a bluff and precipitous aspect. Judd. 3. Surly; churlish; gruff; rough. 4. Abrupt; roughly frank; unceremonious; blunt; brusque; as, a bluff answer; a bluff manner of talking; a bluff sea captain. \"Bluff King Hal.\" Sir W. Scott. There is indeed a bluff pertinacity which is a proper defense in a moment of surprise. I. Taylor.\n\n1. A high, steep bank, as by a river or the sea, or beside a ravine or plain; a cliff with a broad face. Beach, bluff, and wave, adieu. Whittier. 2. An act of bluffing; an expression of self-confidence for the purpose of intimidation; braggadocio; as, that is only bluff, or a bluff. 3. A game at cards; poker. [U.S.] Bartlett.\n\n1. (Poker)  To deter (an opponent) from taking the risk of betting on his hand of cards, as the bluffer does by betting heavily on his own hand although it may be of less value. [U. S.] 2. To frighten or deter from accomplishing a purpose by making a show of confidence in one's strength or resources; as, he bluffed me off. [Colloq.]\n\nTo act as in the game of bluff.",
    "bottone":
        "Having a bud or button, or a kind of trefoil, at the end; furnished with knobs or buttons. Cross bottony (Her.), a cross having each arm terminating in three rounded lobes, forming a sort of trefoil.",
    "bodleian":
        "Of or pertaining to Sir Thomas Bodley, or to the celebrated library at Oxford, founded by him in the sixteenth century.",
    "bedight": "To bedeck; to array or equip; to adorn. [Archaic] Milton.",
    "bewailment": "The act of bewailing.",
    "benign":
        "1. Of a kind or gentle disposition; gracious; generous; favorable; benignant. Creator bounteous and benign. Milton. 2. Exhibiting or manifesting kindness, gentleness, favor, etc.; mild; kindly; salutary; wholesome. Kind influences and benign aspects. South. 3. Of a mild type or character; as, a benign disease. Syn. -- Kind; propitious; bland; genial; salubrious; favorable salutary; gracious; liberal.",
    "bibliographer": "One who writes, or is versed in, bibliography.",
    "born":
        "1. Brought forth, as an animal; brought into life; introduced by birth. No one could be born into slavery in Mexico. Prescott. 2. Having from birth a certain character; by or from birth; by nature; innate; as, a born liar. \"A born matchmaker.\" W. D. Howells. Born again (Theol.), regenerated; renewed; having received spiritual life. \"Except a man be born again, he can not see the kingdom of God.\" John iii. 3. -- Born days, days since one was born; lifetime. [Colloq.]",
    "by-end":
        "Private end or interest; secret purpose; selfish advantage. [Written also bye-end.] \"Profit or some other by-end.\" L'Estrange.",
    "batardeau":
        "1. A cofferdam. Brande & C. 2. (Mil.)  A wall built across the ditch of a fortification, with a sluice gate to regulate the height of water in the ditch on both sides of the wall.",
    "begirt": "To encompass; to begird. Milton.",
    "brood":
        "1. The young birds hatched at one time; a hatch; as, a brood of chicken. As a hen doth gather her brood under her wings. Luke xiii. 34. A hen followed by a brood of ducks. Spectator. 2. The young from the same dam, whether produced at the same time or not; young children of the same mother, especially if nearly of the same age; offspring; progeny; as, a woman with a brood of children. The lion roars and gluts his tawny brood. Wordsworth. 3. That which is bred or produced; breed; species. Flocks of the airy brood, (Cranes, geese or long-necked swans). Chapman. 4. (Mining)  Heavy waste in tin and copper ores. To sit on brood, to ponder. [Poetic] Shak.\n\n1. Sitting or inclined to sit on eggs. 2. Kept for breeding from; as, a brood mare; brood stock; having young; as, a brood sow.\n\n1. To sit on and cover eggs, as a fowl, for the purpose of warming them and hatching the young; or to sit over and cover young, as a hen her chickens, in order to warm and protect them; hence, to sit quietly, as if brooding. Birds of calm sir brooding on the charmed wave. Milton. 2. To have the mind dwell continuously or moodily on a subject; to think long and anxiously; to be in a state of gloomy, serious thought; -- usually followed by over or on; as, to brood over misfortunes. Brooding on unprofitable gold. Dryden. Brooding over all these matters, the mother felt like one who has evoked a spirit. Hawthorne. When with downcast eyes we muse and brood. Tennyson.\n\n1. To sit over, cover, and cherish; as, a hen broods her chickens. 2. To cherish with care. [R.] 3. To think anxiously or moodily upon. You'll sit and brood your sorrows on a throne. Dryden.",
    "badger-legged":
        "Having legs of unequal length, as the badger was thought to have. Shak.",
    "bigaroon": "The large white-heart cherry.",
    "bodiless":
        "1. Having no body. 2. Without material form; incorporeal. Phantoms bodiless and vain. Swift.",
    "bedell": ",n.Same as Beadle.",
    "benignity":
        "1. The quality of being benign; goodness; kindness; graciousness. \"Benignity of aspect.\" Sir W. Scott. 2. Mildness; gentleness. The benignity or inclemency of the season. Spectator. 3. Salubrity; wholesome quality. Wiseman.",
