    "blencher":
        "1. One who, or that which, scares another; specifically, a person stationed to prevent the escape of the deer, at a hunt. See Blancher. [Obs.] 2. One who blenches, flinches, or shrinks back.",
    "backset":
        "1. A check; a relapse; a discouragement; a setback. 2. Whatever is thrown back in its course, as water. Slackwater, or the backset caused by the overflow. Harper's Mag.\n\nTo plow again, in the fall; -- said of prairie land broken up in the spring. [Western U.S.]",
    "beneficially":
