    "elaoptene": "See Elæoptene.",
    "engage":
        "1. To put under pledge; to pledge; to place under obligations to do or forbear doing something, as by a pledge, oath, or promise; to bind by contract or promise. \"I to thee engaged a prince's word.\" Shak. 2. To gain for service; to bring in as associate or aid; to enlist; as, to engage friends to aid in a cause; to engage men for service. 3. To gain over; to win and attach; to attract and hold; to draw. Good nature engages everybody to him. Addison. 4. To employ the attention and efforts of; to occupy; to engross; to draw on. Thus shall mankind his guardian care engage. Pope. Taking upon himself the difficult task of engaging him in conversation. Hawthorne. 5. To enter into contest with; to encounter; to bring to conflict. A favorable opportunity of engaging the enemy. Ludlow. 6. (Mach.)  To come into gear with; as, the teeth of one cogwheel engage those of another, or one part of a clutch engages the other part.\n\n1. To promise or pledge one's self; to enter into an obligation; to become bound; to warrant. How proper the remedy for the malady, I engage not. Fuller. 2. To embark in a business; to take a part; to employ or involve one's self; to devote attention and effort; to enlist; as, to engage in controversy. 3. To enter into conflict; to join battle; as, the armies engaged in a general battle. 4. (Mach.)  To be in gear, as two cogwheels working together.",
    "esteemer":
        "One who esteems; one who sets a high value on any thing. The proudest esteemer of his own parts. Locke.",
    "expiring":
        "1. Breathing out air from the lungs; emitting fluid or volatile matter; exhaling; breathing the last breath; dying; ending; terminating. 2. Pertaining to, or uttered at, the time of dying; as, expiring words; expiring groans.",
    "embodier": "One who embodies.",
    "expurge": "To purge away. [Obs.] Milton.",
    "elusive":
        "Tending to elude; using arts or deception to escape; adroitly escaping or evading; eluding the grasp; fallacious. Elusive of the bridal day, she gives Fond hopes to all, and all with hopes deceives. Pope. -- E*lu\"sive*ly, adv. -- E*lu\"sive*ness, n.",
    "exceptionless":
        "Without exception. A universal, . . . exceptionless disqualification. Bancroft.",
    "exuviate":
        "To shed an old covering or condition preliminary to taking on a new one; to molt. There is reason to suppose that very old crayfish do not exuviate every year. Huxley.",
    "equery": "Same as Equerry.",
    "epiphany":
        "1. An appearance, or a becoming manifest. Whom but just before they beheld transfigured and in a glorious epiphany upon the mount. Jer. Taylor. An epic poet, if ever such a difficult birth should make its epiphany in Paris. De Quincey. 2. (Eccl.)  A church festival celebrated on the 6th of January, the twelfth day after Christmas, in commemoration of the visit of the Magi of the East to Bethlehem, to see and worship the child Jesus; or, as others maintain, to commemorate the appearance of the star to the Magi, symbolizing the manifestation of Christ to the Gentles; Twelfthtide.",
    "entrammel": "To trammel; to entangle. Bp. Hacket.",
    "eerisome": "Causing fear; eerie. [Scot.]",
    "enrive": "To rive; to cleave. [Obs.]",
    "errand":
        "A special business intrusted to a messenger; something to be told or done by one sent somewhere for the purpose; often, a verbal message; a commission; as, the servant was sent on an errand; to do an errand. Also, one's purpose in going anywhere. I have a secret errand to thee, O king. Judg. iii. 19. I will not eat till I have told mine errand. Gen. xxiv. 33. mission.",
    "epicarp":
        "The external or outermost layer of a fructified or ripened ovary. See Illust. under Endocarp.",
    "excave": "To excavate. [Obs.] Cockeram.",
    "either":
        "1. One of two; the one or the other; -- properly used of two things, but sometimes of a larger number, for any one. Lepidus flatters both, Of both is flattered; but he neither loves, Nor either cares for him. Shak. Scarce a palm of ground could be gotten by either of the three. Bacon. There have been three talkers in Great British, either of whom would illustrate what I say about dogmatists. Holmes. 2. Each of two; the one and the other; both; -- formerly, also, each of any number. His flowing hair In curls on either cheek played. Milton. On either side . . . was there the tree of life. Rev. xxii. 2. The extreme right and left of either army never engaged. Jowett (Thucyd).\n\nprecedes two, or more, coördinate words or phrases, and is introductory to an alternative. It is correlative to or. Either he is talking, or he is pursuing, or he is in a journey, or peradventure he sleepeth. 1 Kings xviii. 27. Few writers hesitate to use either in what is called a triple alternative; such as, We must either stay where we are, proceed, or recede. Latham. Note: Either was formerly sometimes used without any correlation, and where we should now use or. Can the fig tree, my brethren, bear olive berries either a vine, figs James iii. 12.",
    "embroilment":
        "The act of embroiling, or the condition of being embroiled; entanglement in a broil. Bp. Burnet.",
    "eval": "Relating to time or duration. [Obs.]",
    "enchylemma":
        "The basal substance of the cell nucleus; a hyaline or granular substance, more or less fluid during life, in which the other parts of the nucleus are imbedded.",
    "escot":
        "See Scot, a tax. [Obs.]\n\nTo pay the reckoning for; to support; to maintain. [Obs.] Shak.",
    "eugetic": "Pertaining to, or derived from, eugenol; as, eugetic acid.",
    "eddy kite":
        "A quadrilateral, tailless kite, with convex surfaces exposed to the wind. This kite was extensively used by Eddy in his famous meteorological experiments. It is now generally superseded by the box kite.",
    "emblematic":
        "Pertaining to, containing, or consisting in, an emblem; symbolic; typically representative; representing as an emblem; as, emblematic language or ornaments; a crown is emblematic of royalty; white is emblematic of purity. -- Em`blem*at\"ic*al*ly, adv.",
    "exudation":
        "The act of exuding; sweating; a discharge of humors, moisture, juice, or gum, as through pores or incisions; also, the substance exuded. Resins, a class of proximate principles, existing in almost all plants and appearing on the external surface of many of them in the form of exudations. Am. Cyc.",
    "enderon":
        "The deep sensitive and vascular layer of the skin and mucous membranes. -- En`de*ron\"ic, a.",
    "expeditive": "Performing with speed. [Obs.] Bacon.",
    "evangelist":
        "A bringer of the glad tidings of Church and his doctrines. Specially: (a) A missionary preacher sent forth to prepare the way for a resident pastor; an itinerant missionary preacher. (b) A writer of one of the four Gospels (With the definite article); as, the four evangelists, Matthew, Mark, Luke, and John. (c) A traveling preacher whose efforts are chiefly directed to arouse to immediate repentance. The Apostles, so far as they evangelized, might claim the tittle though there were many evangelists who were not Apistles. Plumptre.",
    "elocutionist": "One who is versed in elocution; a teacher of elocution.",
    "endecaphyllous": "Composed of eleven leaflets; -- said of a leaf.",
    "epistrophe":
        "A figure in which successive clauses end with the same word or affirmation; e. g., \"Are they Hebrews so am I. Are they Israelites so am I.\" 2 Cor. xi. 22.",
    "expeditionary":
        "Of or pertaining to an expedition; as, an expeditionary force.",
    "epicele":
        "A cavity formed by the invagination of the outer wall of the body, as the atrium of an amphioxus and possibly the body cavity of vertebrates.",
    "exhaustion":
        "1. The act of draining out or draining off; the act of emptying completely of the contents. 2. The state of being exhausted or emptied; the state of being deprived of strength or spirits. 3. (Math.)  An ancient geometrical method in which an exhaustive process was employed. It was nearly equivalent to the modern method of limits. Note: The method of exhaustions was applied to great variety of propositions, pertaining to rectifications and quadratures, now investigated by the calculus.",
    "eyeglance": "A glance of eye.",
    "eperlan": "The European smelt (Osmerus eperlanus).",
    "export":
        "1. To carry away; to remove. [Obs.] [They] export honor from a man, and make him a return in envy. Bacon. 2. To carry or send abroad, or out of a country, especially to foreign countries, as merchandise or commodities in the way of commerce; -- the opposite of import; as, to export grain, cotton, cattle, goods, etc.\n\n1. The act of exporting; exportation; as, to prohibit the export of wheat or tobacco. 2. That which is exported; a commodity conveyed from one country or State to another in the way of traffic; -- used chiefly in the plural, exports. The ordinary course of exchange . . . between two places must likewise be an indication of the ordinary course of their exports and imports. A. Smith.",
    "eatage":
        "Eatable growth of grass for horses and cattle, esp. that of aftermath.",
    "entothorax": "See Endothorax.",
    "erelong":
        "Before the ere long. A man, . . . following the stag, erelong slew him. Spenser. The world, erelong, a world of tears must weep. Milton.",
    "excitive":
        "Serving or tending to excite; excitative. [R.] Bamfield.\n\nThat which excites; an excitant. [R.]",
    "emmantle":
        "To cover over with, or as with, a mantle; to put about as a protection. [Obs.] Holland.",
    "emphatic":
        "1. Uttered with emphasis; made prominent and impressive by a peculiar stress of voice; laying stress; deserving of stress or emphasis; forcible; impressive; strong; as, to remonstrate in am emphatic manner; an emphatic word; an emphatic tone; emphatic reasoning. 2. Striking the sense; attracting special attention; impressive; forcible. \"Emphatical colors.\" Boyle. \"Emphatical evils.\" Bp. Reynolds. Syn. -- Forcible; earnest; impressive; energetic; striking; positive; important; special; significant.",
    "epi":
        "A prefix, meaning upon, beside, among, on the outside, above, over. It becomes ep- before a vowel, as in epoch, and eph- before a Greek aspirate, as in ephemeral.",
    "endenizen":
        "To admit to the privileges of a denizen; to naturalize. [Obs.] B. Jonson.",
    "euphorbiaceous": "Of, relating to, or resembling, the Euphorbia family.",
    "exilement": "Banishment. [R.] Sir. H. Wotton.",
    "epispadias":
        "A deformity in which the urethra opens upon the top of the penis, instead of at its extremity.",
    "encounterer": "One who encounters; an opponent; an antagonist. Atterbury.",
    "exegesis":
        "1. Exposition; explanation; especially, a critical explanation of a text or portion of Scripture. 2. (Math.)  The process of finding the roots of an equation. [Obs.]",
    "eupatorium":
        "A genus of perennial, composite herbs including hemp agrimony, boneset, throughwort, etc.",
    "evangelicalism":
        "Adherence to evangelical doctrines; evangelism. G. Eliot.",
    "entogenous": "See Endogenous.",
    "epaxial":
        "Above, or on the dorsal side of, the axis of the skeleton; episkeletal.",
    "excruciable": "Liable to torment. [R.] Bailey.",
    "eyedrop": "A tear. [Poetic] Shak.",
    "elytrum":
        "(a) One of the anterior pair of wings in the Coleoptera and some other insects, when they are thick and serve only as a protection for the posterior pair. See Coleoptera. (b) One of the shieldlike dorsal scales of certain annelids. See Chætopoda.",
    "enfiled":
        "Having some object, as the head of a man or beast, impaled upon it; as, a sword which is said to be \"enfiled of\" the thing which it pierces.",
    "ensafe": "To make safe. [Obs.] Hall.",
    "elementariness":
        "The state of being elementary; original simplicity; uncompounded state.",
    "exciter":
        "One who, or that which, excites. Hope is the grand exciter of industry. Dr. H. More.",
    "eupatrid": "One well born, or of noble birth.",
    "enneagonal": "Belonging to an enneagon; having nine angles.",
    "euphotide":
        "A rock occurring in the Alps, consisting of saussurite and smaragdite; -- sometimes called gabbro.",
    "escent":
        "A suffix signifying beginning, beginning to be; as, adolescent, effervescent, etc.",
    "exactness":
        "1. The condition of being exact; accuracy; nicety; precision; regularity; as, exactness of jurgement or deportment. 2. Careful observance of method and conformity to truth; as, exactness in accounts or business. He had . . . that sort of exactness which would have made him a respectable antiquary. Macaulay.",
    "exuscitate": "See Exsuscitate [Obs.] T. Adams.",
    "ebriety":
        "Drunkenness; intoxication by spirituous liquors; inebriety. \"Ruinous ebriety.\" Cowper.",
    "embale":
        "1. To make up into a bale or pack. Johnson. 2. To bind up; to inclose. Legs . . . embaled in golden buskins. Spenser.",
    "estimable":
        "1. Capable of being estimated or valued; as, estimable damage. Paley. . 2. Valuable; worth a great price. [R.] A pound of man's flesh, taken from a man, Is not so estimable, profitable neither, As flesh of muttons, beefs, or goats. Shak. 3. Worth of esteem or respect; deserving our good opinion or regard. A lady said of her two companions, that one was more amiable, the other more estimable. Sir W. Temple.\n\nA thing worthy of regard. [R.] One of the peculiar estimables of her country. Sir T. Browne.",
    "evolutional":
        "Relating to evolution. \"Evolutional changes.\" H. Spenser.",
    "effort":
        "1. An exertion of strength or power, whether physical or mental, in performing an act or aiming at an object; more or less strenuous endeavor; struggle directed to the accomplishment of an object; as, an effort to scale a wall. We prize the stronger effort of his power. Pope. 2. (Mech.)  A force acting on a body in the direction of its motion. Rankine. Syn. -- Endeavor; exertion; struggle; strain; straining; attempt; trial; essay. See Attempt.\n\nTo stimulate. [Obs.] \"He efforted his spirits.\" Fuller.",
    "enigmatist": "One who makes, or talks in, enigmas. Addison.",
    "egyptologist":
        "One skilled in the antiquities of Egypt; a student of Egyptology.",
    "enguard": "To surround as with a guard. [Obs.] Shak.",
    "encrinital":
        "Relating to encrinites; containing encrinites, as certain kinds of limestone.",
    "ecthoreum":
        "The slender, hollow thread of a nettling cell or cnida. See Nettling cell. [Written also ecthoræum.]",
    "emulousness": "The quality of being emulous.",
    "escheat":
        "1. (Law) (a) (Feud. & Eng. Law) The falling back or reversion of lands, by some casualty or accident, to the lord of the fee, in consequence of the extinction of the blood of the tenant, which may happen by his dying without heirs, and formerly might happen by corruption of blood, that is, by reason of a felony or attainder. Tomlins. Blackstone. (b) (U. S. Law) The reverting of real property to the State, as original and ultimate proprietor, by reason of a failure of persons legally entitled to hold the same. Note: A distinction is carefully made, by English writers, between escheat to the lord of the fee and forfeiture to the crown. But in this country, where the State holds the place of chief lord of the fee, and is entitled to take alike escheat and by forfeiture, this distinction is not essential. Tomlins. Kent. (c) A writ, now abolished, to recover escheats from the person in possession. Blackstone. 2. Lands which fall to the lord or the State by escheat. 3. That which falls to one; a reversion or return To make me great by others' loss is bad escheat. Spenser.\n\nTo revert, or become forfeited, to the lord, the crown, or the State, as lands by the failure of persons entitled to hold the same, or by forfeiture. Note: In this country it is the general rule that when the title to land fails by defect of heirs or devisees, it necessarily escheats to the State; but forfeiture of estate from crime is hardly known in this country, and corruption of blood is universally abolished. Kent. Bouvier.\n\nTo forfeit. Bp. Hall.",
    "essene":
        "One of a sect among the Jews in the time of our Savior, remarkable for their strictness and abstinence.",
    "emyd": "A fresh-water tortoise of the family Emydidæ.",
    "emend":
        "To purge of faults; to make better; to correct; esp., to make corrections in (a literary work); to alter for the better by textual criticism, generally verbal. Syn. -- To amend; correct; improve; better; reform; rectify. See Amend.",
    "estrich":
        "1. Ostrich. [Obs.] Massinger. 2. (Com.)  The down of the ostrich. Brande & C.",
    "eric":
        "A recompense formerly given by a murderer to the relatives of the murdered person.",
    "evulgation": "A divulging. [Obs.]",
    "excedent": "Excess. [R.]",
    "eyot":
        "A little island in a river or lake. See Ait. [Written also ait, ayt, eey, eyet, and eyght.] Blackstone.",
    "enigma":
        "1. A dark, obscure, or inexplicable saying; a riddle; a statement, the hidden meaning of which is to be discovered or guessed. A custom was among the ancients of proposing an enigma at festivals. Pope. 2. An action, mode of action, or thing, which cannot be satisfactorily explained; a puzzle; as, his conduct is an enigma.",
    "epididymitis":
        "Inflammation of the epididymis, one of the common results of gonorrhea.",
    "ensemble":
        "The whole; all the parts taken together.\n\nAll at once; together.",
    "emplace": "To put into place or position; to fix on an emplacement.",
    "equation":
        "1. A making equal; equal division; equality; equilibrium. Again the golden day resumed its right, And ruled in just equation with the night. Rowe. 2. (Math.)  An expression of the condition of equality between two algebraic quantities or sets of quantities, the sign = being placed between them; as, a binomial equation; a quadratic equation; an algebraic equation; a transcendental equation; an exponential equation; a logarithmic equation; a differential equation, etc. 3. (Astron.)  A quantity to be applied in computing the mean place or other element of a celestial body; that is, any one of the several quantities to be added to, or taken from, its position as calculated on the hypothesis of a mean uniform motion, in order to find its true position as resulting from its actual and unequal motion. Absolute equation. See under Absolute. -- Equation box, or Equational box, a system of differential gearing used in spinning machines for regulating the twist of the yarn. It resembles gearing used in equation clocks for showing apparent time. -- Equation of the center (Astron.), the difference between the place of a planet as supposed to move uniformly in a circle, and its place as moving in an ellipse. -- Equations of condition (Math.), equations formed for deducing the true values of certain quantities from others on which they depend, when different sets of the latter, as given by observation, would yield different values of the quantities sought, and the number of equations that may be found is greater than the number of unknown quantities. -- Equation of a curve (Math.), an equation which expresses the relation between the coördinates of every point in the curve. -- Equation of equinoxes (Astron.), the difference between the mean and apparent places of the equinox. -- Equation of payments (Arith.), the process of finding the mean time of payment of several sums due at different times. -- Equation of time (Astron.), the difference between mean and apparent time, or between the time of day indicated by the sun, and that by a perfect clock going uniformly all the year round. -- Equation clock or watch, a timepiece made to exhibit the differences between mean solar and apparent solar time. Knight. -- Normal equation. See under Normal. -- Personal equation (Astron.), the difference between an observed result and the true qualities or peculiarities in the observer; particularly the difference, in an average of a large number of observation, between the instant when an observer notes a phenomenon, as the transit of a star, and the assumed instant of its actual occurrence; or, relatively, the difference between these instants as noted by two observers. It is usually only a fraction of a second; -- sometimes applied loosely to differences of judgment or method occasioned by temperamental qualities of individuals. -- Theory of equations (Math.), the branch of algebra that treats of the properties of a single algebraic equation of any degree containing one unknown quantity.",
    "encash": "To turn into cash; to cash. Sat. Rev.",
    "emblement":
        "The growing crop, or profits of a crop which has been sown or planted; -- used especially in the plural. The produce of grass, trees, and the like, is not emblement. Wharton's Law Dict.",
    "elixation": "A seething; digestion. [Obs.] Burton.",
    "escharotic":
        "Serving or tending to form an eschar;; producing a scar; caustic.\n\nA substance which produces an eschar; a caustic, esp., a mild caustic.",
    "euxanthic":
        "Having a yellow color; pertaining to, derived from, or resembling, euxanthin. Euxanthic acid (Chem.), a yellow, crystalline, organic acid, extracted from euxanthin.",
    "emphractic": "Having the quality of closing the pores of the skin.",
    "ensignship": "The state or rank of an ensign.",
    "elogist": "One who pronounces an éloge.",
    "eolis":
        "A genus of nudibranch mollusks having clusters of branchial papillæ along the back. See Ceratobranchia. [Written also Æolis.]",
    "entozooelogist": "One versed in the science of the Entozoa.",
    "ephemeron": "One of the ephemeral flies.",
    "entheastic": "Of godlike energy; inspired. -- En`the*as\"tic*al*ly, adv.",
    "exestuate": "To be agitated; to boil up; to effervesce. [Obs.]",
    "escarbuncle": "See Carbuncle, 3.",
    "egilopical":
        "Pertaining to, of the nature of, or affected with, an ægilops, or tumor in the corner of the eye.",
    "emprise":
        "1. An enterprise; endeavor; adventure. Chaucer. In brave pursuit of chivalrous emprise. Spenser. The deeds of love and high emprise. Longfellow. 2. The qualifies which prompt one to undertake difficult and dangerous exploits. I love thy courage yet and bolt emprise; But here thy sword can do thee little stead. Milton.\n\nTo undertake. [Obs.] Sackville.",
    "epigrammatizer":
        "One who writes in an affectedly pointed style. Epigrammatizers of our English prose style. Coleridge.",
    "endamageable": "Capable of being damaged, or injured; damageable. [Obs.]",
    "etter pike": "The stingfish, or lesser weever (Tranchinus vipera).",
    "eyed":
        "Heaving (such or so many) eyes; -- used in composition; as sharp-eyed; dull-eyed; sad-eyed; ox-eyed Juno; myriad-eyed.",
    "eye-spotted":
        "Marked with spots like eyes. Junno's bird, in her eye-spotted train. Spenser.",
    "elevatory":
        "Tending to raise, or having power to elevate; as, elevatory forces.\n\nSee Elevator, n. (e). Dunglison.",
    "episternum":
        "1. (Anat.) (a) A median bone connected with the sternum, in many vertebrates; the interclavicle. (b) Same as Epiplastron. 2. (Zoöl.)  One of the lateral pieces next to the sternum in the thorax of insects.",
    "extraversion":
        "The act of throwing out; the state of being turned or thrown out. [Obs.] Boyle.",
    "earless": "Without ears; hence, deaf or unwilling to hear. Pope.",
    "ellipticity":
        "Deviation of an ellipse or a spheroid from the form of a circle or a sphere; especially, in reference to the figure of the earth, the difference between the equatorial and polar semidiameters, divided by the equatorial; thus, the ellipticity of the earth is Note: Some writers use ellipticity as the ratio of the difference of the two semiaxes to the minor axis, instead of the major. Nichol.",
    "exculpate":
        "To clear from alleged fault or guilt; to prove to be guiltless; to relieve of blame; to acquit. He exculpated himself from being the author of the heroic epistle. Mason. I exculpate him further for his writing against me. Milman. Syn. -- To exonerate; absolve; clear; acquit; excuse; vindicate; justify.",
    "enmanche":
        "Resembling, or covered with, a sleeve; -- said of the chief when lines are drawn from the middle point of the upper edge upper edge to the sides.",
    "electrify":
        "1. To communicate electricity to; to charge with electricity; as, to electrify a jar. 2. To cause electricity to pass through; to affect by electricity; to give an electric shock to; as, to electrify a limb, or the body. 3. To excite suddenly and violently, esp. by something highly delightful or inspiriting; to thrill; as, this patriotic sentiment electrified the audience. If the sovereign were now to immure a subject in defiance of the writ of habeas corpus . . . the whole nation would be instantly electrified by the news. Macaulay. Try whether she could electrify Mr. Grandcourt by mentioning it to him at table. G. Eliot.\n\nTo become electric.",
    "egling": "The European perch when two years old. [Prov. Eng.]",
    "espauliere":
        "A defense for the shoulder, composed of flexible overlapping plates of metal, used in the 15th century; -- the origin of the modern epaulette. Fairholt.",
    "evesdrop": "See Eavesdrop.",
    "evil eye": ". See Evil eye under Evil, a.",
    "exactor":
        "One who exacts or demands by authority or right; hence, an extortioner; also, one unreasonably severe in injunctions or demands. Jer. Taylor.",
    "epiphyte":
        "1. (Bot.)  An air plant which grows on other plants, but does not derive its nourishment from them. See Air plant. 2. (Med.)  A vegetable parasite growing on the surface of the body.",
    "encheson": "Occasion, cause, or reason. [Obs.] Chaucer.",
    "elucidatory": "Tending to elucidate; elucidative. [R.]",
    "extrajudicial":
        "Out of or beyond the proper authority of a court or judge; beyond jurisdiction; not legally required. \"An extrajudicial opinion.\" Hallam. -- Ex`tra*ju*di\"cial*ly, adv.",
    "elegy":
        "A mournful or plaintive poem; a funereal song; a poem of lamentation. Shak.",
    "elve": "An old form of Elf.",
    "equivocal":
        "1. (Literally, called equally one thing or the other; hence:) Having two significations equally applicable; capable of double interpretation; of doubtful meaning; ambiguous; uncertain; as, equivocal words; an equivocal sentence. For the beauties of Shakespeare are not of so dim or equivocal a nature as to be visible only to learned eyes. Jeffrey. 2. Capable of being ascribed to different motives, or of signifying opposite feelings, purposes, or characters; deserving to be suspected; as, his actions are equivocal. \"Equivocal repentances.\" Milton. 3. Uncertain, as an indication or sign; doubtful. \"How equivocal a test.\" Burke. Equivocal chord (Mus.), a chord which can be resolved into several distinct keys; one whose intervals, being all minor thirds, do not clearly indicate its fundamental tone or root; the chord of the diminished triad, and the diminished seventh. Syn. -- Ambiguous; doubtful; uncertain; indeterminate. -- Equivocal, Ambiguous. We call an expression ambiguous when it has one general meaning, and yet contains certain words which may be taken in two different senses; or certain clauses which can be so connected with other clauses as to divide the mind between different views of part of the meaning intended. We call an expression equivocal when, taken as a whole, it conveys a given thought with perfect clearness and propriety, and also another thought with equal propriety and clearness. Such were the responses often given by the Delphic oracle; as that to Crambiguous is a mere blunder of language; what is equivocal is usually intended to deceive, though it may occur at times from mere inadvertence. Equivocation is applied only to cases where there is a design to deceive.\n\nA word or expression capable of different meanings; an ambiguous term; an equivoque. In languages of great ductility, equivocals like that just referred to are rarely found. Fitzed. Hall.",
    "extractable": "Capable of being extracted.",
    "exciseman":
        "An officer who inspects and rates articles liable to excise duty. Macaulay.",
    "extinguisher":
        "One who, or that which, extinguishes; esp., a hollow cone or other device for extinguishing a flame, as of a torch or candle.",
    "envoyship": "The office or position of an envoy.",
    "emigrant":
        "1. Removing from one country to another; emigrating; as, an emigrant company or nation. 2. Pertaining to an emigrant; used for emigrants; as, an emigrant ship or hospital.\n\nOne who emigrates, or quits one country or region to settle in another. Syn. -- Emigrant, Immigrant. Emigrant and emigration have reference to the country from which the migration is made; the correlative words immigrant and immigration have reference to the country into which the migration is made, the former marking the going out from a country, the latter the coming into it.",
    "enmure": "To immure. [Obs.]",
    "endanger":
        "1. To put to hazard; to bring into danger or peril; to expose to loss or injury; as, to endanger life or peace. All the other difficulties of his reign only exercised without endangering him. Burke. 2. To incur the hazard of; to risk. [Obs.] He that turneth the humors back . . . endangereth malign ulcers. Bacon.",
    "earwitness":
        "A witness by means of his ears; one who is within hearing and does hear; a hearer. Fuller.",
    "ensure": "1. To make sure. See Insure. 2. To betroth. [Obs.] Sir T. More.",
    "evestigate": "To investigate. [Obs.] Bailey.",
    "executant":
        "One who executes or performs; esp., a performer on a musical instrument. Great executants on the organ. De Quincey.",
    "earl marshal":
        "An officer of state in England who marshals and orders all great ceremonials, takes cognizance of matters relating to honor, arms, and pedigree, and directs the proclamation of peace and war. The court of chivalry was formerly under his jurisdiction, and he is still the head of the herald's office or college of arms.",
    "ellipsoid":
        "A solid, all plane sections of which are ellipses or circles. See Conoid, n., 2 (a). Note: The ellipsoid has three principal plane sections, a, b, and c, each at right angles to the other two, and each dividing the solid into two equal and symmetrical parts. The lines of meeting of these principal sections are the axes, or principal diameters of the ellipsoid. The point where the three planes meet is the center. Ellipsoid of revolution, a spheroid; a solid figure generated by the revolution of an ellipse about one of its axes. It is called a prolate spheroid, or prolatum, when the ellipse is revolved about the major axis, and an oblate spheroid, or oblatum, when it is revolved about the minor axis.\n\nPertaining to, or shaped like, an ellipsoid; as, ellipsoid or ellipsoidal form.",
    "emulatress": "A female emulator. [R.]",
    "encolor": "To color. [R.]",
    "endermically": "By the endermic method; as, applied endermically.",
    "erodent": "A medicine which eats away extraneous growths; a caustic.",
    "ennui":
        "A feeling of weariness and disgust; dullness and languor of spirits, arising from satiety or want of interest; tedium. T. Gray.",
    "ectolecithal":
        "Having the food yolk, at the commencement of segmentation, in a peripheral position, and the cleavage process confined to the center of the egg; as, ectolecithal ova.",
    "economy":
        "1. The management of domestic affairs; the regulation and government of household matters; especially as they concern expense or disbursement; as, a careful economy. Himself busy in charge of the household economies. Froude. 2. Orderly arrangement and management of the internal affairs of a state or of any establishment kept up by production and consumption; esp., such management as directly concerns wealth; as, political economy. 3. The system of rules and regulations by which anything is managed; orderly system of regulating the distribution and uses of parts, conceived as the result of wise and economical adaptation in the author, whether human or divine; as, the animal or vegetable economy; the economy of a poem; the Jewish economy. The position which they [the verb and adjective] hold in the general economy of language. Earle. In the Greek poets, as also in Plautus, we shall see the economy . . . of poems better observed than in Terence. B. Jonson. The Jews already had a Sabbath, which, as citizens and subjects of that economy, they were obliged to keep. Paley. 4. Thrifty and frugal housekeeping; management without loss or waste; frugality in expenditure; prudence and disposition to save; as, a housekeeper accustomed to economy but not to parsimony. Political economy. See under Political. Syn. -- Economy, Frugality, Parsimony. Economy avoids all waste and extravagance, and applies money to the best advantage; frugality cuts off indulgences, and proceeds on a system of saving. The latter conveys the idea of not using or spending superfluously, and is opposed to lavishness or profusion. Frugality is usually applied to matters of consumption, and commonly points to simplicity of manners; parsimony is frugality carried to an extreme, involving meanness of spirit, and a sordid mode of living. Economy is a virtue, and parsimony a vice. I have no other notion of economy than that it is the parent to liberty and ease. Swift. The father was more given to frugality, and the son to riotousness [luxuriousness]. Golding.",
    "errant":
        "1. Wandering; deviating from an appointed course, or from a direct path; roving. Seven planets or errant stars in the lower orbs of heaven. Sir T. Browne. 2. Notorious; notoriously bad; downright; arrant. Would make me an errant fool. B. Jonson. 3. (Eng. Law)  Journeying; itinerant; -- formerly applied to judges who went on circuit and to bailiffs at large. Mozley & W.\n\nOne who wanders about. [Obs.] Fuller.",
    "escurial":
        "A palace and mausoleum of the kinds of Spain, being a vast and wonderful structure about twenty-five miles northwest of Madrid. Note: The ground plan is said to be in the form of a gridiron, the structure being designed in honor of St. Lawrence, who suffered martyrdom by being broiled on gridiron; but the resemblance is very slight. It is nearly square, inclosing several courts, and has a projecting mass which stands for the handle.",
    "esperance": "Hope. [Obs.] Shak.",
