    "exiccate": "See Exsiccate. [Obs.] Holland.",
    "extuberate": "To swell out. [Obs.] Cockeram.",
    "escroll":
        "1. A scroll. [Obs.] 2. (Her.) (a) A long strip or scroll resembling a ribbon or a band of parchment, or the like, anciently placed above the shield, and supporting the crest. (b) In modern heraldry, a similar ribbon on which the motto is inscribed.",
    "experimentally": "By experiment; by experience or trial. J. S. Mill.",
    "elfin": "Relating to elves.\n\nA little elf or urchin. Shenstone.",
    "eghen": "Eyes. [Obs.] Chaucer.",
    "elaborate":
        "Wrought with labor; finished with great care; studied; executed with exactness or painstaking; as, an elaborate discourse; an elaborate performance; elaborate research. Drawn to the life in each elaborate page. Waller. Syn. -- Labored; complicated; studied; perfected; high-wrought. -- E*lab\"o*rate*ly, adv. -- E*lab\"o*rate*ness, n.\n\n1. To produce with labor They in full joy elaborate a sigh, Young. 2. To perfect with painstaking; to improve or refine with labor and study, or by successive operations; as, to elaborate a painting or a literary work. The sap is . . . still more elaborated and exalted as it circulates through the vessels of the plant. Arbuthnot.",
    "excernent": "Connected with, or pertaining to, excretion.",
    "epanorthosis":
        "A figure by which a speaker recalls a word or words, in order to substitute something else stronger or more significant; as, Most brave! Brave, did I say most heroic act!",
    "exhaust":
        "1. To draw or let out wholly; to drain off completely; as, to exhaust the water of a well; the moisture of the earth is exhausted by evaporation. 2. To empty by drawing or letting out the contents; as, to exhaust a well, or a treasury. 3. To drain, metaphorically; to use or expend wholly, or till the supply comes to an end; to deprive wholly of strength; to use up; to weary or tire out; to wear out; as, to exhaust one's strength, patience, or resources. A decrepit, exhausted old man at fifty-five. Motley. 4. To bring out or develop completely; to discuss thoroughly; as, to exhaust a subject. 5. (Chem.)  To subject to the action of various solvents in order to remove all soluble substances or extractives; as, to exhaust a drug successively with water, alcohol, and ether. Exhausted receiver. (Physics) See under Receiver. Syn. -- To spend; consume; tire out; weary.\n\n1. Drained; exhausted; having expended or lost its energy. 2. Pertaining to steam, air, gas, etc., that is released from the cylinder of an engine after having preformed its work. Exhaust draught, a forced draught produced by drawing air through a place, as through a furnace, instead of blowing it through. -- Exhaust fan, a fan blower so arranged as to produce an exhaust draught, or to draw air or gas out of a place, as out of a room in ventilating it. -- Exhaust nozzle, Exhaust orifice (Steam Engine), the blast orifice or nozzle. -- Exhaust pipe (Steam Engine), the pipe that conveys exhaust steam from the cylinder to the atmosphere or to the condenser. Exhaust port (Steam Engine), the opening, in the cylinder or valve, by which the exhaust steam escapes. -- Exhaust purifier (Milling), a machine for sorting grains, or purifying middlings by an exhaust draught. Knight. -- Exhaust steam (Steam Engine), steam which is allowed to escape from the cylinder after having been employed to produce motion of the piston. -- Exhaust valve (Steam Engine), a valve that lets exhaust steam escape out of a cylinder.\n\n1. The steam let out of a cylinder after it has done its work there. 2. The foul air let out of a room through a register or pipe provided for the purpose.",
    "encage": "To confine in a cage; to coop up. Shak.",
    "equinoctially": "Towards the equinox.",
    "engrailment":
        "1. The ring of dots round the edge of a medal, etc. Brande & C. 2. (Her.)  Indentation in curved lines, as of a line of division or the edge of an ordinary.",
    "entwist": "To twist or wreathe round; to intwine. Shak.",
    "effervescency":
        "A kind of natural ebullition; that commotion of a fluid which takes place when some part of the mass flies off in a gaseous form, producing innumerable small bubbles; as, the effervescence of a carbonate with citric acid.",
    "excitator": "A kind of discarder.",
    "exaggerated":
        "Enlarged beyond bounds or the truth. -- Ex*ag\"ger*a`ted*ly, adv.",
    "edibleness": "Suitableness for being eaten.",
    "ecbolic":
        "A drug, as ergot, which by exciting uterine contractions promotes the expulsion of the contents of the uterus.",
    "earthlight":
        "The sunlight reflected from the earth to the moon, by which we see faintly, when the moon is near the sun (either before or after new moon), that part of the moon's disk unillumined by direct sunlight, or \"the old moon in the arms of the new.\"",
    "elegiast": "One who composes elegies. Goldsmith.",
    "encarnalize":
        "To carnalize; to make gross. [R.] \"Encarnalize their spirits.\" Tennyson.",
    "extispicious":
        "Relating to the inspection of entrails for prognostication. [Obs.] Sir T. Browne.",
    "ectoderm":
        "(a) The outer layer of the blastoderm; epiblast. (b) The external skin or outer layer of an animal or plant, this being formed in an animal from the epiblast. See Illust. of Blastoderm.",
    "enshield":
        "To defend, as with a shield; to shield. [Archaic] Shak.\n\nShielded; enshielded. [Obs.] Shak.",
    "edifier":
        "1. One who builds. [Obs.] 2. One who edifies, builds up, or strengthens another by moral or religious instruction.",
    "epigraphy":
        "The science of inscriptions; the art of engraving inscriptions or of deciphering them.",
    "errata": "See Erratum."
