        "A soldier enlisted for home service only; -- usually in the pl.",
    "forehanded":
        "1. Early; timely; seasonable. \"Forehanded care.\" Jer. Taylor. 2. Beforehand with one's needs, or having resources in advance of one's necessities; in easy circumstances; as, a forehanded farmer. [U.S.] 3. Formed in the forehand or fore parts. A substantial, true-bred beast, bravely forehanded. Dryden.",
    "flabellate": "Flabelliform.",
    "figurability": "The quality of being figurable. Johnson.",
    "figurative":
        "1. Representing by a figure, or by resemblance; typical; representative. This, they will say, was figurative, and served, by God's appointment, but for a time, to shadow out the true glory of a more divine sanctity. Hooker. 2. Used in a sense that is tropical, as a metaphor; not literal; -- applied to words and expressions. 3. Ambounding in figures of speech; flowery; florid; as, a highly figurative description. 4. Relating to the representation of form or figure by drawing, carving, etc. See Figure, n., 2. They belonged to a nation dedicated to the figurative arts, and they wrote for a public familiar with painted form. J. A. Symonds. Figurative counterpointdescant. See under Figurate. -- Fig\"ur*a*tive*ly, adv. -- Fig\"ur*a*tive*ness, n.",
    "fence":
        "1. That which fends off attack or danger; a defense; a protection; a cover; security; shield. Let us be backed with God and with the seas, Which he hath given for fence impregnable. Shak. A fence betwixt us and the victor's wrath. Addison. 2. An inclosure about a field or other space, or about any object; especially, an inclosing structure of wood, iron, or other material, intended to prevent intrusion from without or straying from within. Leaps o'er the fence with ease into the fold. Milton. Note: In England a hedge, ditch, or wall, as well as a structure of boards, palings, or rails, is called a fence. 3. (Locks)  A projection on the bolt, which passes through the tumbler gates in locking and unlocking. 4. Self-defense by the use of the sword; the art and practice of fencing and sword play; hence, skill in debate and repartee. See Fencing. Enjoy your dear wit, and gay rhetoric, That hath so well been taught her dazzing fence. Milton. Of dauntless courage and consummate skill in fence. Macaulay. 5. A receiver of stolen goods, or a place where they are received. [Slang] Mayhew.\n\n1. To fend off danger from; to give security to; to protect; to guard. To fence my ear against thy sorceries. Milton. 2. To inclose with a fence or other protection; to secure by an inclosure. O thou wall! . . . dive in the earth, And fence not Athens. Shak. A sheepcote fenced about with olive trees. Shak. To fence the tables (Scot. Church), to make a solemn address to those who present themselves to commune at the Lord's supper, on the feelings appropriate to the service, in order to hinder, so far as possible, those who are unworthy from approaching the table. McCheyne.\n\n1. To make a defense; to guard one's self of anything, as against an attack; to give protection or security, as by a fence. Vice is the more stubborn as well as the more dangerous evil, and therefore, in the first place, to be fenced against. Locke. 2. To practice the art of attack and defense with the sword or with the foil, esp. with the smallsword, using the point only. He will fence with his own shadow. Shak. 3. Hence, to fight or dispute in the manner of fencers, that is, by thrusting, guarding, parrying, etc. They fence and push, and, pushing, loudly roar; Their dewlaps and their sides are batDryden. As when a billow, blown against, Falls back, the voice with which I fenced A little ceased, but recommenced. Tennyson.",
    "fagotto":
        "The bassoon; -- so called from being divided into parts for ease of carriage, making, as it were, a small fagot.",
    "ferruginated": "Having the color or properties of the rust of iron.",
    "fetishistic":
        "Pertaining to, or involving, fetichism. A man of the fifteenth century, inheriting its strange web of belief and unbelief, of epicurean levity and fetichistic dread. G. Eliot.\n\nSee Fetich, n., Fetichism, n., Fetichistic, a.",
    "flapdragon":
        "1. A game in which the players catch raisins out burning brandy, and swallow them blazing. Johnson. 2. The thing thus caught abd eaten. Johnson. Cakes and ale, and flapdragtons and mummer's plays, and all the happy sports of Christians night. C. Kingsley.\n\nTo swallow whole, as a flapdragon; to devour. [Obs.] See how the sea flapdragoned it. Shak.",
    "forepart":
        "The part most advanced, or first in time or in place; the beginning.",
    "flying squirrel":
        "One of a group of squirrels, of the genera Pteromus and Sciuropterus, having parachute-like folds of skin extending from the fore to the hind legs, which enable them to make very long leaps. Note: The species of Pteromys are large, with bushy tails, and inhabit southern Asia and the East Indies; those of Sciuropterus are smaller, with flat tails, and inhabit the northern parts of Europe, Asia, and America. The American species (Sciuropterus volucella) is also called Assapan. The Australian flying squrrels, or flying phalangers, are marsupials. See Flying phalanger (above).",
    "francolite": "A variety of apatite from Wheal Franco in Devonshire.",
    "fustilug": "A gross, fat, unwieldy person. [Obs.] F. Junius.",
    "foolify": "To make a fool of; to befool. [R.] Holland.",
    "fasciculated": "Grouped in a fascicle; fascicled.",
    "ferme":
        "Rent for a farm; a farm; also, an abode; a place of residence; as, he let his land to ferm. [Obs.] Out of her fleshy ferme fled to the place of pain. Spenser.",
    "foutra":
        "A fig; -- a word of contempt. [Obs.] A foutra for the world and wordlings base! Shak.",
    "furore": "Excitement; commotion; enthusiasm.",
    "featherless": "Destitute of feathers.",
    "fulvous": "Tawny; dull yellow, with a mixture of gray and brown. Lindley.",
    "floriculturist": "One skilled in the cultivation of flowers; a florist.",
    "forgetfulness":
        "1. The quality of being forgetful; prononess to let slip from the mind. 2. Loss of remembrance or recollection; a ceasing to remember; oblivion. A sweet forgetfulness of human care. Pope. 3. Failure to bear in mind; careless omission; inattention; as, forgetfulness of duty. Syn. -- Forgetfulnes, Oblivion. Forgetfulness is Anglo-Saxon, and oblivion is Latin. The former commonly has reference to persons, and marks a state of mind, and marks a state of mind; the latter commonly has reference to things, and indicates a condition into which they are sunk. We blame a man for his forgetfulness; we speak of some old custom as buried in oblivion. But this discrimination is not strictly adhered to.",
    "friz":
        "1. To curl or form into small curls, as hair, with a crisping pin; to crisp. With her hair frizzed short up to her ears. Pepys. 2. To form into little burs, prominences, knobs, or tufts, as the nap of cloth. 3. (Leather Manufacture)  To soften and make of even thickness by rubbing, as with pumice stone or a blunt instrument. Frizzing machine. (a) (Fabrics) A machine for frizzing the surface of cloth. (b) (Wood Working) A bench with a revolving cutter head slightly protruding above its surface, for dressing boards.\n\nThat which is frizzed; anything crisped or curled, as a wig; a frizzle. [Written also frizz.] He [Dr. Johnson], who saw in his glass how his wig became his face and head, might easily infer that a similar fullbottomed, well-curled friz of words would be no less becoming to his thoughts. Hare.",
    "flagon":
        "A vessel with a narrow mouth, used for holding and conveying liquors. It is generally larger than a bottle, and of leather or stoneware rather than of glass. A trencher of mutton chops, and a flagon of ale. Macaulay.",
    "frondiferous": "Producing fronds.",
    "finative":
        "Conclusive; decisive; definitive; final. [Obs.] Greene (1593).",
    "folium":
        "1. A leaf, esp. a thin leaf or plate. 2. (Geom.)  A curve of the third order, consisting of two infinite branches, which have a common asymptote. The curve has a double point, and a leaf-shaped loop; whence the name. Its equation is x3 + y3 = axy.",
    "freethinker":
        "One who speculates or forms opinions independently of the authority of others; esp., in the sphere or religion, one who forms opinions independently of the authority of revelation or of the church; an unbeliever; -- a term assumed by deists and skeptics in the eighteenth century. Atheist is an old-fashioned word: I'm a freethinker, child. Addison. Syn. -- Infidel; skeptic; unbeliever. See Infidel.",
    "fordrive": "To drive about; to drive here and there. [Obs.] Rom. of R.",
    "forswearer":
        "One who rejects of renounces upon oath; one who swears a false oath.",
    "fewel": "Fuel. [Obs.] Hooker.",
    "fiddle":
        "1. (Mus.)  A stringed instrument of music played with a bow; a violin; a kit. 2. (Bot.)  A kind of dock (Rumex pulcher) with fiddle-shaped leaves; -- called also fiddle dock. 3. (Naut.)  A rack or frame of bars connected by strings, to keep table furniture in place on the cabin table in bad weather. Ham. Nav. Encyc. Fiddle beetle (Zoöl.), a Japanese carabid beetle (Damaster blaptoides); -- so called from the form of the body. -- Fiddle block (Naut.), a long tackle block having two sheaves of different diameters in the same plane, instead of side by side as in a common double block. Knight. -- Fiddle bow, fiddlestick. -- Fiddle fish (Zoöl.), the angel fish. -- Fiddle head, an ornament on a ship's bow, curved like the volute or scroll at the head of a violin. -- Fiddle pattern, a form of the handles of spoons, forks, etc., somewhat like a violin. -- Scotch fiddle, the itch. (Low) -- To play first, or second, fiddle, to take a leading or a subordinate part. [Colloq.]\n\n1. To play on a fiddle. Themistocles . . . said he could not fiddle, but he could make a small town a great city. Bacon. 2. To keep the hands and fingers actively moving as a fiddler does; to move the hands and fingers restlessy or in busy idleness; to trifle. Talking, and fiddling with their hats and feathers. Pepys.\n\nTo play (a tune) on a fiddle.",
    "foresay":
        "To foretell. [Obs.] Her danger nigh that sudden change foresaid. Fairfax.",
    "fratricidal":
        "Of or pertaining to fratricide; of the nature of fratricide.",
    "flagitious":
        "1. Disgracefully or shamefully criminal; grossly wicked; scandalous; shameful; -- said of acts, crimes, etc. Debauched principles and flagitious practices. I. Taylor. 2. Guilty of enormous crimes; corrupt; profligate; -- said of persons. Pope. 3. Characterized by scandalous crimes or vices; as, flagitious times. Pope. Syn. -- Atrocious; villainous; flagrant; heinous; corrupt; profligate; abandoned. See Atracious. -- Fla*gi\"tious*ly, adv. -- Fla*gi\"tious*ness, n. A sentence so flagitiously unjust. Macaulay.",
    "flabby":
        "Yielding to the touch, and easily moved or shaken; hanging loose by its own weight; wanting firmness; flaccid; as, flabby flesh.",
    "frapler":
        "A blusterer; a rowdy. [Obs.] Unpolished, a frapler, and base. B. Jonson.",
    "flaming":
        "1. Emitting flames; afire; blazing; consuming; illuminating. 2. Of the color of flame; high-colored; brilliant; dazzling. \"In flaming yellow bright.\" Prior. 3. Ardent; passionate; burning with zeal; irrepressibly earnest; as, a flaming proclomation or harangue.",
    "fetishist":
        "A believer in fetiches. He was by nature a fetichist. H. Holbeach.\n\nSee Fetich, n., Fetichism, n., Fetichistic, a.",
    "flaxweed": "See Toadflax.",
    "fatling":
        "A calf, lamb, kid, or other young animal fattened for slaughter; a fat animal; -- said of such animals as are used for food. He sacrificed oxen and fatlings. 2 Sam. vi. 13.",
    "fuze plug":
        "1. (Ordnance)  A plug fitted to the fuse hole of a shell to hold the fuse. 2.  A fusible plug that screws into a receptacle, used as a fuse in electric wiring.",
    "flatteringly": "With flattery.",
    "fumigant": "Fuming. [R.]",
    "fairhood": "Fairness; beauty. [Obs.] Foxe.",
    "fly amanita":
        "A poisonous mushroom (Amanita muscaria, syn. Agaricus muscarius), having usually a bright red or yellowish cap covered with irregular white spots. It has a distinct volva at the base, generally an upper ring on the stalk, and white spores. Called also fly agaric, deadly amanita.",
    "fibrinoplastin":
        "An albuminous substance, existing in the blood, which in combination with fibrinogen forms fibrin; -- called also paraglobulin.",
    "foresaid": "Mentioned before; aforesaid.",
    "flaw":
        "1. A crack or breach; a gap or fissure; a defect of continuity or cohesion; as, a flaw in a knife or a vase. This heart Shall break into a hundered thousand flaws. Shak. 2. A defect; a fault; as, a flaw in reputation; a flaw in a will, in a deed, or in a statute. Has not this also its flaws and its dark side South. 3. A sudden burst of noise and disorder; a tumult; uproar; a quarrel. [Obs.] And deluges of armies from the town Came pouring in; I heard the mighty flaw. Dryden. 4. A sudden burst or gust of wind of short duration. Snow, and hail, and stormy gust and flaw. Milton. Like flaws in summer laying lusty corn. Tennyson. Syn. -- Blemish; fault; imoerfection; spot; speck.\n\n1. To crack; to make flaws in. The brazen caldrons with the frosts are flawed. Dryden. 2. To break; to violate; to make of no effect. [Obs.] France hath flawed the league. Shak.",
    "fiction":
        "1. The act of feigning, inventing, or imagining; as, by a mere fiction of the mind. Bp. Stillingfleet. 2. That which is feigned, invented, or imagined; especially, a feigned or invented story, whether oral or written. Hence: A story told in order to deceive; a fabrication; -- opposed to fact, or reality. The fiction of those golden apples kept by a dragon. Sir W. Raleigh. When it could no longer be denied that her flight had been voluntary, numerous fictions were invented to account for it. Macaulay. 3. Fictitious literature; comprehensively, all works of imagination; specifically, novels and romances. The office of fiction as a vehicle of instruction and moral elevation has been recognized by most if not all great educators. Dict. of Education. 4. (Law)  An assumption of a possible thing as a fact, irrespective of the question of its truth. Wharton. 5. Any like assumption made for convenience, as for passing more rapidly over what is not disputed, and arriving at points really at issue. Syn. -- Fabrication; invention; fable; falsehood. -- Fiction, Fabrication. Fiction is opposed to what is real; fabrication to what is true. Fiction is designed commonly to amuse, and sometimes to instruct; a fabrication is always intended to mislead and deceive. In the novels of Sir Walter Scott we have fiction of the highest order. The poems of Ossian, so called, were chiefly fabrications by Macpherson.",
    "fantasticism":
        "The quality of being fantastical; fancifulness; whimsicality. Ruskin.",
    "feyre": "A fair or market. [Obs.] Chaucer.",
    "footbridge": "A narrow bridge for foot passengers only.",
    "fidicinal": "Of or pertaining to a stringed instrument.",
    "forecast":
        "1. To plan beforehand; to scheme; to project. He shall forecast his devices against the strongholds. Dan. xi. 24. 2. To foresee; to calculate beforehand, so as to provide for. It is wisdom to consider the end of things before we embark, and to forecast consequences. L'Estrange.\n\nTo contrive or plan beforehand. If it happen as I did forecast. Milton.\n\nPrevious contrivance or determination; predetermination. He makes this difference to arise from the forecast and predetermination of the gods themselves. Addison. 2. Foresight of consequences, and provision against them; prevision; premeditation. His calm, deliberate forecast better fitted him for the council than the camp. Prescott.",
    "fluty": "Soft and clear in tone, like a flute.",
    "furbisher":
        "One who furbishes; esp., a sword cutler, who finishes sword blades and similar weapons.",
    "fellow":
        "1. A companion; a comrade; an associate; a partner; a sharer. The fellows of his crime. Milton. We are fellows still, Serving alike in sorrow. Shak. That enormous engine was flanked by two fellows almost of equal magnitude. Gibbon. Note: Commonly used of men, but sometimes of women. Judges xi. 37. 2. A man without good breeding or worth; an ignoble or mean man. Worth makes the man, and want of it, the fellow. Pope. 3. An equal in power, rank, character, etc. It is impossible that ever Rome Should breed thy fellow. Shak. 4. One of a pair, or of two things used together or suited to each other; a mate; the male. When they be but heifers of one year, . . . they are let go to the fellow and breed. Holland. This was my glove; here is the fellow of it. Shak. 5. A person; an individual. She seemed to be a good sort of fellow. Dickens. 6. In the English universities, a scholar who is appointed to a foundation called a fellowship, which gives a title to certain perquisites and privileges. 7. In an American college or university, a member of the corporation which manages its business interests; also, a graduate appointed to a fellowship, who receives the income of the foundation. 8. A member of a literary or scientific society; as, a Fellow of the Royal Society. Note: Fellow is often used in compound words, or adjectively, signifying associate, companion, or sometimes equal. Usually, such compounds or phrases are self-explanatory; as, fellow-citizen, or fellow citizen; fellow-student, or fellow student; fellow-workman, or fellow workman; fellow-mortal, or fellow mortal; fellow-sufferer; bedfellow; playfellow; workfellow. Were the great duke himself here, and would lift up My head to fellow pomp amongst his nobles. Ford.\n\nTo suit with; to pair with; to match. [Obs.] Shak.",
    "flatwise":
        "With the flat side downward, or next to another object; not edgewise.",
    "faded":
        "That has lost freshness, color, or brightness; grown dim. \"His faded cheek.\" Milton. Where the faded moon Made a dim silver twilight. Keats.",
    "flybane":
        "A kind of catchfly of the genus Silene; also, a poisonous mushroom (Agaricus muscarius); fly agaric.",
    "free silver":
        "The free coinage of silver; often, specif., the free coinage of silver at a fixed ratio with gold, as at the ratio of 16 to 1, which ratio for some time represented nearly or exactly the ratio of the market values of gold and silver respectively.",
    "forejudgment": "Prejudgment. [Obs.] Spenser.",
    "first-rate":
        "Of the highest excellence; preëminent in quality, size, or estimation. Our only first-rate body of contemporary poetry is the German. M. Arnold. Hermocrates . . . a man of first-rate ability. Jowett (Thucyd).\n\nA war vessel of the highest grade or the most powerful class.",
    "fendliche": "Fiendlike. [Obs.] Chaucer.",
    "frontated": "Growing broader and broader, as a leaf; truncate.",
    "fiduciary":
        "1. Involving confidence or trust; confident; undoubting; faithful; firm; as, in a fiduciary capacity. \"Fiduciary obedience.\" Howell. 2. Holding, held, or founded, in trust. Spelman.\n\n1. One who holds a thing in trust for another; a trustee. Instrumental to the conveying God's blessing upon those whose fiduciaries they are. Jer. Taylor. 2. (Theol.)  One who depends for salvation on faith, without works; an Antinomian. Hammond.",
    "fitchy": "Having fitches or vetches.\n\nFitché.",
    "fanion":
        "1. (Mil.)  A small flag sometimes carried at the head of the baggage of a brigade. [Obs.] 2. A small flag for marking the stations in surveying.",
    "forweep": "To weep much. [Obs.]",
    "fribbler": "A trifler; a fribble.",
    "fullage":
        "The money or price paid for fulling or cleansing cloth. Johnson.",
    "fumbler": "One who fumbles.",
    "formative":
        "1. Giving form; having the power of giving form; plastic; as, the formative arts. The meanest plant can not be raised without seed, by any formative residing in the soil. Bentley. 2. (Gram.)  Serving to form; derivative; not radical; as, a termination merely formative. 3. (Biol.)  Capable of growth and development; germinal; as, living or formative matter.\n\n(a) That which serves merely to give form, and is no part of the radical, as the prefix or the termination of a word. (b) A word formed in accordance with some rule or usage, as from a root.",
    "falter":
        "To thrash in the chaff; also, to cleanse or sift, as barley. [Prov. Eng.] Halliwell.\n\n1. To hesitate; to speak brokenly or weakly; to stammer; as, his tongue falters. With faltering speech and visage incomposed. Milton. 2. To tremble; to totter; to be unsteady. \"He found his legs falter.\" Wiseman. 3. To hesitate in purpose or action. Ere her native king Shall falter under foul rebellion's arms. Shak. 4. To fail in distinctness or regularity of exercise; -- said of the mind or of thought. Here indeed the power of disinct conception of space and distance falters. I. Taylor.\n\nTo utter with hesitation, or in a broken, trembling, or weak manner. And here he faltered forth his last farewell. Byron. Mde me most happy, faltering \"I am thine.\" Tennyson.\n\nHesitation; trembling; feebleness; an uncertain or broken sound; as, a slight falter in her voice. The falter of an idle shepherd's pipe. Lowell.",
    "five":
        "Four and one added; one more than four. Five nations (Ethnol.), a confederacy of the Huron-Iroquois Indians, consisting of five tribes: Mohawks, Onondagas, Cayugas, Oneidas, and Senecas. They inhabited the region which is now the State of new York.\n\n1. The number next greater than four, and less than six; five units or objects. Five of them were wise, and five were foolish. Matt. xxv. 2. 2. A symbol representing this number, as 5, or V.",
    "federation":
        "1. The act of uniting in a league; confederation. 2. A league; a confederacy; a federal or confederated government. Burke.",
    "forthink":
        "To repent; to regret; to be sorry for; to cause regret. [Obs.] \"Let it forthink you.\" Tyndale. That me forthinketh, quod this January. Chaucer.",
    "fabricator":
        "One who fabricates; one who constructs or makes. The fabricator of the works of Ossian. Mason.",
    "flatness":
        "1. The quality or state of being flat. 2. Eveness of surface; want of relief or prominence; the state of being plane or level. 3. Want of vivacity or spirit; prostration; dejection; depression. 4. Want of variety or flavor; dullness; inspidity. 5. Depression of tone; the state of being below the true pitch; -- opposed to sharpness or acuteness.",
    "featly":
        "Neatly; dexterously; nimbly. [Archaic] Foot featly here and there. Shak.",
    "fantigue":
        "State of worry or excitment; fidget; ill humor. [Prov. Eng.] Dickens.",
    "falchion":
        "1. A broad-bladed sword, slightly curved, shorter and lighter than the ordinary sword; -- used in the Middle Ages. 2. A name given generally and poetically to a sword, especially to the swords of Oriental and fabled warriors.",
    "fennel":
        "A perennial plant of the genus Fæniculum (F.vulgare), having very finely divided leaves. It is cultivated in gardens for the agreeable aromatic flavor of its seeds. Smell of sweetest fennel. Milton. A sprig of fennel was in fact the theological smelling bottle of the tender sex. S. G. Goodrich. Azorean, or Sweet, fennel, (Fæniculum dulce). It is a smaller and stouter plant than the common fennel, and is used as a pot herb. -- Dog's fennel (Anthemis Cotula), a foul-smelling European weed; -- called also mayweed. -- Fennel flower (Bot.), an herb (Nigella) of the Buttercup family, having leaves finely divided, like those of the fennel. N.Damascena is common in gardens. N.sativa furnishes the fennel seed, used as a condiment, etc., in India. These seeds are the \"fitches\" mentioned in Isaiah (xxviii. 25). -- Fennel water (Med.), the distilled water of fennel seed. It is stimulant and carminative. -- Giant fennel (Ferula communis), has stems full of pith, which, it is said, were used to carry fire, first, by Prometheus. -- Hog's fennel, a European plant (Peucedanum officinale) looking something like fennel.",
    "fetidness": "The quality or state of being fetid.",
    "florulent": "Flowery; blossoming. [Obs.] Blount.",
    "finfish":
        "(a) A finback whale. (b) (pl.) True fish, as distinguished from shellfish.",
    "flux":
        "1. The act of flowing; a continuous moving on or passing by, as of a flowing stream; constant succession; change. By the perpetual flux of the liquids, a great part of them is thrown out of the body. Arbuthnot. Her image has escaped the flux of things, And that same infant beauty that she wore Is fixed upon her now forevermore. Trench. Languages, like our bodies, are in a continual flux. Felton. 2. The setting in of the tide toward the shore, -- the (reflux. 3. The state of beinng liquid through heat; fusion. 4. (Chem.& Metal.)  Any substance or mixture used to promote the fusion of metals or minerals, as alkalies, borax, lime, fluorite. Note: White flux is the residuum of the combustion of a mixture of equal parts of niter and tartar. It consists chiefly of the carbonate of potassium, and is white.- Black flux is the ressiduum of the combustion of one part of niter and two of tartar, and consists essentially of a mixture of potassium carbonate and charcoal. 5. (Med.) (a) A fluid discharge from the bowels or other part; especially, an excessive and morbid discharge; as, the bloody flux or dysentery. See Bloody flux. (b) The matter thus discharged. 6. (Physics)  The quantity of a fluid that crosses a unit area of a given surface in a unit of time.\n\nFlowing; unstable; inconstant; variable. The flux nature of all things here. Barrow.\n\n1. To affect, or bring to a certain state, by flux. He might fashionably and genteelly . . . have been dueled or fluxed into another world. South. 2. To cause to become fluid; to fuse. Kirwan. 3. (Med.)  To cause a discharge from; to purge.",
    "fatty":
        "Containing fat, or having the qualities of fat; greasy; gross; as, a fatty substance. Fatty acid (Chem.), any one of the paraffin series of monocarbonic acids, as formic acid, acetic, etc.; -- so called because the higher members, as stearic and palmitic acids, occur in the natural fats, and are themselves fatlike substances. -- Fatty clays. See under Clay. -- Fatty degeneration (Med.), a diseased condition, in which the oil globules, naturally present in certain organs, are so multiplied as gradually to destroy and replace the efficient parts of these organs. -- Fatty heart, Fatty liver, etc. (Med.), a heart, liver, etc., which have been the subjects of fatty degeneration or infiltration. -- Fatty infiltration (Med.), a condition in which there is an excessive accumulation of fat in an organ, without destruction of any essential parts of the latter. -- Fatty tumor (Med.), a tumor consisting of fatty or adipose tissue; lipoma.",
    "foment":
        "1. To apply a warm lotion to; to bathe with a cloth or sponge wet with warm water or medicated liquid. 2. To cherish with heat; to foster. [Obs.] Which these soft fires . . . foment and warm. Milton. 3. To nurse to life or activity; to cherish and promote by excitements; to encourage; to abet; to instigate; -- used often in a bad sense; as, to foment ill humors. Locke. But quench the choler you foment in vain. Dryden. Exciting and fomenting a religious rebellion. Southey.",
    "forlay":
        "To lie in wait for; to ambush. An ambushed thief forlays a traveler. Dryden.",
    "falsehood":
        "1. Want of truth or accuracy; an untrue assertion or representation; error; misrepresentation; falsity. Though it be a lie in the clock, it is but a falsehood in the hand of the dial when pointing at a wrong hour, if rightly following the direction of the wheel which moveth it. Fuller. 2. A deliberate intentional assertion of what is known to be untrue; a departure from moral integrity; a lie. 3. Treachery; deceit; perfidy; unfaithfulness. Betrayed by falsehood of his guard. Shak. 4. A counterfeit; a false appearance; an imposture. For his molten image is falsehood. Jer. x. 14. No falsehood can endure Touch of celestial temper. Milton. Syn. -- Falsity; lie; untruth; fiction; fabrication. See Falsity.",
    "fere":
        "A mate or companion; -- often used of a wife. [Obs.] [Written also fear and feere.] Chaucer. And Cambel took Cambrina to his fere. Spenser. In fere, together; in company. [Obs.] Chaucer.\n\nFierce. [Obs.]\n\nFire. [Obs.] Chaucer.\n\nFear. [Obs.] Chaucer.\n\nTo fear. [Obs.] Chaucer.",
    "firth": "An arm of the sea; a frith.",
    "foliated":
