    "hibiscus":
        "A genus of plants (herbs, shrubs, or trees), some species of which have large, showy flowers. Some species are cultivated in India for their fiber, which is used as a substitute for hemp. See Althea, Hollyhock, and Manoe.",
    "holiday":
        "1. A consecrated day; religious anniversary; a day set apart in honor of some person, or in commemoration of some event. See Holyday. 2. A day of exemption from labor; a day of amusement and gayety; a festival day. And young and old come forth to play On a sunshine holiday. Milton. 3. (Law)  A day fixed by law for suspension of business; a legal holiday. Note: In the United States legal holidays, so called, are determined by law, commonly by the statutes of the several States. The holidays most generally observed are: the 22d day of February (Washington's birthday), the 30th day of May (Memorial day), the 4th day of July (Independence day), the 25th day of December (Christmas day). In most of the States the 1st day of January is a holiday. When any of these days falls on Sunday, usually the Monday following is observed as the holiday. In many of the States a day in the spring (as Good Friday, or the first Thursday in April), and a day in the fall (as the last Thursday in November) are now regularly appointed by Executive proclamation to be observed, the former as a day of fasting and prayer, the latter as a day of thanksgiving and are kept as holidays. In England, the days of the greater church feasts (designated in the calendar by a red letter, and commonly called red-letter days) are observed as general holidays. Bank holidays are those on which, by act of Parliament, banks may suspend business. Although Sunday is a holiday in the sense of a day when business is legally suspended, it is not usually included in the general term, the phrase \"Sundays and holidays\" being more common. The holidays, any fixed or usual period for relaxation or festivity; especially, Christmas and New Year's day with the intervening time.\n\n1. Of or pertaining to a festival; cheerful; joyous; gay. Shak. 2. Occurring rarely; adapted for a special occasion. Courage is but a holiday kind of virtue, to be seldom exercised. Dryden.",
    "hypostatic":
        "1. Relating to hypostasis, or substance; hence, constitutive, or elementary. The grand doctrine of the chymists, touching their three hypostatical principles. Boyle. 2. Personal, or distinctly personal; relating to the divine hypostases, or substances. Bp. Pearson. 3. (Med.)  Depending upon, or due to, deposition or setting; as, hypostatic cognestion, cognestion due to setting of blood by gravitation. Hypostatic union (Theol.), the union of the divine with the human nature of Christ. Tillotson.",
    "hysteresis":
        "A lagging or retardation of the effect, when the forces acting upon a body are changed, as if from velocity or internal friction; a temporary resistance to change from a condition previously invuced, observed in magnetism, thermoelectricity, etc., on reversal of polarity.",
    "hackmatack":
        "The American larch (Larix Americana), a coniferous tree with slender deciduous leaves; also, its heavy, close-grained timber. Called also tamarack.",
    "horn":
        "1. A hard, projecting, and usually pointed organ, growing upon the heads of certain animals, esp. of the ruminants, as cattle, goats, and the like. The hollow horns of the Ox family consist externally of true horn, and are never shed. 2. The antler of a deer, which is of bone throughout, and annually shed and renewed. 3. (Zoöl.)  Any natural projection or excrescence from an animal, resembling or thought to resemble a horn in substance or form; esp.: (a) A projection from the beak of a bird, as in the hornbill. (b) A tuft of feathers on the head of a bird, as in the horned owl. (c) A hornlike projection from the head or thorax of an insect, or the head of a reptile, or fish. (d) A sharp spine in front of the fins of a fish, as in the horned pout. 4. (Bot.)  An incurved, tapering and pointed appendage found in the flowers of the milkweed (Asclepias). 5. Something made of a horn, or in resemblance of a horn; as: (a) A wind instrument of music; originally, one made of a horn (of an ox or a ram); now applied to various elaborately wrought instruments of brass or other metal, resembling a horn in shape. \"Wind his horn under the castle wall.\" Spenser. See French horn, under French. (b) A drinking cup, or beaker, as having been originally made of the horns of cattle. \"Horns of mead and ale.\" Mason. (c) The cornucopia, or horn of plenty. See Cornucopia. \"Fruits and flowers from Amalthæa's horn.\" Milton. (d) A vessel made of a horn; esp., one designed for containing powder; anciently, a small vessel for carrying liquids. \"Samuel took the hornof oil and anointed him [David].\" 1 Sam. xvi. 13. (e) The pointed beak of an anvil. (f) The high pommel of a saddle; also, either of the projections on a lady's saddle for supporting the leg. (g) (Arch.) The Ionic volute. (h) (Naut.) The outer end of a crosstree; also, one of the projections forming the jaws of a gaff, boom, etc. (i) (Carp.) A curved projection on the fore part of a plane. (j) One of the projections at the four corners of the Jewish altar of burnt offering. \"Joab . . . caught hold on the horns of the altar.\" 1 Kings ii. 28. 6. One of the curved ends of a crescent; esp., an extremity or cusp of the moon when crescent-shaped. The moon Wears a wan circle round her blunted horns. Thomson. 7. (Mil.)  The curving extremity of the wing of an army or of a squadron drawn up in a crescentlike form. Sharpening in mooned horns Their phalanx. Milton. 8. The tough, fibrous material of which true horns are composed, being, in the Ox family, chiefly albuminous, with some phosphate of lime; also, any similar substance, as that which forms the hoof crust of horses, sheep, and cattle; as, a spoon of horn. 9. (Script.)  A symbol of strength, power, glory, exaltation, or pride. The Lord is . . . the horn of my salvation. Ps. xviii. 2. 10. An emblem of a cuckold; -- used chiefly in the plural. \"Thicker than a cuckold's horn.\" Shak. Horn block, the frame or pedestal in which a railway car axle box slides up and down; -- also called horn plate. -- Horn of a dilemma. See under Dilemma. -- Horn distemper, a disease of cattle, affecting the internal substance of the horn. -- Horn drum, a wheel with long curved scoops, for raising water. -- Horn lead (Chem.), chloride of lead. -- Horn maker, a maker of cuckolds. [Obs.] Shak. -- Horn mercury. (Min.) Same as Horn quicksilver (below). -- Horn poppy (Bot.), a plant allied to the poppy (Glaucium luteum), found on the sandy shores of Great Britain and Virginia; -- called also horned poppy. Gray. -- Horn pox (Med.), abortive smallpox with an eruption like that of chicken pox. -- Horn quicksilver (Min.), native calomel, or bichloride of mercury. -- Horn shell (Zoöl.), any long, sharp, spiral, gastropod shell, of the genus Cerithium, and allied genera. -- Horn silver (Min.), cerargyrite. -- Horn slate, a gray, siliceous stone. -- To haul in one's horns, to withdraw some arrogant pretension. [Colloq.] -- To raise, or lift, the horn (Script.), to exalt one's self; to act arrogantly. \"'Gainst them that raised thee dost thou lift thy horn\" Milton. -- To take a horn, to take a drink of intoxicating liquor. [Low]\n\n1. To furnish with horns; to give the shape of a horn to. 2. To cause to wear horns; to cuckold. [Obs.] Shak.",
