    "here":
        "Of them; their. [Obs.] Piers Plowman. On here bare knees adown they fall. Chaucer.\n\nHair. [Obs.] Chaucer.\n\n1. See Her, their. [Obs.] Chaucer. 2. Her; hers. See Her. [Obs.] Chaucer.\n\n1. In this place; in the place where the speaker is; -- opposed to Ant: there. He is not here, for he is risen. Matt. xxviii. 6. 2. In the present life or state. Happy here, and more happy hereafter. Bacon. 3. To or into this place; hither. [Colloq.] See Thither. Here comes Virgil. B. Jonson. Thou led'st me here. Byron. 4. At this point of time, or of an argument; now. The prisoner here made violent efforts to rise. Warren. Note: Here, in the last sense, is sometimes used before a verb without subject; as, Here goes, for Now (something or somebody) goes; -- especially occurring thus in drinking healths. \"Here's [a health] to thee, Dick.\" Cowley. Here and there, in one place and another; in a dispersed manner; irregularly. \"Footsteps here and there.\" Longfellow. -- It is neither, here nor there, it is neither in this place nor in that, neither in one place nor in another; hence, it is to no purpose, irrelevant, nonsense. Shak.",
