    "hain":
        "To inclose for mowing; to set aside for grass. \"A ground . . . hained in.\" Holland.\n\nTo inclose for mowing; to set aside for grass. \"A ground . . . hained in.\"  Holland. HAIN'T Hain't  . A contraction of have not or has not; as, I hain't, he hain't, we hain't. [Colloq. or illiterate speech.] [Written also han't.]",
    "henceforth":
