    "impose":
        "1. To lay on; to set or place; to put; to deposit. Cakes of salt and barley [she] did impose Within a wicker basket. Chapman. 2. To lay as a charge, burden, tax, duty, obligation, command, penalty, etc.; to enjoin; to levy; to inflict; as, to impose a toll or tribute. What fates impose, that men must needs abide. Shak. Death is the penalty imposed. Milton. Thou on the deep imposest nobler laws. Waller. 3. (Eccl.)  To lay on, as the hands, in the religious rites of confirmation and ordination. 4. (Print.)  To arrange in proper order on a table of stone or metal and lock up in a chase for printing; -- said of columns or pages of type, forms, etc.\n\nTo practice trick or deception. To impose on or upon, to pass or put a trick on; to delude. \"He imposes on himself, and mistakes words for things.\" Locke.\n\nA command; injunction. [Obs.] Shak.",
