    "inconsiderate":
        "1. Not considerate; not attentive to safety or to propriety; not regarding the rights or feelings of others; hasty; careless; thoughtless; heedless; as, the young are generally inconsiderate; inconsiderate conduct. It is a very unhappy token of our corruption, that therinconsiderate among us as to sacrifice morality to politics. Addison. 2. Inconsiderable. [Obs.] E. Terry. Syn. -- Thoughtless; inattentive; inadvertent; heedless; negligent; improvident; careless; imprudent; indiscreet; incautious; injudicious; rash; hasty.",
