    "ido":
        "An artificial international language, selected by the \"Delegation for the Adoption of an Auxillary International Language\" (founded at Paris in 1901), made public in 1907, and subsequently greatly revised and extended by a permanent committee or \"Academy.\" It combines systematically the advantages of previous schemes with a thoroughly logical word formation, and has neither accented constants nor arbitrarily coined pronominal words. For each idea that root is selected which is already most international, on the principle of the \"greatest facility for the greatest number of people.\" The word \"Ido\" means in the language itself \"offspring.\" The official name is: \"Linguo Internaciona di la Delegitaro (Sistema Ido).\" --I\"dism (#), n. -- I\"dist (#), n.",
    "impalement":
        "1. The act of impaling, or the state of being impaled. Byron. 2. An inclosing by stakes or pales, or the space so inclosed. H. Brooke. 3. That which hedges in; inclosure. [R.] Milton. 4. (Her.)  The division of a shield palewise, or by a vertical line, esp. for the purpose of putting side by side the arms of husband and wife. See Impale, 3.",
    "imperfect":
        "1. Not perfect; not complete in all its parts; wanting a part; deective; deficient. Something he left imperfect in the state. Shak. Why, then, your other senses grow imperfect. Shak. 2. Wanting in some elementary organ that is essential to successful or normal activity. He . . . stammered like a child, or an amazed, imperfect person. Jer. Taylor. 3. Not fulfilling its design; not realizing an ideal; not conformed to a standard or rule; not satisfying the taste or conscience; esthetically or morally defective. Nothing imperfect or deficient left Of all that he created. Milton. Then say not man's imperfect, Heaven in fault; Say rather, man's as perfect as he ought. Pope. Imperfect arch, an arch of less than a semicircle; a skew arch. -- Imperfect cadence (Mus.), one not ending with the tonic, but with the dominant or some other chord; one not giving complete rest; a half close. -- Imperfect consonances (Mus.), chords like the third and sixth, whose ratios are less simple than those of the fifth and forth. -- Imperfect flower (Bot.), a flower wanting either stamens or pistils. Gray. -- Imperfect interval (Mus.), one a semitone less than perfect; as, an imperfect fifth. -- Imperfect number (Math.), a number either greater or less than the sum of its several divisors; in the former case, it is called also a defective number; in the latter, an abundant number. -- Imperfect obligations (Law), obligations as of charity or gratitude, which cannot be enforced by law. -- Imperfect power (Math.), a number which can not be produced by taking any whole number or vulgar fraction, as a factor, the number of times indicated by the power; thus, 9 is a perfect square, but an imperfect cube. -- Imperfect tense (Gram), a tense expressing past time and incomplete action.\n\nThe imperfect tense; or the form of a verb denoting the imperfect tense.\n\nTo make imperfect. [Obs.]",
    "immediately":
        "1. In an immediate manner; without intervention of any other person or thing; proximately; directly; -- opposed to mediately; as, immediately contiguous. God's acceptance of it either immediately by himself, or mediately by the hands of the bishop. South. 2. Without interval of time; without delay; promptly; instantly; at once. And Jesus . . . touched him, saying, I will; be thou clean. And immediately his leprosy was cleansed. Matt. viii. 3. 3. As soon as. Cf. Directly, 8, Note. Syn. -- Directly; instantly; quickly; forthwith; straightway; presently. See Directly.",
