    "international":
        "1. Between or among nations; pertaining to the intercourse of nations; participated in by two or more nations; common to, or affecting, two or more nations. 2. Of or concerning the association called the International. International code (Naut.), a common system of signaling adopted by nearly all maritime nations, whereby communication may be had between vessels at sea. -- International copyright. See under Copyright. -- International law, the rules regulating the mutual intercourse of nations. International law is mainly the product of the conditions from time to time of international intercourse, being drawn from diplomatic discussion, textbooks, proof of usage, and from recitals in treaties. It is called public when treating of the relations of sovereign powers, and private when of the relations of persons of different nationalities. International law is now, by the better opinion, part of the common law of the land. Cf. Conflict of laws, under Conflict. Wharton.\n\n1. The International; an abbreviated from of the title of the International Workingmen's Association, the name of an association, formed in London in 1864, which has for object the promotion of the interests of the industrial classes of all nations. 2. A member of the International Association.",
