    "insection": "A cutting in; incisure; incision.",
    "incooerdination":
        "Want of coördination; lack of harmonious adjustment or action. Incoördination of muscular movement (Physiol.), irregularity in movements resulting from inharmonious action of the muscles in consequence of loss of voluntary control over them.",
    "ichthyophagous": "Eating, or subsisting on, fish.",
    "insurance":
        "1. The act of insuring, or assuring, against loss or damage by a contingent event; a contract whereby, for a stipulated consideration, called premium, one party undertakes to indemnify or guarantee another against loss by certain specified risks. Cf. Assurance, n., 6. Note: The person who undertakes to pay in case of loss is termed the insurer; the danger against which he undertakes, the risk; the person protected, the insured; the sum which he pays for the protection, the premium; and the contract itself, when reduced to form, the policy. Johnson's Cyc. 2. The premium paid for insuring property or life. 3. The sum for which life or property is insured. 4. A guaranty, security, or pledge; assurance. [Obs.] The most acceptable insurance of the divine protection. Mickle. Accident insurance, insurance against pecuniary loss by reason of accident to the person. -- Endowment insurance or assurance, a combination of life insurance and investment such that if the person upon whose life a risk is taken dies before a certain specified time the insurance becomes due at once, and if he survives, it becomes due at the time specified. -- Fire insurance. See under Fire. -- Insurance broker, a broker or agent who effects insurance. -- Insurance company, a company or corporation whose business it is to insure against loss, damage, or death. -- Insurance policy, a certificate of insurance; the document containing the contract made by an insurance company with a person whose property or life is insured. -- Life insurance. See under Life.",
    "intellectualism":
        "1. Intellectual power; intellectuality. 2. The doctrine that knowledge is derived from pure reason.",
    "invest":
        "1. To put garments on; to clothe; to dress; to array; -- opposed to divest. Usually followed by with, sometimes by in; as, to invest one with a robe. 2. To put on. [Obs.] Can not find one this girdle to invest. Spenser. 3. To clothe, as with office or authority; to place in possession of rank, dignity, or estate; to endow; to adorn; to grace; to bedeck; as, to invest with honor or glory; to invest with an estate. I do invest you jointly with my power. Shak. 4. To surround, accompany, or attend. Awe such as must always invest the spectacle of the guilt. Hawthorne. 5. To confer; to give. [R.] It investeth a right of government. Bacon. 6. (Mil.)  To inclose; to surround of hem in with troops, so as to intercept succors of men and provisions and prevent escape; to lay siege to; as, to invest a town. 7. To lay out (money or capital) in business with the as, to invest money in bank stock.\n\nTo make an investment; as, to invest in stocks; -- usually followed by in.",
