    "jub": "A vessel for holding ale or wine; a jug. [Obs.] Chaucer.",
    "japanner":
        "1. One who varnishes in the manner of the Japanese, or one skilled in the art. 2. A bootblack. [R.]",
    "jubbah":
        "A long outer garment worn by both sexes of Mohammedans of the better class.",
    "jack":
        "A large tree, the Artocarpus integrifolia, common in the East Indies, closely allied to the breadfruit, from which it differs in having its leaves entire. The fruit is of great size, weighing from thirty to forty pounds, and through its soft fibrous matter are scattered the seeds, which are roasted and eaten. The wood is of a yellow color, fine grain, and rather heavy, and is much used in cabinetwork. It is also used for dyeing a brilliant yellow. [Written also jak.]\n\n1. A familiar nickname of, or substitute for, John. You are John Rugby, and you are Jack Rugby. Shak. 2. An impertinent or silly fellow; a simpleton; a boor; a clown; also, a servant; a rustic. \"Jack fool.\" Chaucer. Since every Jack became a gentleman, There 's many a gentle person made a Jack. Shak. 3. A popular colloquial name for a sailor; -- called also Jack tar, and Jack afloat. 4. A mechanical contrivance, an auxiliary machine, or a subordinate part of a machine, rendering convenient service, and often supplying the place of a boy or attendant who was commonly called Jack; as: (a) A device to pull off boots. (b) A sawhorse or sawbuck. (c) A machine or contrivance for turning a spit; a smoke jack, or kitchen jack. (b) (Mining) A wooden wedge for separating rocks rent by blasting. (e) (Knitting Machine) A lever for depressing the sinkers which push the loops down on the needles. (f) (Warping Machine) A grating to separate and guide the threads; a heck box. (g) (Spinning) A machine for twisting the sliver as it leaves the carding machine. (h) A compact, portable machine for planing metal. (i) A machine for slicking or pebbling leather. (k) A system of gearing driven by a horse power, for multiplying speed. (l) A hood or other device placed over a chimney or vent pipe, to prevent a back draught. (m) In the harpsichord, an intermediate piece communicating the action of the key to the quill; -- called also hopper. (n) In hunting, the pan or frame holding the fuel of the torch used to attract game at night; also, the light itself. C. Hallock. 5. A portable machine variously constructed, for exerting great pressure, or lifting or moving a heavy body through a small distance. It consists of a lever, screw, rack and pinion, hydraulic press, or any simple combination of mechanical powers, working in a compact pedestal or support and operated by a lever, crank, capstan bar, etc. The name is often given to a jackscrew, which is a kind of jack. 6. The small bowl used as a mark in the game of bowls. Shak. Like an uninstructed bowler who thinks to attain the jack by delivering his bowl straight forward upon it. Sir W. Scott. 7. The male of certain animals, as of the ass. 8. (Zoöl.) (a) A young pike; a pickerel. (b) The jurel. (c) A large, California rock fish (Sebastodes paucispinus); -- called also boccaccio, and mérou. (d) The wall-eyed pike. 9. A drinking measure holding half a pint; also, one holding a quarter of a pint. [Prov. Eng.] Halliwell. 10. (Naut.) (a) A flag, containing only the union, without the fly, usually hoisted on a jack staff at the bowsprit cap; -- called also union jack. The American jack is a small blue flag, with a star for each State. (b) A bar of iron athwart ships at a topgallant masthead, to support a royal mast, and give spread to the royal shrouds; -- called also jack crosstree. R. H. Dana, Jr. 11. The knave of a suit of playing cards. Note: Jack is used adjectively in various senses. It sometimes designates something cut short or diminished in size; as, a jack timber; a jack rafter; a jack arch, etc. Jack arch, an arch of the thickness of one brick. -- Jack back (Brewing & Malt Vinegar Manuf.), a cistern which receives the wort. See under 1st Back. -- Jack block (Naut.), a block fixed in the topgallant or royal rigging, used for raising and lowering light masts and spars. -- Jack boots, boots reaching above the knee; -- worn in the 17 century by soldiers; afterwards by fishermen, etc. -- Jack crosstree. (Naut.) See 10, b, above. -- Jack curlew (Zoöl.), the whimbrel. -- Jack frame. (Cotton Spinning) See 4 (g), above. -- Jack Frost, frost personified as a mischievous person. -- Jack hare, a male hare. Cowper. -- Jack lamp, a lamp for still hunting and camp use. See def. 4 (n.), above. -- Jack plane, a joiner's plane used for coarse work. -- Jack post, one of the posts which support the crank shaft of a deep-well-boring apparatus. -- Jack pot (Poker Playing), the name given to the stakes, contributions to which are made by each player successively, till such a hand is turned as shall take the \"pot,\" which is the sum total of all the bets. -- Jack rabbit (Zoöl.), any one of several species of large American hares, having very large ears and long legs. The California species (Lepus Californicus), and that of Texas and New Mexico (L. callotis), have the tail black above, and the ears black at the tip. They do not become white in winter. The more northern prairie hare (L. campestris) has the upper side of the tail white, and in winter its fur becomes nearly white. -- Jack rafter (Arch.), in England, one of the shorter rafters used in constructing a hip or valley roof; in the United States, any secondary roof timber, as the common rafters resting on purlins in a trussed roof; also, one of the pieces simulating extended rafters, used under the eaves in some styles of building. -- Jack salmon (Zoöl.), the wall-eyed pike, or glasseye. -- Jack sauce, an impudent fellow. [Colloq. & Obs.] -- Jack shaft (Mach.), the first intermediate shaft, in a factory or mill, which receives power, through belts or gearing, from a prime mover, and transmits it, by the same means, to other intermediate shafts or to a line shaft. -- Jack sinker (Knitting Mach.), a thin iron plate operated by the jack to depress the loop of thread between two needles. -- Jack snipe. (Zoöl.) See in the Vocabulary. -- Jack staff (Naut.), a staff fixed on the bowsprit cap, upon which the jack is hoisted. -- Jack timber (Arch.), any timber, as a rafter, rib, or studding, which, being intercepted, is shorter than the others. -- Jack towel, a towel hung on a roller for common use. -- Jack truss (Arch.), in a hip roof, a minor truss used where the roof has not its full section. -- Jack tree. (Bot.) See 1st Jack, n. -- Jack yard (Naut.), a short spar to extend a topsail beyond the gaff. Blue jack, blue vitriol; sulphate of copper. -- Hydraulic jack, a jack used for lifting, pulling, or forcing, consisting of a compact portable hydrostatic press, with its pump and a reservoir containing a supply of liquid, as oil. -- Jack-at-a-pinch. (a) One called upon to take the place of another in an emergency. (b) An itinerant parson who conducts an occasional service for a fee. -- Jack-at-all-trades, one who can turn his hand to any kind of work. -- Jack-by-the-hedge (Bot.), a plant of the genus Erysimum (E. alliaria, or Alliaria officinalis), which grows under hedges. It bears a white flower and has a taste not unlike garlic. Called also, in England, sauce-alone. Eng. Cyc. -- Jack-in-a-box. (a) (Bot.) A tropical tree (Hernandia sonora), which bears a drupe that rattles when dry in the inflated calyx. (b) A child's toy, consisting of a box, out of which, when the lid is raised, a figure springs. (c) (Mech.) An epicyclic train of bevel gears for transmitting rotary motion to two parts in such a manner that their relative rotation may be variable; applied to driving the wheels of tricycles, road locomotives, and to cotton machinery, etc.; an equation box; a jack frame; -- called also compensating gearing. (d) A large wooden screw turning in a nut attached to the crosspiece of a rude press. -- Jack-in-office, an insolent fellow in authority. Wolcott. -- Jack-in-the-bush (Bot.), a tropical shrub with red fruit (Cordia Cylindrostachya). -- Jack-in-the-green, a chimney sweep inclosed in a framework of boughs, carried in Mayday processions. -- Jack-in-the-pulpit (Bot.), the American plant Arisæma triphyllum, or Indian turnip, in which the upright spadix is inclosed. -- Jack-of-the-buttery (Bot.), the stonecrop (Sedum acre). -- Jack-of-the-clock, a figure, usually of a man, on old clocks, which struck the time on the bell. -- Jack-on-both-sides, one who is or tries to be neutral. -- Jack-out-of-office, one who has been in office and is turned out. Shak. -- Jack the Giant Killer, the hero of a well-known nursery story. -- Jack-with-a-lantern, Jack-o'-lantern. (a) An ignis fatuus; a will-o'-the-wisp. \"[Newspaper speculations] supplying so many more jack-o'-lanterns to the future historian.\" Lowell. (b) A lantern made of a pumpkin so prepared as to show in illumination the features of a human face, etc. -- Yellow Jack (Naut.), the yellow fever; also, the quarantine flag. See Yellow flag, under Flag.\n\nA coarse and cheap mediæval coat of defense, esp. one made of leather. Their horsemen are with jacks for most part clad. Sir J. Harrington.\n\nA pitcher or can of waxed leather; -- called also black jack. [Obs.] Dryden.\n\nTo hunt game at night by means of a jack. See 2d Jack, n., 4, n.\n\nTo move or lift, as a house, by means of a jack or jacks. See 2d Jack, n., 5.",
    "judgeship": "The office of a judge.",
    "jasey":
        "A wig; -- so called, perhaps, from being made of, or resembling, Jersey yarn. Thackeray.",
    "jazerant":
        "A coat of defense made of small plates of metal sewed upon linen or the like; also, this kind of armor taken generally; as, a coat of jazerant.",
    "jinx":
        "A person, object, influence, or supernatural being which is supposed to bring bad luck or to cause things to go wrong. [Slang]",
    "jogger": "One who jogs. Dryden.",
    "joinder":
        "1. The act of joining; a putting together; conjunction. Confirmed by mutual joinder of your hands. Shak. 2. (Law) (a) A joining of parties as plaintiffs or defendants in a suit. (b) Acceptance of an issue tendered in law or fact. (c) A joining of causes of action or defense in civil suits or criminal prosecutions.",
    "jonah":
        "The Hebrew prophet, who was cast overboard as one who endangered the ship; hence, any person whose presence is unpropitious. Jonah crab (Zoöl.), a large crab (Cancer borealis) of the eastern coast of the United States, sometimes found between tides, but usually in deep water.",
    "jackanapes":
        "1. A monkey; an ape. Shak. 2. A coxcomb; an impertinent or conceited fellow. A young upstart jackanapes. Arbuthnot.",
    "juglandine":
        "An alkaloid found in the leaves of the walnut (Juglans regia).",
    "jacobinic":
        "Of or pertaining to the Jacobins of France; revolutionary; of the nature of, or characterized by, Jacobinism. Burke. -- Jac`o*bin\"ic*al*ly, adv.",
    "janizarian":
        "Of or pertaining to the janizaries, or their government. Burke.",
    "jesuited": "Conforming to the principles of the Jesuits. Milton.",
    "jam":
        "A kind of frock for children.\n\nSee Jamb.\n\n1. To press into a close or tight position; to crowd; to squeeze; to wedge in. The . . . jammed in between two rocks. De Foe. 2. To crush or bruise; as, to jam a finger in the crack of a door. [Colloq.] 3. (Naut.)  To bring (a vessel) so close to the wind that half her upper sails are laid aback. W. C. Russell.\n\n1. A mass of people or objects crowded together; also, the pressure from a crowd; a crush; as, a jam in a street; a jam of logs in a river. 2. An injury caused by jamming. [Colloq.]\n\nA preserve of fruit boiled with sugar and water; as, raspberry jam; currant jam; grape jam. Jam nut. See Check nut, under Check. -- Jam weld (Forging), a butt weld. See under Butt.",
    "jointure":
        "1. A joining; a joint. [Obs.] 2. (Law)  An estate settled on a wife, which she is to enjoy after husband's decease, for her own life at least, in satisfaction of dower. The jointure that your king must make, Which with her dowry shall be counterpoised. Shak.\n\nTo settle a jointure upon.",
    "joul": "See Jowl.",
    "judicial":
        "1. Pertaining or appropriate to courts of justice, or to a judge; practiced or conformed to in the administration of justice; sanctioned or ordered by a court; as, judicial power; judicial proceedings; a judicial sale. \"Judicial massacres.\" Macaulay. Not a moral but a judicial law, and so was abrogated. Milton. 2. Fitted or apt for judging or deciding; as, a judicial mind. 3. Belonging to the judiciary, as distinguished from legislative, administrative, or executive. See Executive. 4. Judicious. [Obs.] B. Jonson.",
    "july":
        "The seventh month of the year, containing thirty-one days. Note: This month was called Quintilis, or the fifth month, according to the old Roman calendar, in which March was the first month of the year.",
    "jentling": "A fish of the genus Leuciscus; the blue chub of the Danube.",
    "jelly":
        "1. Anything brought to a gelatinous condition; a viscous, translucent substance in a condition between liquid and solid; a stiffened solution of gelatin, gum, or the like. 2. The juice of fruits or meats boiled with sugar to an elastic consistence; as, currant jelly; calf's-foot jelly. Jelly bag, a bag through which the material for jelly is strained. -- Jelly mold, a mold for forming jelly in ornamental shapes. -- Jelly plant (Bot.), Australian name of an edible seaweed (Eucheuma speciosum), from which an excellent jelly is made. J. Smith. -- Jelly powder, an explosive, composed of nitroglycerin and collodion cotton; -- so called from its resemblance to calf's-foot jelly.\n\nTo become jelly; to come to the state or consistency of jelly.",
    "juvenile":
        "1. Young; youthful; as, a juvenile appearance. \"A juvenile exercitation.\" Glanvill. 2. Of or pertaining to youth; as, juvenile sports. Syn. -- Puerile; boyish; childish. See Youthful.\n\nA young person or youth; -- used sportively or familiarly. C. Bronté.",
    "jeofail":
        "An oversight in pleading, or the acknowledgment of a mistake or oversight. Blackstone.",
    "juxtaposition":
        "A placing or being placed in nearness or contiguity, or side by side; as, a juxtaposition of words. Parts that are united by a a mere juxtaposition. Glanvill. Juxtaposition is a very unsafe criterion of continuity. Hare.",
    "jawed":
        "Having jaws; -- chiefly in composition; as, lantern-jawed. \"Jawed like a jetty.\" Skelton.",
    "jargonist":
        "One addicted to jargon; one who uses cant or slang. Macaulay.",
    "jehovah":
        "A Scripture name of the Supreme Being, by which he was revealed to the Jews as their covenant God or Sovereign of the theocracy; the \"ineffable name\" of the Supreme Being, which was not pronounced by the Jews.",
    "jackscrew":
        "A jack in which a screw is used for lifting, or exerting pressure. See Illust. of 2d Jack, n., 5.",
    "jacare": "A cayman. See Yacare.",
    "jocularity": "Jesting; merriment.",
    "jenneting":
        "A variety of early apple. See Juneating. [Written also geniting.]",
    "jura-trias":
        "A term applied to many American Mesozoic strata, in which the characteristics of the Jurassic and Triassic periods appear to be blended. -- Ju`ra-tri*as\"sic, a.",
    "justifiable":
        "Capable of being justified, or shown to be just. Just are the ways of God, An justifiable to men. Milton. Syn. -- Defensible; vindicable; warrantable; excusable; exculpable; authorizable. -- Jus\"ti*fi`a*ble*ness, n. -- Jus\"ti*fi`a*bly, adv.",
    "junketing":
        "A feast or entertainment; a revel. All those snug junketings and public gormandizings for which the ancient magistrates were equally famous with their modern successors. W. Irving. The apostle would have no reveling or junketing upon the altar. South.",
    "janthina": "See Ianthina.",
    "jute":
        "The coarse, strong fiber of the East Indian Corchorus olitorius, and C. capsularis; also, the plant itself. The fiber is much used for making mats, gunny cloth, cordage, hangings, paper, etc.",
    "jacent": "Lying at length; as, the jacent posture. [R.] Sir H. Wotton.",
    "judiciously": "In a judicious manner; with good judgment; wisely.",
    "jagger":
        "One who carries about a small load; a peddler. See 2d Jag. [Scot.] Sir W. Scott.\n\nOne who, or that which, jags; specifically: (a) jagging iron used for crimping pies, cakes, etc. (b) A toothed chisel. See Jag, v. t. Jagger spring, a spring beneath a seat, and resting on cleats or blocks in the body of a vehicle. Knight.",
    "johnsonian":
        "Pertaining to or resembling Dr. Johnson or his style; pompous; inflated.",
    "jim crow":
        "A negro; -- said to be so called from a popular negro song and dance, the refrain of which is \"Wheel about and turn about and jump Jim Crow,\" produced in 1835 by T. D. Rice, a famous negro minstrel. [Slang, U. S.]",
    "jaculator":
        "1. One who throws or casts. [R.] 2. (Zoöl.)  The archer fish (Toxotes jaculator).",
    "jungly":
        "Consisting of jungles; abounding with jungles; of the nature of a jungle.",
    "jog":
        "1. To push or shake with the elbow or hand; to jostle; esp., to push or touch, in order to give notice, to excite one's attention, or to warn. Now leaps he upright, jogs me, and cries: Do you see Yonder well- favored youth Donne. Sudden I jogged Ulysses, who was laid Fast by my side. Pope. 2. To suggest to; to notify; to remind; to call the attention of; as, to jog the memory. 3. To cause to jog; to drive at a jog, as a horse. See Jog, v. i.\n\nTo move by jogs or small shocks, like those of a slow trot; to move slowly, leisurely, or monotonously; -- usually with on, sometimes with over. Jog on, jog on, the footpath way. Shak. So hung his destiny, never to rot, While he might still jog on and keep his trot. Milton . The good old ways our sires jogged safely over. R. Browning.\n\n1. A slight shake; a shake or push intended to give notice or awaken attention; a push; a jolt. To give them by turns an invisible jog. Swift. 2. A rub; a slight stop; an obstruction; hence, an irregularity in motion of from; a hitch; a break in the direction of a line or the surface of a plane. Glanvill. Jog trot, a slow, regular, jolting gait; hence, a routine habit or method, persistently adhered to. T. Hook.",
    "jagannath":
        "A particular form of Vishnu, or of Krishna, whose chief idol and worship are at Puri, in Orissa. The idol is considered to contain the bones of Krishna and to possess a soul. The principal festivals are the Snanayatra, when the idol is bathed, and the Rathayatra, when the image is drawn upon a car adorned with obscene paintings. Formerly it was erroneously supposed that devotees allowed themselves to be crushed beneath the wheels of this car. It is now known that any death within the temple of Jagannath is considered to render the place unclean, and any spilling of blood in the presence of the idol is a pollution.",
    "jimcrack": "See Gimcrack.",
    "jube":
        "(a) chancel screen or rood screen. (b) gallery above such a screen, from which certain parts of the service were formerly read. See Rood loft, under Rood.",
    "jess":
        "A short strap of leather or silk secured round the leg of a hawk, to which the leash or line, wrapped round the falconer's hand, was attached when used. See Illust. of Falcon. Like a hawk, which feeling freed From bells and jesses which did let her flight. Spenser.",
    "jack-a-dandy": "A little dandy; a little, foppish, impertinent fellow.",
    "janus":
        "A Latin deity represented with two faces looking in opposite directions. Numa is said to have dedicated to Janus the covered passage at Rome, near the Forum, which is usually called the Temple of Janus. This passage was open in war and closed in peace. Dr. W. Smith. Janus cloth, a fabric having both sides dressed, the sides being of different colors, -- used for reversible garments.",
    "judicative":
        "Having power to judge; judicial; as, the judicative faculty. Hammond.",
    "juggle":
        "1. To play tricks by sleight of hand; to cause amusement and sport by tricks of skill; to conjure. 2. To practice artifice or imposture. Be these juggling fiends no more believed. Shak.\n\nTo deceive by trick or artifice. Is't possible the spells of France should juggle Men into such strange mysteries Shak.\n\n1. A trick by sleight of hand. 2. An imposture; a deception. Tennyson. A juggle of state to cozen the people. Tillotson. 3. A block of timber cut to a length, either in the round or split. Knight.",
    "juiceless": "Lacking juice; dry. Dr. H. More.",
    "jurisconsult":
        "A man learned in the civil law; an expert in juridical science; a professor of jurisprudence; a jurist.",
    "jurat":
        "1. A person under oath; specifically, an officer of the nature of an alderman, in certain municipal corporations in England. Burrill. 2. (Law)  The memorandum or certificate at the end of an asffidavit, or a bill or answer in chancery, showing when, before whom, and (in English practice), where, it was sworn or affirmed. Wharton. Bouvier.",
    "jeropigia": "See Geropigia.",
    "jurdiccion": "Jurisdiction. [Obs.]",
    "jurisdictive": "Having jurisdiction. Milton.",
    "jingoism":
        "The policy of the Jingoes, so called. See Jingo, 2. [Cant, Eng.]",
    "jollity":
        "Noisy mirth; gayety; merriment; festivity; boisterous enjoyment. Chaucer. All now was turned to jollity and game. Milton. He with a proud jollity commanded him to leave that quarrel only for him, who was only worthy to enter into it. Sir P. Sidney. Syn. -- Merriment; mirth; gayety; festivity; hilarity.",
    "jument":
        "A beast; especially, a beast of burden. [Obs.] Fitter for juments than men to feed on. Burton.",
    "jutes":
        "Jutlanders; one of the Low German tribes, a portion of which settled in Kent, England, in the 5th century.",
    "jihad":
        "A religious war against infidels or Mohammedan heretics; also, any bitter war or crusade for a principle or belief. [Their] courage in war . . . had not, like that of the Mohammedan dervishes of the Sudan, or of Mohammedans anywhere engaged in a jehad, a religious motive and the promise of future bliss behind it. James Bryce.",
    "jactancy": "A boasting; a bragging. [Obs.]",
    "jehad":
        "A religious war against infidels or Mohammedan heretics; also, any bitter war or crusade for a principle or belief. [Their] courage in war . . . had not, like that of the Mohammedan dervishes of the Sudan, or of Mohammedans anywhere engaged in a jehad, a religious motive and the promise of future bliss behind it. James Bryce.",
    "jean":
        "A twilled cotton cloth. Satin jean, a kind of jean woven smooth and glossy, after the manner of satin.",
    "junk":
        "A fragment of any solid substance; a thick piece. See Chunk. [Colloq.] Lowell.\n\n1. Pieces of old cable or old cordage, used for making gaskets, mats, swabs, etc., and when picked to pieces, forming oakum for filling the seams of ships. 2. Old iron, or other metal, glass, paper, etc., bought and sold by junk dealers. 3. (Naut.)  Hard salted beef supplied to ships. Junk bottle , a stout bottle made of thick dark-colored glass. -- Junk dealer, a dealer in old cordage, old metal, glass, etc. -- Junk hook (Whaling), a hook for hauling heavy pieces of blubber on deck. -- Junk ring. (a) A packing of soft material round the piston of a steam engine. (b) A metallic ring for retaining a piston packing in place; (c) A follower. -- Junk shop, a shop where old cordage, and ship's tackle, old iron, old bottles, old paper, etc., are kept for sale. -- Junk vat (Leather Manuf.), a large vat into which spent tan liquor or ooze is pumped. -- Junk wad (Mil.), a wad used in proving cannon; also used in firing hot shot.\n\nA large vessel, without keel or prominent stem, and with huge masts in one piece, used by the Chinese, Japanese, Siamese, Malays, etc., in navigating their waters.",
    "jove":
        "1. The chief divinity of the ancient Romans; Jupiter. 2. (Astron.)  The planet Jupiter. [R.] Pope. 3. (Alchemy)  The metal tin. Bird of Jove, the eagle.",
    "junior":
        "1. Less advanced in age than another; younger. Note: Junior is applied to distinguish the younger of two persons bearing the same name in the same family, and is opposed to senior or elder. Commonly applied to a son who has the same Christian name as his father. 2. Lower in standing or in rank; later in office; as, a junior partner; junior counsel; junior captain. 3. Composed of juniors, whether younger or a lower standing; as, the junior class; of or pertaining to juniors or to a junior class. See Junior, n., 2. 4. Belonging to a younger person, or an earlier time of life. Our first studies and junior endeavors. Sir T. Browne.\n\n1. A younger person. His junior she, by thirty years. Byron. 2. Hence: One of a lower or later standing; specifically, in American colleges, one in the third year of his course, one in the fourth or final year being designated a senior; in some seminaries, one in the first year, in others, one in the second year, of a three years' course.",
    "jak": "see Ils Jack.",
    "jellify":
        "To make, or to become, gelatinous; to jelly. -- Jel`li*fi*ca\"tion (#), n.",
    "jesse":
        "Any representation or suggestion of the genealogy of Christ, in decorative art; as: (a) A genealogical tree represented in stained glass. (b) A candlestick with many branches, each of which bears the name of some one of the descendants of Jesse; -- called also tree of Jesse. Jesse window (Arch.), a window of which the glazing and tracery represent the tree of Jesse.",
    "jupe": "Same as Jupon.",
    "jointweed":
        "A slender, nearly leafless, American herb (Polygonum articulatum), with jointed spikes of small flowers.",
    "jeer":
        "(a) A gear; a tackle. (b) pl.  An assemblage or combination of tackles, for hoisting or lowering the lower yards of a ship. Jeer capstan (Naut.), an extra capstan usually placed between the foremast and mainmast.\n\nTo utter sarcastic or scoffing reflections; to speak with mockery or derision; to use taunting language; to scoff; as, to jeer at a speaker. But when he saw her toy and gibe and jeer. Spenser. Syn. -- To sneer; scoff; flout; gibe; mock.\n\nTo treat with scoffs or derision; to address with jeers; to taunt; to flout; to mock at. And if we can not jeer them, we jeer ourselves. B. Jonson.\n\nA railing remark or reflection; a scoff; a taunt; a biting jest; a flout; a jibe; mockery. Midas, exposed to all their jeers, Had lost his art, and kept his ears. Swift.",
    "jockeyship":
        "The art, character, or position, of a jockey; the personality of a jockey. Go flatter Sawney for his jockeyship. Chatterton. Where can at last his jockeyship retire Cowper.",
    "jocoserious": "Mingling mirth and seriousness. M. Green.",
    "junco":
        "Any bird of the genus Junco, which includes several species of North American finches; -- called also snowbird, or blue snowbird.",
    "jealoushood": "Jealousy. [Obs.] Shak.",
    "jerk":
        "To cut into long slices or strips and dry in the sun; as, jerk beef. See Charqui.\n\n1. To beat; to strike. [Obs.] Florio. 2. To give a quick and suddenly arrested thrust, push, pull, or twist, to; to yerk; as, to jerk one with the elbow; to jerk a coat off. 3. To throw with a quick and suddenly arrested motion of the hand; as, to jerk a stone.\n\n1. To make a sudden motion; to move with a start, or by starts. Milton. 2. To flout with contempt.\n\n1. A short, sudden pull, thrust, push, twitch, jolt, shake, or similar motion. His jade gave him a jerk. B. Jonson. 2. A sudden start or spring. Lobsters . . . swim backwards by jerks or springs. Grew.",
    "jovian":
        "Of or pertaining to Jove, or Jupiter (either the deity or the planet).",
    "judicature":
        "1. The state or profession of those employed in the administration of justice; also, the dispensing or administration of justice. The honor of the judges in their judicature is the king's honor. Bacon. 2. A court of justice; a judicatory. South. 3. The right of judicial action; jurisdiction; extent jurisdiction of a judge or court. Our Savior disputes not here the judicature, for that was not his office, but the morality, of divorce. Milton.",
    "jurisprudent":
        "Understanding law; skilled in jurisprudence. G. West.\n\nOne skilled in law or jurisprudence. [R.] De Quincey.",
    "judas":
