    "kaoline":
        "A very pure white clay, ordinarily in the form of an impalpable powder, and used to form the paste of porcelain; China clay; porcelain clay. It is chiefly derived from the decomposition of common feldspar. Note: The name is now applied to all porcelain clays which endure the fire without discoloration.",
    "kern":
        "1. A light-armed foot soldier of the ancient militia of Ireland and Scotland; -- distinguished from gallowglass, and often used as a term of contempt. Macaulay. Now for our Irish wars; We must supplant those rough, rug-headed kerns. Shak. 2. Any kind of boor or low-lived person. [Obs.] Blount. 3. (O. Eng. Law)  An idler; a vagabond. Wharton.\n\nA part of the face of a type which projects beyond the body, or shank.\n\nTo form with a kern. See 2d Kern.\n\nA churn. [Prov. Eng.]\n\nA hand mill. See Quern. Johnson.\n\n1. To harden, as corn in ripening. [Obs.] Carew. 2. To take the form of kernels; to granulate. [Obs.] It is observed that rain makes the salt kern. Dampier.",
    "klipdachs":
        "A small mammal (Hyrax Capensis), found in South Africa. It is of about the size of a rabbit, and closely resembles the daman. Called also rock rabbit.",
    "kohl-rabi":
        "A variety of cabbage, in which the edible part is a large, turnip-shaped swelling of the stem, above the surface of the ground.",
    "knobbler":
        "The hart in its second year; a young deer. [Written also knobber.] Halliwell. He has hallooed the hounds upon a velvet-headed knobbler. Sir W. Scott.",
    "kecksy":
        "The hollow stalk of an umbelliferous plant, such as the cow parsnip or the hemlock. [Written also kex, and in pl., kecks, kaxes.] Nothing teems But hateful docks, rough thistles, kecksies, burs. Shak.",
    "kaique": "See Caique.",
    "koluschan":
        "Designating, or pert. to, a linguistic stock of North American Indians comprising the Tlinkit tribes of the Alexander Archipelago of southeastern Alaska and adjacent coast lands. Their language bears some affinity to Mexican tongues.",
    "keeled":
        "1. (Bot.)  Keel-shaped; having a longitudinal prominence on the back; as, a keeled leaf. 2. (Zoöl.)  Having a median ridge; carinate; as, a keeled scale.",
    "kemb":
