    "koordish": "See Kurdish.",
    "knock-knee":
        "A condition in which the knees are bent in so as to touch each other in walking; inknee.",
    "kindergarten":
        "A school for young children, conducted on the theory that education should be begun by gratifying and cultivating the normal aptitude for exercise, play, observation, imitation, and construction; -- a name given by Friedrich Froebel, a German educator, who introduced this method of training, in rooms opening on a garden.",
    "kruppize": "To treat by, or subject to, the Krupp process.",
    "kutauss": "The India civet (Viverra zibetha).",
    "kingston metal":
        ". An alloy of tin, copper, and mercury, sometimes used for the bearings and packings of machinery. McElrath.",
    "kraal":
        "1. A collection of huts within a stockade; a village; sometimes, a single hut. [South Africa] 2. An inclosure into which are driven wild elephants which are to be tamed and educated. [Ceylon]",
    "kentucky":
        "One of the United States. Kentucky blue grass (Bot.), a valuable pasture and meadow grass (Poa pratensis), found in both Europe and America. See under Blue grass. -- Kentucky coffee tree (Bot.), a tall North American tree (Gymnocladus Canadensis) with bipinnate leaves. It produces large woody pods containing a few seeds which have been used as a substitute for coffee. The timber is a very valuable.",
    "keels": "Ninepins. See Kayles.",
    "krameric":
        "Pertaining to, or derived from, Krameria (rhatany); as, krameric acid, usually called ratanhia-tannic acid.",
    "kafal":
        "The Arabian name of two trees of the genus Balsamodendron, which yield a gum resin and a red aromatic wood.",
    "kymograph":
        "An instrument for measuring, and recording graphically, the pressure of the blood in any of the blood vessels of a living animal; -- called also kymographion.",
    "karyokinetic":
