    "kerf":
        "A notch, channel, or slit made in any material by cutting or sawing.",
    "keyseat": "To form a key seat, as by cutting. See Key seat, under Key.",
    "kattimundoo":
        "A caoutchouc like substance obtained from the milky juice of the East Indian Euphorbia Kattimundoo. It is used as a cement.",
    "kola nut": "Same as Cola, Cola nut.",
    "karyokinesis":
        "The indirect division of cells in which, prior to division of the cell protoplasm, complicated changes take place in the nucleus, attended with movement of the nuclear fibrils; -- opposed to karyostenosis. The nucleus becomes enlarged and convoluted, and finally the threads are separated into two groups which ultimately become disconnected and constitute the daughter nuclei. Called also mitosis. See Cell development, under Cell.",
    "kabook": "A clay ironstone found in Ceylon.",
    "klipfish": "Dried cod, exported from Norway. [Written also clipfish.]",
    "khaliff": "See Caliph.",
    "kodak": "A kind of portable camera.",
    "kinnikinic":
        "Prepared leaves or bark of certain plants; -- used by the Indians of the Northwest for smoking, either mixed with tobacco or as a substitute for it. Also, a plant so used, as the osier cornel (Cornus stolonijra), and the bearberry (Arctostaphylus Uva-ursi). [Spelled also kinnickinnick and killikinick.]",
    "knaveship":
        "A small due, in meal, established by usage, which is paid to the under miller. [Scot.]",
    "knotgrass":
        "(a) a common weed with jointed stems (Polygonum aviculare); knotweed. (b) The dog grass. See under Dog. Note: An infusion of Polygonum aviculare was once supposed to have the effect of stopping the growth of an animal, and hence it was called, as by Shakespeare, \"hindering knotgrass.\" We want a boy extremely for this function, Kept under for a year with milk and knotgrass. Beau. & Fl.",
    "karma":
        "One's acts considered as fixing one's lot in the future existence. (Theos.) The doctrine of fate as the inflexible result of cause and effect; the theory of inevitable consequence.",
    "killock":
