    "knits": "Small particles of ore. Raymond.",
    "kerchief":
        "1. A square of fine linen worn by women as a covering for the head; hence, anything similar in form or material, worn for ornament on other parts of the person; -- mostly used in compounds; as, neckerchief; breastkerchief; and later, handkerchief. He might put on a hat, a muffler, and a kerchief, and so escape. Shak. Her black hair strained away To a scarlet kerchief caught beneath her chin. Mrs. Browning. 2. A lady who wears a kerchief. Dryden.",
    "kingless": "Having no king. F. Lieber.",
    "knight baronet": "See Baronet.",
    "knack":
        "1. To crack; to make a sharp, abrupt noise to chink. [Obs. or Prov. Eng.] Bp. Hall. 2. To speak affectedly. [Prov. Eng.] Halliwell.\n\n1. A petty contrivance; a toy; a plaything; a knickknack. A knack, a toy, a trick, a baby's cap. Shak. 2. A readiness in performance; aptness at doing something; skill; facility; dexterity. The fellow . . . has not the knack with his shears. B. Jonson. The dean was famous in his time, And had a kind of knack at rhyme. Swift. 3. Something performed, or to be done, requiring aptness and dexterity; a trick; a device. \"The knacks of japers.\" Chaucer. For how should equal colors do the knack ! Pope.",
    "kairoline":
        "An organic base obtained from quinoline. It is used as a febrifuge, and resembles kairine.",
    "kilogrammetre":
        "A measure of energy or work done, being the amount expended in raising one kilogram through the height of one meter, in the latitude of Paris.",
    "kopeck":
        "A small Russian coin. One hundred kopecks make a rouble, worth about sixty cents. [Written also kopek, copec, and copeck.]",
    "kimry": "See Cymry.",
    "kinsfolk":
        "Relatives; kindred; kin; persons of the same family or closely or closely related families. They sought him among their kinsfolk and acquaintance. Luke ii. 44.",
    "knout":
        "A kind of whip for flogging criminals, formerly much used in Russia. The last is a tapering bundle of leather thongs twisted with wire and hardened, so that it mangles the flesh.\n\nTo punish with the knout Brougham.",
    "kyloes":
        "The cattle of the Hebrides, or of the Highlands. [Scot.] Sir W. Scott.",
    "knotwort":
        "A small, herbaceous, trailing plant, of the genus Illecebrum (I. verticillatum.)",
    "katastate":
