    "khedive":
        "A governor or viceroy; -- a title granted in 1867 by the sultan of Turkey to the ruler of Egypt.",
    "kneel":
        "To bend the knee; to fall or rest on the knees; -- sometimes with down. And he kneeled down, and cried with a loud voice, Lord, lay not this sin to their charge. Acts vii. 60. As soon as you are dressed, kneel and say the Lord's Prayer. Jer. Taylor.",
    "kyriolexy":
        "The use of literal or simple expressions, as distinguished from the use of figurative or obscure ones. Krauth-Fleming.",
    "kauri":
        "A lofty coniferous tree of New Zealand Agathis, or Dammara, australis), furnishing valuable timber and yielding one kind of dammar resin. [Written also kaudi, cowdie, and cowrie.]",
    "kilkenny cats":
        "Two cats fabled, in an Irish story, to have fought till nothing was left but their tails. It is probably a parable of a local contest between Kilkenny and Irishtown, which impoverished both towns.",
    "knurl":
        "A contorted knot in wood; a crossgrained protuberance; a nodule; a boss or projection. 2. One who, or that which, is crossgrained.\n\nTo provide with ridges, to assist the grasp, as in the edge of a flat knob, or coin; to mill.",
    "kyrie": "See Kyrie eleison.",
    "kinematics":
