    "lentitude": "Slowness; sluggishness. [Obs.]",
    "lurch":
        "To swallow or eat greedily; to devour; hence, to swallow up. [Obs.] Too far off from great cities, which may hinder business; too near them, which lurcheth all provisions, and maketh everything dear. Bacon.\n\n1. An old game played with dice and counters; a variety of the game of tables. 2. A double score in cribbage for the winner when his adversary has been left in the lurch. Lady --- has cried her eyes out on losing a lurch. Walpole. To leave one in the lurch. (a) In the game of cribbage, to leave one's adversary so far behind that the game is won before he has scored thirty-one. (b) To leave one behind; hence, to abandon, or fail to stand by, a person in a difficulty. Denham. But though thou'rt of a different church, I will not leave thee in the lurch. Hudibras.\n\n1. To leave in the lurch; to cheat. [Obs.] Never deceive or lurch the sincere communicant. South. 2. To steal; to rob. [Obs.] And in the brunt of seventeen battles since He lurched all swords of the garland. Shak.\n\nA sudden roll of a ship to one side, as in heavy weather; hence, a swaying or staggering movement to one side, as that by a drunken man. Fig.: A sudden and capricious inclination of the mind.\n\nTo roll or sway suddenly to one side, as a ship or a drunken man.\n\n1. To withdraw to one side, or to a private place; to lurk. L'Estrange. 2. To dodge; to shift; to play tricks. I . . . am fain to shuffle, to hedge, and to lurch. Shak.",
    "lavoltateer": "A dancer of the lavolta.",
    "libethenite":
        "A mineral of an olive-green color, commonly in orthorhombic crystals. It is a hydrous phosphate of copper.",
    "ladanum":
        "A gum resin gathered from certain Oriental species of Cistus. It has a pungent odor and is chiefly used in making plasters, and for fumigation. [Written also labdanum.]",
    "looper":
        "1. An instrument, as a bodkin, for forming a loop in yarn, a cord, etc. 2. (Zoöl.)  The larva of any species of geometrid moths. See Geometrid.",
    "lumbar":
        "Of, pertaining to, or near, the loins; as, the lumbar arteries. Lumbar region (Anat.), the region of the loin; specifically, a region between the hypochondriac and ilias regions, and outside of the umbilical region.",
    "late":
        "1. Coming after the time when due, or after the usual or proper time; not early; slow; tardy; long delayed; as, a late spring. 2. Far advanced toward the end or close; as, a late hour of the day; a late period of life. 3. Existing or holding some position not long ago, but not now; lately deceased, departed, or gone out of office; as, the late bishop of London; the late administration. 4. Not long past; happening not long ago; recent; as, the late rains; we have received late intelligence. 5. Continuing or doing until an advanced hour of the night; as, late revels; a late watcher.\n\n1. After the usual or proper time, or the time appointed; after delay; as, he arrived late; -- opposed to early. 2. Not long ago; lately. 3. Far in the night, day, week, or other particular period; as, to lie abed late; to sit up late at night. Of late, in time not long past, or near the present; lately; as, the practice is of late uncommon. -- Too late, after the proper or available time; when the time or opportunity is past.",
    "lucidity": "The quality or state of being lucid.",
    "laemodipod": "One of the Læmodipoda.",
    "leadwort":
        "A genus of maritime herbs (Plumbago). P. Europæa has lead- colored spots on the leaves, and nearly lead-colored flowers.",
    "lullaby":
        "1. A song to quiet babes or lull them to sleep; that which quiets. Shak. 2. Hence: Good night; good-by. [Obs.] Shak.",
    "lute-backed": "Having a curved spine.",
    "lanner":
        "A long-tailed falcon (Falco lanarius), of Southern Europe, Asia, and Northern Africa, resembling the American prairie falcon.",
    "lifting":
        "Used in, or for, or by, lifting. Lifting bridge, a lift bridge. -- Lifting jack. See 2d Jack, 5. -- Lifting machine. See Health lift, under Health. -- Lifting pump. (Mach.) (a) A kind of pump having a bucket, or valved piston, instead of a solid piston, for drawing water and lifting it to a high level. (b) A pump which lifts the water only to the top of the pump, or delivers it through a spout; a lift pump. -- Lifting rod, a vertical rod lifted by a rock shaft, and imparting motion to a puppet valve; -- used in the engines of river steamboats. -- Lifting sail (Naut.), one which tends to lift a vessel's bow out of water, as jibs and square foresails.",
    "lucerne": "See Lucern, the plant.",
    "lactyl": "An organic residue or radical derived from lactic acid.",
    "leyden phial":
        "A glass jar or bottle used to accumulate electricity. It is coated with tin foil, within and without, nearly to its top, and is surmounted by a brass knob which communicates with the inner coating, for the purpose of charging it with electricity. It is so named from having been invented in Leyden, Holland.",
    "lamaistic": "Of or pertaining to Lamaism.",
    "lapideous": "Of the nature of stone; [Obs.] Ray.",
    "levet":
        "A trumpet call for rousing soldiers; a reveille. [Obs.] Hudibras.",
    "limonin":
        "A bitter, white, crystalline substance found in orange and lemon seeds.",
    "lira": "An Italian coin equivalent in value to the French franc.",
    "lustration":
        "1. The act of lustrating or purifying. And holy water for lustration bring. Dryden. 2. (Antiq.)  A sacrifice, or ceremony, by which cities, fields, armies, or people, defiled by crimes, pestilence, or other cause of uncleanness, were purified.",
    "lenni-lenape":
        "A general name for a group of Algonquin tribes which formerly occupied the coast region of North America from Connecticut to Virginia. They included the Mohicans, Delawares, Shawnees, and several other tribes.",
    "legatura": "A tie or brace; a syncopation.",
    "lobelet": "A small lobe; a lobule.",
    "loathly":
        "Loathsome. [Obs.] \" Loathly mouth.\" Spenser.\n\n1. Unwillingly; reluctantly. This shows that you from nature loathly stray. Donne. 2. ( [Obs.] With dust and blood his locks were loathly dight. Fairfax.",
    "lactifical": "Producing or yielding milk.",
    "lengthen":
        "To extent in length; to make longer in extent or duration; as, to lengthen a line or a road; to lengthen life; -- sometimes followed by out. What if I please to lengthen out his date. Dryden.\n\nTo become longer. Locke.",
    "levigate":
        "Made less harsh or burdensome; alleviated. [Obs.] Sir. T. Elyot.\n\nTo make smooth in various senses: (a) To free from grit; to reduce to an impalpable powder or paste. (b) To mix thoroughly, as liquids or semiliquids. (c) To polish. (d) To make smooth in action. \" When use hath levigated the organs.\" Barrow. (e) Technically, to make smooth by rubbing in a moist condition between hard surfaces, as in grinding pigments.\n\nMade smooth, as if polished.",
    "libellee":
        "(a) The party against whom a libel has been filed; -- corresponding to defendant in a common law action. (b) The defendant in an action of libel.",
    "lineation": "Delineation; a line or lines.",
    "lego-literary": "Pertaining to the literature of law.",
    "ligeance":
        "The connection between sovereign and subject by which they were mutually bound, the former to protection and the securing of justice, the latter to faithful service; allegiance. [Written also ligeancy and liegance.] Chaucer.",
    "linden":
        "(a) A handsome tree (Tilia Europæa), having cymes of light yellow flowers, and large cordate leaves. The tree is common in Europe. (b) In America, the basswood, or Tilia Americana.",
    "lacunous":
        "Furrowed or pitted; having shallow cavities or lacunæ; as, a lacunose leaf.",
    "lohock": "See Loch, a medicine.",
    "lustre":
        "A period of five years; a lustrum. Both of us have closed the tenth luster. Bolingbroke.\n\n1. Brilliancy; splendor; brightness; glitter. The right mark and very true luster of the diamond. Sir T. More. The scorching sun was mounted high, In all its luster, to the noonday sky. Addison. Note: There is a tendency to limit the use of luster, in this sense, to the brightness of things which do not shine with their own light, or at least do not blaze or glow with heat. One speaks of the luster of a diamond, or of silk, or even of the stars, but not often now of the luster of the sun, a coal of fire, or the like. 2. Renown; splendor; distinction; glory. His ancestors continued about four hundred years, rather without obscurity than with any great luster. Sir H. Wotton. 3. A candlestick, chandelier, girandole, or the like, generally of an ornamental character. Pope. 4. (Min.)  The appearance of the surface of a mineral as affected by, or dependent upon, peculiarities of its reflecting qualities. Note: The principal kinds of luster recognized are: metallic, adamantine, vitreous, resinous, greasy, pearly, and silky. With respect to intensity, luster is characterized as splendent, shining, glistening, glimmering, and dull. 5. A substance which imparts luster to a surface, as plumbago and some of the glazes. 6. A fabric of wool and cotton with a lustrous surface, -- used for women's dresses. Luster ware, earthenware decorated by applying to the glazing metallic oxides, which acquire brilliancy in the process of baking.\n\nTo make lustrous. [R. & Poetic] Flooded and lustered with her loosened gold. Lowell.\n\nSame as Luster.",
    "leather":
        "1. The skin of an animal, or some part of such skin, tanned, tawed, or otherwise dressed for use; also, dressed hides, collectively. 2. The skin. [Ironical or Sportive] Note: Leather is much used adjectively in the sense of made of, relating to, or like, leather. Leather board, an imitation of sole leather, made of leather scraps, rags, paper, etc. -- Leather carp (Zoöl.) , a variety of carp in which the scales are all, or nearly all, absent. See Illust. under Carp. -- Leather jacket. (Zoöl.) (a) A California carangoid fish (Oligoplites saurus). (b) A trigger fish (Balistes Carolinensis). -- Leather flower (Bot.), a climbing plant (Clematis Viorna) of the Middle and Southern States having thick, leathery sepals of a purplish color. -- Leather leaf (Bot.), a low shrub (Cassandra calyculata), growing in Northern swamps, and having evergreen, coriaceous, scurfy leaves. -- Leather plant (Bot.), one or more New Zealand plants of the composite genus Celmisia, which have white or buff tomentose leaves. -- Leather turtle. (Zoöl.) See Leatherback. -- Vegetable leather. (a) An imitation of leather made of cotton waste. (b) Linen cloth coated with India rubber. Ure.\n\nTo beat, as with a thong of leather. [Obs. or Colloq.] G. Eliot.",
    "lea":
        "(a) A measure of yarn; for linen, 300 yards; for cotton, 120 yards; a lay. (b) A set of warp threads carried by a loop of the heddle.\n\nA meadow or sward land; a grassy field. \"Plow-torn leas.\" Shak. The lowing herd wind slowly o'er the lea. Gray.",
    "lipless": ", Having no lips.",
    "leisurably": "At leisure. [Obs.]",
    "liegiancy": "See Ligeance.",
    "lixivial":
        "1. Impregnated with, or consisting of, alkaline salts extracted from wood ashes; impregnated with a salt or salts like a lixivium. Boyle. 2. Of the color of lye; resembling lye. 3. Having the qualities of alkaline salts extracted from wood ashes. Lixivial salts (Old Chem.), salts which are obtained by passing water through ashes, or by pouring it on them.",
    "lowh": "strong imp. of Laugh. Etym: [Cf. 1st Low and 2d Lough.] Chaucer.",
    "lowland":
        "Land which is low with respect to the neighboring country; a low or level country; -- opposed to highland. The Lowlands, Belgium and Holland; the Netherlands; also, the southern part of Scotland.",
    "leftward":
        "Toward or on the left side. Rightward and leftward rise the rocks. Southey.",
    "lamellar":
        "Flat and thin; lamelliform; composed of lamellæ. -- Lam\"el*lar*ly, adv.  In thin plates or scales.",
    "lucky proach": "See Fatherlasher.",
    "lynx":
        "1. (Zoöl.)  Any one of several species of feline animals of the genus Felis, and subgenus Lynx. They have a short tail, and usually a pencil of hair on the tip of the ears. Note: Among the well-known species are the European lynx (Felis borealis); the Canada lynx or loup-cervier (F. Canadensis); the bay lynx of America (F. rufa), and its western spotted variety (var. maculata); and the pardine lynx (F. pardina) of Southern Europe. 2. (Astron.)  One of the northern constellations.",
    "locus":
        "1. A place; a locality. 2. (Math.)  The line traced by a point which varies its position according to some determinate law; the surface described by a point or line that moves according to a given law. Plane locus, a locus that is a straight line, or a circle. -- Solid locus, a locus that is one of the conic sections.",
    "lanuginous": "Covered with down, or fine soft hair; downy.",
    "longspur":
        "Any one of several species of fringilline birds of the genus Calcarius (or Plectrophanes), and allied genera. The Lapland longspur (C. Lapponicus), the chestnut-colored longspur (C. ornatus), and other species, inhabit the United States.",
    "leafage": "Leaves, collectively; foliage.",
    "ladrone": "A robber; a pirate; hence, loosely, a rogue or rascal.",
    "livered": "Having (such) a liver; used in composition; as, white-livered.",
    "locky": "Having locks or tufts. [R.] Sherwood.",
    "leniently": "In a lenient manner.",
    "lamaic": "Of or pertaining to Lamaism.",
    "lout":
        "To bend; to box; to stoop. [Archaic] Chaucer. Longfellow. He fair the knight saluted, louting low. Spenser.\n\nA clownish, awkward fellow; a bumpkin. Sir P. Sidney.\n\nTo treat as a lout or fool; to neglect; to disappoint. [Obs.] Shak.",
    "lunge":
        "A sudden thrust or pass, as with a sword.\n\nTo make a lunge.\n\nTo cause to go round in a ring, as a horse, while holding his halter. Thackeray.\n\nSame as Namaycush.",
    "landslide":
        "1. The slipping down of a mass of land from a mountain, hill, etc. 2. The land which slips down.",
    "laocoon":
        "1. (Class. Myth.)  A priest of Apollo, during the Trojan war. (See 2.) 2. (Sculp.)  A marble group in the Vatican at Rome, representing the priest Laocoön, with his sons, infolded in the coils of two serpents, as described by Virgil.",
    "legalist":
        "One who practices or advocates strict conformity to law; in theology, one who holds to the law of works. See Legal, 2 (a).",
    "limpness": "The quality or state of being limp.",
    "lifestring":
        "A nerve, or string, that is imagined to be essential to life. Daniel.",
    "lucency": "The quality of being lucent.",
    "landwaiter": "See Landing waiter, under Landing, a.",
    "loader":
        "One who, or that which, loads; a mechanical contrivance for loading, as a gun.",
    "letterwood":
        "The beautiful and highly elastic wood of a tree of the genus Brosimum (B. Aubletii), found in Guiana; -- so called from black spots in it which bear some resemblance to hieroglyphics; also called snakewood, and leopardwood. It is much used for bows and for walking sticks.",
    "luxation":
        "The act of luxating, or the state of being luxated; a dislocation.",
    "lengest":
        "Longer; longest; -- obsolete compar. and superl. of long. Chaucer.",
    "lycopod": "A plant of the genus Lycopodium.",
    "layette":
        "The outfit of clothing, blankets, etc., prepared for a newborn infant, and placed ready for used.",
    "lonely":
        "1. Sequestered from company or neighbors; solitary; retired; as, a lonely situation; a lonely cell. 2. Alone, or in want of company; forsaken. To the misled and lonely traveler. Milton. 3. Not frequented by human beings; as, a lonely wood. 4. Having a feeling of depression or sadness resulting from the consciousness of being alone; lonesome. I am very often alone. I don't mean I am lonely. H. James. Syn. -- Solitary; lone; lonesome; retired; unfrequented; sequestered; secluded.",
    "lacustrine":
        "Found in, or pertaining to, lakes or ponds, or growing in them; as, lacustrine flowers. Lacustrine deposits (Geol.), the deposits which have been accumulated in fresh-water areas. -- Lacustrine dwellings. See Lake dwellings, under Lake.",
    "lenard rays":
        "Rays emanating from the outer surface of a plate composed of any material permeable by cathode rays, as aluminium, which forms a portion of a wall of a vacuum tube, or which is mounted within the tube and exposed to radiation from the cathode. Lenard rays are similar in all their known properties to cathode rays. So called from the German physicist Philipp Lenard (b. 1862), who first described them.",
    "longly":
        "1. With longing desire. [Obs.] Shak. 2. For a long time; hence, wearisomely.",
    "lignitic":
        "Containing lignite; resembling, or of the nature of, lignite; as, lignitic clay. Lignitic group. See Laramie group.",
    "lation": "Transportation; conveyance. [Obs.]",
    "longirostres":
        "A group of birds characterized by having long slender bills, as the sandpipers, curlews, and ibises. It is now regarded as an artificial division.",
    "leucoma":
        "A white opacity in the cornea of the eye; -- called also albugo.",
    "leasehold":
        "Held by lease.\n\nA tenure by lease; specifically, land held as personalty under a lease for years.",
    "lyencephala":
        "A group of Mammalia, including the marsupials and monotremes; - - so called because the corpus callosum is rudimentary.",
    "limniad": "See Limoniad.",
    "locum tenens": "A substitute or deputy; one filling an office for a time.",
    "lobeline":
        "A poisonous narcotic alkaloid extracted from the leaves of Indian tobacco (Lobelia inflata) as a yellow oil, having a tobaccolike taste and odor.",
    "lodge":
        "1. A shelter in which one may rest; as: (a) A shed; a rude cabin; a hut; as, an Indian's lodge. Chaucer. Their lodges and their tentis up they gan bigge [to build]. Robert of Brunne. O for a lodge in some vast wilderness! Cowper. (b) A small dwelling house, as for a gamekeeper or gatekeeper of an estate. Shak. (c) A den or cave. (d) The meeting room of an association; hence, the regularly constituted body of members which meets there; as, a masonic lodge. (c) The chamber of an abbot, prior, or head of a college. 2. (Mining)  The space at the mouth of a level next the shaft, widened to permit wagons to pass, or ore to be deposited for hoisting; -- called also platt. Raymond. 3. A collection of objects lodged together. The Maldives, a famous lodge of islands. De Foe. 4. A family of North American Indians, or the persons who usually occupy an Indian lodge, -- as a unit of enumeration, reckoned from four to six persons; as, the tribe consists of about two hundred lodges, that is, of about a thousand individuals. Lodge gate, a park gate, or entrance gate, near the lodge. See Lodge, n., 1 (b).\n\n1. To rest or remain a lodge house, or other shelter; to rest; to stay; to abide; esp., to sleep at night; as, to lodge in York Street. Chaucer. Stay and lodge by me this night. Shak. Something holy lodges in that breast. Milton . 2. To fall or lie down, as grass or grain, when overgrown or beaten down by the wind. Mortimer. 3. To come to a rest; to stop and remain; as, the bullet lodged in the bark of a tree.\n\n1. To give shelter or rest to; especially, to furnish a sleeping place for; to harbor; to shelter; hence, to receive; to hold. Every house was proud to lodge a knight. Dryden. The memory can lodge a greater stone of images that all the senses can present at one time. Cheyne. 2. To drive to shelter; to track to covert. The deer is lodged; I have tracked her to her covert. Addison. 3. To deposit for keeping or preservation; as, the men lodged their arms in the arsenal. 4. To cause to stop or rest in; to implant. He lodged an arrow in a tender breast. Addison. 5. To lay down; to prostrate. Though bladed corn be lodged, and trees blown down. Shak. To lodge an information, to enter a formal complaint.",
    "lubricate":
        "1. To make smooth or slippery; as, mucilaginous and saponaceous remedies lubricate the parts to which they are applied. S. Sharp. Supples, lubricates, and keeps in play, The various movements of this nice machine. Young. 2. To apply a lubricant to, as oil or tallow.",
    "lithophane":
        "Porcelain impressed with figures which are made distinct by transmitted light, -- as when hung in a window, or used as a lamp shade.",
    "leucophyll":
        "A colorless substance isomeric with chlorophyll, contained in parts of plants capable of becoming green. Watts.",
    "ligan":
        "Goods sunk in the sea, with a buoy attached in order that they may be found again. See Jetsam and Flotsam. [Written also lagan.] Blackstone.",
    "localize":
        "To make local; to fix in, or assign to, a definite place. H. Spencer. Wordsworth.",
    "lemniscus":
        "One of two oval bodies hanging from the interior walls of the body in the Acanthocephala.",
    "leucoscope":
        "An instrument, devised by Professor Helmholtz, for testing the color perception of the eye, or for comparing different lights, as to their constituent color or their relative whiteness.",
    "limewater":
        "Water impregnated with lime; esp., an artificial solution of lime for medicinal purposes.",
    "lavolt":
        "An old dance, for two persons, being a kind of waltz, in which the woman made a high spring or bound. Shak.",
    "lizard":
        "1. (Zoöl.)  Any one of the numerous species of reptiles belonging to the order Lacertilia; sometimes, also applied to reptiles of other orders, as the Hatteria. Note: Most lizards have an elongated body, with four legs, and a long tail; but there are some without legs, and some with a short, thick tail. Most have scales, but some are naked; most have eyelids, but some do not. The tongue is varied in form and structure. In some it is forked, in others, as the chameleons, club-shaped, and very extensible. See Amphisbæna, Chameleon, Gecko, Gila monster, Horned toad, Iguana, and Dragon, 6. 2. (Naut.)  A piece of rope with thimble or block spliced into one or both of the ends. R. H. Dana, Ir. 3. A piece of timber with a forked end, used in dragging a heavy stone, a log, or the like, from a field. Lizard fish (Zoöl.), a marine scopeloid fish of the genus Synodus, or Saurus, esp. S. foetens of the Southern United States and West Indies; -- called also sand pike. -- Lizard snake (Zoöl.), the garter snake (Eutænia sirtalis). -- Lizard stone (Min.), a kind of serpentine from near Lizard Point, Cornwall, England, -- used for ornamental purposes. LIZARD'S TAIL Liz\"ard's tail`. (Bot.)  A perennial plant of the genus Saururus (S. cernuus), growing in marshes, and having white flowers crowded in a slender terminal spike, somewhat resembling in form a lizard's tail; whence the name. Gray.",
    "leeward":
        "Pertaining to, or in the direction of, the part or side toward which the wind blows; -- opposed to windward; as, a leeward berth; a leeward ship. -- n.  The lee side; the lee. -- adv.  Toward the lee.",
    "locomotor":
        "Of or pertaining to movement or locomotion. Locomotor ataxia, or Progressive locomotor ataxy (Med.), a disease of the spinal cord characterized by peculiar disturbances of gait, and difficulty in coördinating voluntary movements.",
    "larviparous":
        "Depositing living larvæ, instead of eggs; -- said of certain insects.",
    "langret": "A kind of loaded die. [Obs.]",
    "lineary": "Linear. Holland.",
    "lushburg": "See Lussheburgh. [Obs.]",
    "lutestring":
        "A plain, stout, lustrous silk, used for ladies' dresses and for ribbon. Goldsmith.",
    "lignous": "Ligneous. [R.] Evelyn.",
    "leep": "of Leap. leaped.",
    "lithophagous":
        "(a) Eating or swallowing stones or gravel, as the ostrich. (b) Eating or destroying stone; -- applied to various animals which make burrows in stone, as many bivalve mollusks, certain sponges, annelids, and sea urchins. See Lithodomus.",
    "lightwood":
        "Pine wood abounding in pitch, used for torches in the Southern United States; pine knots, dry sticks, and the like, for kindling a fire quickly or making a blaze.",
    "lockman": "A public executioner. [Scot.]",
    "legitim":
        "The portion of movable estate to which the children are entitled upon the death of the father.",
    "lasting":
        "Existing or continuing a long while; enduring; as, a lasting good or evil; a lasting color. Syn. -- Durable; permanent; undecaying; perpetual; unending. -- Lasting, Permanent, Durable. Lasting commonly means merely continuing in existence; permanent carries the idea of continuing in the same state, position, or course; durable means lasting in spite of agencies which tend to destroy.\n\n1. Continuance; endurance. Locke. 2. A species of very durable woolen stuff, used for women's shoes; everlasting. 3. The act or process of shaping on a last.\n\nIn a lasting manner.",
    "lawmaking":
        "Enacting laws; legislative. -- n.  The enacting of laws; legislation.",
    "leven": "Lightning. [Obs.] Wild thunder dint and fiery leven. Chaucer.",
    "lorettine":
        "One of a order of nuns founded in 1812 at Loretto, in Kentucky. The members of the order (called also Sisters of Loretto, or Friends of Mary at the Foot of the Cross) devote themselves to the cause of education and the care of destitute orphans, their labors being chiefly confined to the Western United States.",
    "leucocytogenesis": "The formation of leucocytes.",
    "lacertiloid": "Like or belonging to the Lacertilia.",
    "litigant":
        "Disposed to litigate; contending in law; engaged in a lawsuit; as, the parties litigant. Ayliffe.\n\nA person engaged in a lawsuit.",
    "lily":
        "1. (Bot.)  A plant and flower of the genus Lilium, endogenous bulbous plants, having a regular perianth of six colored pieces, six stamens, and a superior three-celled ovary. Note: There are nearly fifty species, all found in the North Temperate zone. Lilium candidum and L. longiflorum are the common white lilies of gardens; L. Philadelphicum is the wild red lily of the Atlantic States. L. Chalcedonicum is supposed to be the \"lily of the field\" in our Lord's parable; L. auratum is the great gold-banded lily of Japan. 2. (Bot.)  A name given to handsome flowering plants of several genera, having some resemblance in color or form to a true lily, as Pancratium, Crinum, Amaryllis, Nerine, etc. 3. That end of a compass needle which should point to the north; -- so called as often ornamented with the figure of a lily or fleur-de- lis. But sailing further, it veers its lily to the west. Sir T. Browne. African lily (Bot.), the blue-flowered Agapanthus umbellatus. -- Atamasco lily (Bot.), a plant of the genus Zephyranthes (Z. Atamasco), having a white and pink funnelform perianth, with six petal-like divisions resembling those of a lily. Gray. -- Blackberry lily (Bot.), the Pardanthus Chinensis, the black seeds of which form a dense like a blackberry. -- Bourbon lily (Bot.), Lilium candidum. See Illust. -- Butterfly lily. (Bot.) Same as Mariposa lily, in the Vocabulary. -- Lily daffodil (Bot.), a plant of the genus Narcissus, and its flower. -- Lily encrinite (Paleon.), a fossil encrinite, esp. Encrinus liliiformis. See Encrinite. -- Lily hyacinth (Bot.), a plant of the genus Hyacinthus. -- Lily iron, a kind of harpoon with a detachable head of peculiar shape, used in capturing swordfish. -- Lily of the valley (Bot.), a low perennial herb (Convallaria majalis), having a raceme of nodding, fragrant, white flowers. -- Lily pad, the large floating leaf of the water lily. [U. S.] Lowell. -- Tiger lily (Bot.), Lilium tigrinum, the sepals of which are blotched with black. -- Turk's-cap lily (Bot.) Lilium Martagon, a red lily with recurved sepals; also, the similar American lily, L. superbum. -- Water lily (Bot.), the Nymphæa, a plant with floating roundish leaves, and large flowers having many petals, usually white, but sometimes pink, red, blue, or yellow. [See Illust. of Nymphæa.]",
    "limb":
        "1. A part of a tree which extends from the trunk and separates into branches and twigs; a large branch. 2. An arm or a leg of a human being; a leg, arm, or wing of an animal. A second Hector for his grim aspect, And large proportion of his strong-knit limbs. Shak. 3. A thing or person regarded as a part or member of, or attachment to, something else. Shak. That little limb of the devil has cheated the gallows. Sir W. Scott. 4. An elementary piece of the mechanism of a lock. Limb of the law, a lawyer or an officer of the law. [Colloq.] Landor.\n\n1. To supply with limbs. [R.] Milton. 2. To dismember; to tear off the limbs of.\n\nA border or edge, in certain special uses. (a) (Bot.) The border or upper spreading part of a monopetalous corolla, or of a petal, or sepal; blade. (b) (Astron.) The border or edge of the disk of a heavenly body, especially of the sun and moon. (c) The graduated margin of an arc or circle, in an instrument for measuring angles.",
    "leer":
        "To learn. [Obs.] See Lere, to learn.\n\nEmpty; destitute; wanting; as: (a) Empty of contents. \"A leer stomach.\" Gifford. (b) Destitute of a rider; and hence, led, not ridden; as, a leer horse. B. Jonson. (c) Wanting sense or seriousness; trifling; trivolous; as, leer words.\n\nAn oven in which glassware is annealed.\n\n1. The cheek. [Obs.] Holinshed. 2. complexion; aspect; appearance. [Obs.] A Rosalind of a better leer than you. Shak. 3. A distorted expression of the face, or an indirect glance of the eye, conveying a sinister or immodest suggestion. With jealous leer malign Eyed them askance. Milton. She gives the leer of invitation. Shak. Damn with faint praise, assent with civil leer. Pope.\n\nTo look with a leer; to look askance with a suggestive expression, as of hatred, contempt, lust, etc. ; to cast a sidelong lustful or malign look. I will leer him as a'comes by. Shak. The priest, above his book, Leering at his neighbor's wife. Tennyson.\n\nTo entice with a leer, or leers; as, to leer a man to ruin. Dryden.",
