    "overfatigue": "Excessive fatigue.\n\nTo fatigue to excess; to tire out.",
    "opinionable":
        "Being, or capable of being, a matter of opinion; that can be thought; not positively settled; as, an opinionable doctrine. C. J. Ellicott.",
    "orthopedical":
        "Pertaining to, or employed in, orthopedy; relating to the prevention or cure of deformities of children, or, in general, of the human body at any age; as, orthopedic surgery; an orthopedic hospital.",
    "ovarial": "Of or pertaining to an ovary.",
    "owlism": "Affected wisdom; pompous dellness. [R.]",
    "organ":
        "1. An instrument or medium by which some important action is performed, or an important end accomplished; as, legislatures, courts, armies, taxgatherers, etc., are organs of government. 2. (Biol.)  A natural part or structure in an animal or a plant, capable of performing some special action (termed its function), which is essential to the life or well-being of the whole; as, the heart, lungs, etc., are organs of animals; the root, stem, foliage, etc., are organs of plants. Note: In animals the organs are generally made up of several tissues, one of which usually predominates, and determines the principal function of the organ. Groups of organs constitute a system. See System. 3. A component part performing an essential office in the working of any complex machine; as, the cylinder, valves, crank, etc., are organs of the steam engine. 4. A medium of communication between one person or body and another; as, the secretary of state is the organ of communication between the government and a foreign power; a newspaper is the organ of its editor, or of a party, sect, etc. 5. Etym: [Cf. AS. organ, fr. L. organum.] (Mus.)  A wind instrument containing numerous pipes of various dimensions and kinds, which are filled with wind from a bellows, and played upon by means of keys similar to those of a piano, and sometimes by foot keys or pedals; -- formerly used in the plural, each pipe being considired an organ. The deep, majestic, solemn organs blow. Pope. Note: Chaucer used the form orgon as a plural. The merry orgon . . . that in the church goon [go]. Barrel organ, Choir organ, Great organ, etc. See under Barrel, Choir, etc. -- Cabinet organ (Mus.), an organ of small size, as for a chapel or for domestic use; a reed organ. -- Organ bird (Zoöl.), a Tasmanian crow shrike (Gymnorhina organicum). It utters discordant notes like those of a hand organ out of tune. -- Organ fish (Zoöl.), the drumfish. -- Organ gun. (Mil.) Same as Orgue (b). -- Organ harmonium (Mus.), an harmonium of large capacity and power. -- Organ of Gorti (Anat.), a complicated structure in the cochlea of the ear, including the auditory hair cells, the rods or fibers of Corti, the membrane of Corti, etc. See Note under Ear. -- Organ pipe. See Pipe, n., 1. -- Organ-pipe coral. (Zoöl.) See Tubipora. -- Organ point (Mus.), a passage in which the tonic or dominant is sustained continuously by one part, while the other parts move.\n\nTo supply with an organ or organs; to fit with organs; to organize. [Obs.] Thou art elemented and organed for other apprehensions. Bp. Mannyngham.",
    "overflutter": "To flutter over.",
    "obolize": "See Obelize.",
    "oversnow": "To cover with snow, or as with snow. [Poetic] Shak. Dryden.",
    "ordinant":
        "Ordaining; decreeing. [Obs.] Shak.\n\nOne who ordains. F. G. Lee.",
    "overstrow": "See Overstrew.",
    "ocarina": "A kind of small simple wind instrument.",
    "oolite":
        "A variety of limestone, consisting of small round grains, resembling the roe of a fish. It sometimes constitutes extensive beds, as in the European Jurassic. See the Chart of Geology.",
    "orbitar": "Orbital. [R.] Dunglison.",
    "obduce": "To draw over, as a covering. [Obs.] Sir M. Hale.",
    "otherness":
        "The quality or state of being other or different; alterity; oppositeness.",
    "overinform": "To inform, fill, or animate, excessively. [R.] Johnson.",
    "occasionality":
        "Quality or state of being occasional; occasional occurrence. [R.]",
    "oughwhere": "Anywhere; somewhere. See Owher. [Obs.]",
    "orchidean": "Orchidaceous.",
    "ooelogical": "Of or pertaining to oölogy.",
    "opinionately": "Conceitedly. Feltham.",
    "olay":
        "Palm leaves, prepared for being written upon with a style pointed with steel. [Written also ola.] Balfour (Cyc. of India).",
    "orchideous": "Same as Orchidaceous.",
    "octo":
        "A combining form meaning eight; as in octodecimal, octodecimal, octolocular.",
    "opisthodome":
        "A back chamber; especially, that part of the naos, or cella, farthest from the main entrance, sometimes having an entrance of its own, and often used as a treasury.",
    "obolary": "Possessing only small coins; impoverished. [R.] Lamb.",
    "outcourt":
        "An outer or exterior court. The skirts and outcourts of heaven. South.",
    "outpoise": "To outweigh. Howell.",
    "oophoric": "Having the nature of, or belonging to, an oöphore.",
    "orthocarbonic":
        "Designating a complex ether, C.(OC2H5)4, which is obtained as a liquid of a pleasant ethereal odor by means of chlorpicrin, and is believed to be a derivative of the hypothetical normal carbonic acid, C.(OH)4.",
    "oscillaria":
        "A genus of dark green, or purplish black, filamentous, fresh- water algæ, the threads of which have an automatic swaying or crawling motion. Called also Oscillatoria.",
    "odorless": "Free from odor.",
    "orchilla weed": "The lichen from which archil is obtained. See Archil.",
    "outspan": "To unyoke or disengage, as oxen from a wagon. [S. Africa]",
    "outwear":
        "1. To wear out; to consume or destroy by wearing. Milton. 2. To last longer than; to outlast; as, this cloth will outwear the other. \"If I the night outwear.\" Pope.",
    "outcrier": "One who cries out or proclaims; a herald or crier.",
    "overanxious":
        "Anxious in an excessive or needless degree. -- O\"ver*anx\"ious*ly, adv.",
    "overestimate":
        "To estimate too highly; to overvalue.\n\nAn estimate that is too high; as, an overestimate of the vote.",
    "oversize":
        "To surpass in size.\n\nTo cover with viscid matter. [R.] O'ersized with coagulate gore. Shak.",
    "overtoil":
        "To overwork.\n\nTo weary excessively; to exhaust. Then dozed a while herself, but overtoiled By that day's grief and travel. Tennyson.",
    "ovine": "Of or pertaining to sheep; consisting of sheep.",
    "oryctography": "Description of fossils. [Obs.]",
    "ovisac":
        "(a) A Graafian follicle; any sac containing an ovum or ova. (b) The inner layer of the fibrous wall of a Graafian follicle.",
    "oxaldehyde": "Same as Glyoxal.",
    "overcatch": "To overtake. [Obs.]",
    "oxheart": "A large heart-shaped cherry, either black, red, or white.",
    "overbarren": "Excessively barren.",
    "overlinger": "To cause to linger; to detain too long. [Obs.] Fuller.",
    "oxid": "See Oxide.",
    "olfactor": "A smelling organ; a nose. [R.]",
    "orgue":
        "(a) Any one of a number of long, thick pieces of timber, pointed and shod with iron, and suspended, each by a separate rope, over a gateway, to be let down in case of attack. (b) A piece of ordnance, consisting of a number of musket barrels arranged so that a match or train may connect with all their touchholes, and a discharge be secured almost or quite simultaneously.",
    "osiered":
        "Covered or adorned with osiers; as, osiered banks. [Poetic] Collins.",
    "oblong":
        "Having greater length than breadth, esp. when rectangular.\n\nA rectangular figure longer than it is broad; hence, any figure longer than it is broad. The best figure of a garden I esteem an oblong upon a descent. Sir W. Temple.",
    "obligatory":
        "Binding in law or conscience; imposing duty or obligation; requiring performance or forbearance of some act; -- often followed by on or upon; as, obedience is obligatory on a soldier. As long as the law is obligatory, so long our obedience is due. Jer. Taylor.",
    "obrogate":
        "To annul indirectly by enacting a new and contrary law, instead of by expressly abrogating or repealing the old one. [Obs.] Bailey.",
    "ogive": "The arch or rib which crosses a Gothic vault diagonally.",
    "ophthalmoscope":
        "An instrument for viewing the interior of the eye, particularly the retina. Light is thrown into the eye by a mirror (usually concave) and the interior is then examined with or without the aid of a lens. -- Oph*thal`mo*scop\"ic, a.",
    "oophytic": "Of or pertaining to an oöphyte.",
    "obeisancy": "See Obeisance. [Obs.]",
    "overrefinement": "Excessive refinement.",
    "odin":
        "The supreme deity of the Scandinavians; -- the same as Woden, of the German tribes. There in the Temple, carved in wood, The image of great Odin stood. Longfellow.",
    "octodentate": "Having eight teeth.",
    "opinionated":
        "Stiff in opinion; firmly or unduly adhering to one's own opinion or to preconceived notions; obstinate in opinion. Sir W. Scott.",
    "odor":
        "Any smell, whether fragrant or offensive; scent; perfume. Meseemed I smelt a garden of sweet flowers, That dainty odors from them threw around. Spenser. To be in bad odor, to be out of favor, or in bad repute.",
    "operand":
        "The symbol, quantity, or thing upon which a mathematical operation is performed; -- called also faciend.",
    "oppilate":
        "To crowd together; to fill with obstructions; to block up. [Obs.] Cockeram.",
    "osteoperiostitis": "Inflammation of a bone and its periosteum.",
    "orthodox":
        "1. Sound in opinion or doctrine, especially in religious doctrine; hence, holding the Christian faith; believing the doctrines taught in the Scriptures; -- opposed to Ant: heretical and Ant: heterodox; as, an orthodox Christian. 2. According or congruous with the doctrines of Scripture, the creed of a church, the decree of a council, or the like; as, an orthodox opinion, book, etc. 3. Approved; conventional. He saluted me on both cheeks in the orthodox manner. H. R. Haweis. Note: The term orthodox differs in its use among the various Christian communions. The Greek Church styles itself the \"Holy Orthodox Apostolic Church,\" regarding all other bodies of Christians as more or less heterodox. The Roman Catholic Church regards the Protestant churches as heterodox in many points. In the United States the term orthodox is frequently used with reference to divergent views on the doctrine of the Trinity. Thus it has been common to speak of the Trinitarian Congregational churches in distinction from the Unitarian, as Orthodox. The name is also applied to the conservative, in distinction from the \"liberal\", or Hicksite, body in the Society of Friends. Schaff-Herzog Encyc.",
    "ostraciont": "A fish of the genus Ostracion and allied genera.",
    "ovation":
        "1. (Rom. Antiq.)  A lesser kind of triumph allowed to a commander for an easy, bloodless victory, or a victory over slaves. 2. Hence: An expression of popular homage; the tribute of the multitude to a public favorite. To rain an April of ovation round Their statues. Tennyson.",
    "overhent":
        "To overtake. [Obs.] So forth he went and soon them overhent. Spenser.",
    "oarlock":
        "The notch, fork, or other device on the gunwale of a boat, in which the oar rests in rowing.  See Rowlock.",
    "ovile": "See Ovine.",
    "overshade":
        "To cover with shade; to render dark or gloomy; to overshadow. Shak.",
    "overtly": "Publicly; openly.",
    "obelus":
        "A mark [thus ---, or ÷]; -- so called as resembling a needle. In old MSS. or editions of the classics, it marks suspected passages or readings.",
    "overworn": "Worn out or subdued by toil; worn out so as to be trite.",
    "overtrade":
        "To trade beyond one's capital; to buy goods beyond the means of paying for or seleng them; to overstock the market.",
    "outwell": "To pour out. [Obs.] Spenser.\n\nTo issue forth. Thomson.",
    "orthid":
        "A brachiopod shell of the genus Orthis, and allied genera, of the family Orthidæ.",
    "obsolescent":
        "Going out of use; becoming obsolete; passing into desuetude.",
    "optimity": "The state of being best. [R.] Bailey.",
    "overpicture":
        "To surpass nature in the picture or representation of. [Obs.] \"O'erpicturing that Venus.\" Shak.",
    "obtemper": "To obey (a judgment or decree).",
    "outstart": "To start out or up. Chaucer.",
    "overgreat": "Too great.",
    "old dominion":
        "Virginia; -- a name of uncertain origin, perh. from the old designation of the colony as \"the Colony and Dominion of Virginia.\"",
    "onloft":
        "Aloft; above ground. [Obs.] She kept her father's life onloft. Chaucer.",
    "overpraise": "To praise excessively or unduly.",
    "onycha":
        "1. An ingredient of the Mosaic incense, probably the operculum of some kind of strombus. Ex. xxx. 34. 2. The precious stone called onyx. [R.]",
    "oynoun": "Onion. [Obs.] Chaucer.",
    "octangular":
        "Having eight angles; eight-angled. -- Oc*tan\"gu*lar*ness, n.",
    "ophism":
        "1. Doctrines and rites of the Ophites. 2.  Serpent worship or the use of serpents as magical agencies.",
    "outrush": "To rush out; to issue, or ru Garth.",
    "outburst": "A bursting forth.",
    "omander wood":
        "The wood of Diospyros ebenaster, a kind of ebony found in Ceylon.",
    "ontology":
        "That department of the science of metaphysics which investigates and explains the nature and essential properties and relations of all beings, as such, or the principles and causes of being.",
    "ooephoric": "Having the nature of, or belonging to, an oöphore.",
    "organity": "Organism. [R.]",
    "obsequiousness": "The quality or state of being obsequious. South.",
    "obtenebration":
        "The act of darkening; the state of being darkened; darkness. [Obs.] In every megrim or vertigo, there is an obtenebration joined with a semblance of turning round. Bacon.",
    "obviate":
        "1. To meet in the way. [Obs.] Not to stir a step to obviate any of a different religion. Fuller. 2. To anticipate; to prevent by interception; to remove from the way or path; to make unnecessary; as, to obviate the necessity of going. To lay down everything in its full light, so as to obviate all exceptions. Woodward.",
    "obcordate":
        "Heart-shaped, with the attachment at the pointed end; inversely cordate: as, an obcordate petal or leaf.",
    "octoyl":
        "A hypothetical radical (C8H15O), regarded as the essential residue of octoic acid.",
    "orthopterous": "Of or pertaining to the Orthoptera.",
    "objectionable":
        "Liable to objection; likely to be objected to or disapproved of; offensive; as, objectionable words. -- Ob*jec\"tion*a*bly, adv.",
    "obstupefactive": "Stupefactive. [Obs.]",
    "orgy": "A frantic revel; drunken revelry. See Orgies",
    "ouranography": "See Uranography.",
    "overdose":
        "To dose to excess; to give an overdose, or too many doses, to.\n\nToo great a dose; an excessive dose.",
    "obversion":
        "1. The act of turning toward or downward. 2. (Logic)  The act of immediate inference, by which we deny the opposite of anything which has been affirmed; as, all men are mortal; then, by obversion, no men are immortal. This is also described as \"immediate inference by privative conception.\" Bain.",
    "ombre":
        "A game at cards, borrowed from the Spaniards, and usually played by three persons. Pope. When ombre calls, his hand and heart are free, And, joined to two, he fails not to make three. Young.\n\nA large Mediterranean food fish (Umbrina cirrhosa): -- called also umbra, and umbrine.",
    "oxshoe":
        "A shoe for oxen, consisting of a flat piece of iron nailed to the hoof.",
    "observative": "Observing; watchful.",
    "odize": "To charge with od. See Od. [Archaic]",
    "octoedrical": "See Octahedral. [Obs.] Sir T. Browne.",
    "octant":
        "1. (Geom.)  The eighth part of a circle; an arc of 45 degrees. 2. (Astron. & Astrol.)  The position or aspect of a heavenly body, as the moon or a planet, when half way between conjunction, or opposition, and quadrature, or distant from another body 45 degrees. 3. An instrument for measuring angles (generally called a quadrant), having an arc which measures up to 9Oº, but being itself the eighth part of a circle. Cf. Sextant. 4. (Math. & Crystallog.)  One of the eight parts into which a space is divided by three coördinate planes.",
    "orarian": "Of or pertaining to a coast.",
    "overmast":
        "To furnish (a vessel) with too long or too heavy a mast or masts.",
    "omniscient":
        "Having universal knowledge; knowing all things; infinitely knowing or wise; as, the omniscient God. -- Om*nis\"cient*ly, adv. For what can scape the eye Of God all-seeing, or deceive his heart Omniscient Milton.",
    "organoleptic":
        "Making an impression upon an organ; plastic; -- said of the effect or impression produced by any substance on the organs of touch, taste, or smell, and also on the organism as a whole.",
    "omnify":
        "To render universal; to enlarge. [R.] Omnify the disputed point into a transcendent, and you may defy the opponent to lay hold of it. Coleridge.",
    "ohm":
        "The standard unit in the measure of electrical resistance, being the resistance of a circuit in which a potential difference of one volt produces a current of one ampére. As defined by the International Electrical Congress in 1893, and by United States Statute, it is a resistance substantially equal to 109 units of resistance of the C.G.S. system of electro-magnetic units, and is represented by the resistance offered to an unvarying electric current by a column of mercury at the temperature of melting ice 14.4521 grams in mass, of a constant cross-sectional area, and of the length of 106.3 centimeters. As thus defined it is called the international ohm. Ohm's law (Elec.), the statement of the fact that the strength or intensity of an electrical current is directly proportional to the electro-motive force, and inversely proportional to the resistance of the circuit.",
    "omniparity": "Equality in every part; general equality.",
    "omnipotence":
        "1. The state of being omnipotent; almighty power; hence, one who is omnipotent; the Deity. Will Omnipotence neglect to save The suffering virtue of the wise and brave Pope. 2. Unlimited power of a particular kind; as, love's omnipotence. Denham.",
    "orrach": "See Orach.",
    "osteoid": "Resembling bone; bonelike.",
    "overcare": "Excessive care. Dryden.",
    "olive":
        "1. (Bot.) (a) A tree (Olea Europæa) with small oblong or elliptical leaves, axillary clusters of flowers, and oval, one-seeded drupes. The tree has been cultivated for its fruit for thousands of years, and its branches are the emblems of peace. The wood is yellowish brown and beautifully variegated. (b) The fruit of the olive. It has been much improved by cultivation, and is used for making pickles. Olive oil is pressed from its flesh. 2. (Zoöl.) (a) Any shell of the genus Oliva and allied genera; -- so called from the form. See Oliva. (b) The oyster catcher. [Prov.Eng.] 3. (a) The color of the olive, a peculiar dark brownish, yellowish, or tawny green. (b) One of the tertiary colors, composed of violet and green mixed in equal strength and proportion. 4. (Anat.)  An olivary body. See under Olivary. 5. (Cookery)  A small slice of meat seasoned, rolled up, and cooked; as, olives of beef or veal. Note: Olive is sometimes used adjectively and in the formation of self-explaining compounds; as, olive brown, olive green, olive- colored, olive-skinned, olive crown, olive garden, olive tree, olive yard, etc. Bohemian olive (Bot.), a species of Elæagnus (E. angustifolia), the flowers of which are sometimes used in Southern Europe as a remedy for fevers. -- Olive branch. (a) A branch of the olive tree, considered an emblem of peace. (b) Fig.: A child. -- Olive brown, brown with a tinge of green. -- Olive green, a dark brownish green, like the color of the olive. -- Olive oil, an oil expressed from the ripe fruit of the olive, and much used as a salad oil, also in medicine and the arts. -- Olive ore (Min.), olivenite. -- Wild olive (Bot.), a name given to the oleaster or wild stock of the olive; also variously to several trees more or less resembling the olive.\n\nApproaching the color of the olive; of a peculiar dark brownish, yellowish, or tawny green.",
    "oversow":
        "To sow where something has already been sown. [R.] His enemy came and oversowed cockle among the wheat. Matt. x",
    "overstand":
        "To stand on the price or conditions of, so as to lose a sale; to lose by an extravagant price or hard conditions. [Obs.] What madman would o'erstand his market twice Dryden.",
    "oppugn":
        "To fight against; to attack; to be in conflict with; to oppose; to resist. They said the manner of their impeachment they could not but conceive did oppugn the rights of Parliament. Clarendon.",
    "overglad": "Excessively or unduly glad.",
    "overtower": "To tower over or above.\n\nTo soar too high. [R.] Fuller.",
    "obloquy":
        "1. Censorious speech; defamatory language; language that casts contempt on men or their actions; blame; reprehension. Shall names that made yuor city the glory of the earth be mentioned with obloquy and detraction Addison. 2. Cause of reproach; disgrace. [Obs.] Shak. Syn. -- Reproach; odium; censure; contumely; gainsaying; reviling; calumny; slander; detraction.",
    "overgreedy": "Excessively greedy.",
    "octogild":
        "A pecuniary compensation for an injury, of eight times the value of the thing.",
    "oneirocritical":
        "Of or pertaining to the interpretation of dreams. Addison.",
    "objurgate": "To chide; to reprove.",
    "obduracy":
        "The duality or state of being obdurate; invincible hardness of heart; obstinacy. \"Obduracy and persistency.\" Shak. The absolute completion of sin in final obduracy. South.",
    "orthometric":
        "Having the axes at right angles to one another; -- said of crystals or crystalline forms.",
    "oleomargarine":
        "1. A liquid oil made from animal fats (esp. beef fat) by separating the greater portion of the solid fat or stearin, by crystallization. It is mainly a mixture of olein and palmitin with some little stearin. 2. An artificial butter made by churning this oil with more or less milk. Note: Oleomargarine was wrongly so named, as it contains no margarin proper, but olein, palmitin, and stearin, a mixture of palmitin and stearin having formerly been called margarin by mistake.",
    "opisthotic":
        "The inferior and posterior of the three elements forming the periotic bone.",
    "ossiculated": "Having small bones.",
    "ottava rima":
        "A stanza of eight lines of heroic verse, with three rhymes, the first six lines rhyming alternately and the last two forming a couplet. It was used by Byron in \"Don Juan,\" by Keats in \"Isabella,\" by Shelley in \"The Witch of Atlas,\" etc.",
    "ooesporangium":
        "An oögonium; also, a case containing oval or rounded spores of some other kind than oöspores.",
    "oddness":
        "1. The state of being odd, or not even. Take but one from three, and you not only destroy the oddness, but also the essence of that number. Fotherby. 2. Singularity; strangeness; eccentricity; irregularity; uncouthness; as, the oddness of dress or shape; the oddness of an event. Young.",
    "outpension":
        "To grant an outpension to.\n\nA public pension granted to one not required to live in a charitable institution. -- Out\"pen`sion*er, n.",
    "orthomorphic":
        "Having the right form. Orthomorphic projection, a projection in which the angles in the figure to be projected are equal to the corresponding angles in the projected figure.",
    "overstrict": "Excessively strict.",
    "outplay":
        "To excel or defeat in a game; to play better than; as, to be outplayed in tennis or ball.",
    "orle":
        "1. (Her.)  A bearing, in the form of a fillet, round the shield, within, but at some distance from, the border. 2. (Her.)  The wreath, or chaplet, surmounting or encircling the helmet of a knight and bearing the crest. In orle, round the escutcheon, leaving the middle of the field vacant, or occupied by something else; -- said of bearings arranged on the shield in the form of an orle.",
    "outpass": "To pass beyond; to exceed in progress.",
    "overglance": "To glance over.",
    "oared":
        "1. Furnished with oars; -- chiefly used in composition; as, a four- oared boat. 2. (Zoöl.) (a) Having feet adapted for swimming. (b) Totipalmate; -- said of the feet of certain birds. See Illust. of Aves. Oared shrew (Zoöl.), an aquatic European shrew (Crossopus ciliatus); -- called also black water shrew.",
    "ocellated":
        "1. Resembling an eye. 2. Marked with eyelike spots of color; as, the ocellated blenny. Ocellated turkey (Zoöl.), the wild turkey of Central America (Meleagris ocellata).",
    "orphanage":
        "1. The state of being an orphan; orphanhood; orphans, collectively. 2. An institution or asylum for the care of orphans.",
    "overhead expenses":
        "Those general charges or expenses in any business which cannot be charged up as belonging exclusively to any particular part of the work or product, as where different kinds of goods are made, or where there are different departments in a business; -- called also fixed, establishment, or (in a manufacturing business) administration, selling, and distribution, charges, etc.",
    "overknowing": "Too knowing or too cunning.",
    "ostler": "See Hostler.",
    "obsignate": "To seal; to ratify. [Obs.] Barrow.",
    "obscuration":
        "The act or operation of obscuring; the state of being obscured; as, the obscuration of the moon in an eclipse. Sir J. Herschel.",
    "overtedious": "Too tedious.",
    "ostentive": "Ostentatious. [Obs.]",
    "osteopathy":
        "(a) Any disease of the bones. [R.] (b) A system of treatment based on the theory that diseases are chiefly due to deranged mechanism of the bones, nerves, blood vessels, and other tissues, and can be remedied by manipulations of these parts.",
    "omened":
        "Attended by, or containing, an omen or omens; as, happy-omened day.",
    "orthodoxness":
        "The quality or state of being orthodox; orthodoxy. Waterland.",
    "ontologic": "Ontological.",
    "ovate-cylindraceous":
        "Having a form intermediate between ovate and cylindraceous.",
    "orangeroot":
        "An American ranunculaceous plant (Hidrastis Canadensis), having a yellow tuberous root; -- also called yellowroot, golden seal, etc.",
    "overjump": "To jump over; hence, to omit; to ignore. Marston.",
    "obstinate":
        "1. Pertinaciously adhering to an opinion, purpose, or course; persistent; not yielding to reason, arguments, or other means; stubborn; pertinacious; -- usually implying unreasonableness. I have known great cures done by obstinate resolution of drinking no wine. Sir W. Temple. No ass so meek, no ass so obstinate. Pope. Of sense and outward things. Wordsworth. 2. Not yielding; not easily subdued or removed; as, obstinate fever; obstinate obstructions. Syn. -- Stubborn; inflexible; immovable; firm; pertinacious; persistent; headstrong; opinionated; unyielding; refractory; contumacious. See Stubborn. -- Ob\"sti*nate*ly, adv. -- Ob\"sti*nate*ness, n.",
    "orchesography": "A treatise upon dancing. [R.]",
    "oratorio":
        "1. (Mus.)  A more or less dramatic text or poem, founded on some Scripture nerrative, or great divine event, elaborately set to music, in recitative, arias, grand choruses, etc., to be sung with an orchestral accompaniment, but without action, scenery, or costume, although the oratorio grew out of the Mysteries and the Miracle and Passion plays, which were acted. Note: There are instances of secular and mythological subjects treated in the form of the oratorios, and called oratorios by their composers; as Haydn's \"Seasons,\" Handel's \"Semele,\" etc. 2. Performance or rendering of such a composition.",
    "onliness": "The state of being alone. [Obs.]",
    "oculomotor":
        "Of or pertaining to the movement of the eye; -- applied especially to the common motor nerves (or third pair of cranial nerves) which supply many of the muscles of the orbit. -- n.  The oculomotor nerve.",
    "orthoepy":
        "The art of uttering words corectly; a correct pronunciation of words; also, mode of pronunciation.",
    "oundy": "Wavy; waving [Obs.] \"Owndie hair.\" Chaucer.",
