    "quirkish": ", Consisting of quirks; resembling a quirk. Barrow.",
    "quarrel":
        "1. An arrow for a crossbow; -- so named because it commonly had a square head. [Obs.] To shoot with arrows and quarrel. Sir J. Mandeville. Two arblasts, . . . with windlaces and quarrels. Sir W. Scott. 2. (Arch.)  Any small square or quadrangular member; as: (a) A square of glass, esp. when set diagonally. (b) A small opening in window tracery, of which the cusps, etc., make the form nearly square. (c) A square or lozenge-shaped paving tile. 3. A glazier's diamond. Simmonds. 4. A four-sided cutting tool or chisel having a diamond-shaped end.\n\n1. A breach of concord, amity, or obligation; a falling out; a difference; a disagreement; an antagonism in opinion, feeling, or conduct; esp., an angry dispute, contest, or strife; a brawl; an altercation; as, he had a quarrel with his father about expenses. I will bring a sword upon you that shall avenge the quarrel of my covenant. Lev. xxvi. 25. On open seas their quarrels they debate. Dryden. 2. Ground of objection, dislike, difference, or hostility; cause of dispute or contest; occasion of altercation. Herodias had a quarrel against him, and would have killed him. Mark vi. 19. No man hath any quarrel to me. Shak. He thought he had a good quarrel to attack him. Holinshed. 3. Earnest desire or longing. [Obs.] Holland. To pick a quarrel. See under Pick, v. t. Syn. -- Brawl; broil; squabble; affray; feud; tumult; contest; dispute; altercation; contention; wrangle.\n\n1. To violate concord or agreement; to have a difference; to fall out; to be or become antagonistic. Our people quarrel with obedience. Shak. But some defect in her Did quarrel with the noblest grace she owed. Shak. 2. To dispute angrily, or violently; to wrangle; to scold; to altercate; to contend; to fight. Beasts called sociable quarrel in hunger and lust. Sir W. Temple. 3. To find fault; to cavil; as, to quarrel with one's lot. I will not quarrel with a slight mistake. Roscommon.\n\n1. To quarrel with. [R.] \"I had quarelled my brother purposely.\" B. Jonson. 2. To compel by a quarrel; as, to quarrel a man out of his estate or rights.\n\nOne who quarrels or wrangles; one who is quarrelsome. Shak.",
    "quartic":
        "Of the fourth degree.\n\n(a) (Alg.) A quantic of the fourth degree. See Quantic. (b) (Geom.) A curve or surface whose equation is of the fourth degree in the variables.",
    "quinizine":
        "any one of a series of nitrogenous bases, certain of which are used as antipyretics.",
    "quadri-syllabical":
        "Having four syllables; of or pertaining to quadrisyllables; as, a quadrisyllabic word.",
    "querulous":
        "1. Given to quarreling; quarrelsome. [Obs.] land. 2. Apt to find fault; habitually complaining; disposed to murmur; as, a querulous man or people. Enmity can hardly be more annoying that querulous, jealous, exacting fondness. Macaulay. 3. Expressing complaint; fretful; whining; as, a querulous tone of voice. Syn. -- Complaining; bewailing; lamenting; whining; mourning; murmuring; discontented; dissatisfied. -- Quer\"u*lous*ly, adv. -- Quer\"u*lous*ness, n.",
    "quintal":
        "1. A hundredweight, either 112 or 100 pounds, according to the scale used. Cf. Cental. [Sometimes written and pronounced kentle.] 2. A metric measure of weight, being 100,000 grams, or 100 kilograms, equal to 220.46 pounds avoirdupois.",
    "quince":
        "1. The fruit of a shrub (Cydonia vulgaris) belonging to the same tribe as the apple. It somewhat resembles an apple, but differs in having many seeds in each carpel. It has hard flesh of high flavor, but very acid, and is largely used for marmalade, jelly, and preserves. 2. (Bot.)  a quince tree or shrub. Japan quince (Bot.), an Eastern Asiatic shrub (Cydonia, formerly Pyrus, Japonica) and its very fragrant but inedible fruit. The shrub has very showy flowers, usually red, but sometimes pink or white, and is much grown for ornament. -- Quince curculio (Zoöl.), a small gray and yellow curculio (Conotrachelus cratægi) whose larva lives in quinces. -- Quince tree (Bot.), the small tree (Cydonia vulgaris) which produces the quince.",
    "quaternion":
        "1. The number four. [Poetic] 2. A set of four parts, things, or person; four things taken collectively; a group of four words, phrases, circumstances, facts, or the like. Delivered him to four quaternions of soldiers. Acts xii. 4. Ye elements, the eldest birth Of Nature's womb, that in quaternion run. Milton. The triads and quaternions with which he loaded his sentences. Sir W. Scott. 3. A word of four syllables; a quadrisyllable. 4. (Math.)  The quotient of two vectors, or of two directed right lines in space, considered as depending on four geometrical elements, and as expressible by an algebraic symbol of quadrinomial form. Note: The science or calculus of quaternions is a new mathematical method, in which the conception of a quaternion is unfolded and symbolically expressed, and is applied to various classes of algebraical, geometrical, and physical questions, so as to discover theorems, and to arrive at the solution of problems. Sir W. R. Hamilton.\n\nTo divide into quaternions, files, or companies. Milton.",
    "quillet":
        "Subtilty; nicety; quibble. \"Nice, sharp quillets of the law.\" Shak.",
    "que": "A half farthing. [Obs.]",
    "quiesce": "To be silent, as a letter; to have no sound. M. Stuart.",
    "q":
        ", the seventeenth letter of the English alphabet, has but one sound (that of k), and is always followed by u, the two letters together being sounded like kw, except in some words in which the u is silent. See Guide to Pronunciation, § 249. Q is not found in Anglo-Saxon, cw being used instead of qu; as in cwic, quick; cwen, queen. The name (ku) is from the French ku, which is from the Latin name of the same letter; its form is from the Latin, which derived it, through a Greek alphabet, from the Phoenician, the ultimate origin being Egyptian. Etymologically, q or qu is most nearly related to a (ch, tch), p, q, and wh; as in cud, quid, L. equus, ecus, horse, Gr. equine, hippic; L. quod which, E. what; L. aquila, E. eaqle; E. kitchen, OE. kichene, AS. cycene, L. coquina.",
    "quartering":
        "1. (Naut.)  Coming from a point well abaft the beam, but not directly astern; -- said of waves or any moving object. 2. (Mach.)  At right angles, as the cranks of a locomotive, which are in planes forming a right angle with each other.\n\n1. A station. [Obs.] Bp. Montagu. 2. Assignment of quarters for soldiers; quarters. 3. (Her.) (a) The division of a shield containing different coats of arms into four or more compartments. (b) One of the different coats of arms arranged upon an escutcheon, denoting the descent of the bearer. 4. (Arch.)  A series of quarters, or small upright posts. See Quarter, n., 1 (m) (Arch.) Gwilt. Quartering block, a block on which the body of a condemned criminal was quartered. Macaulay.",
    "quadrupedal": "Having four feet; of or pertaining to a quadruped.",
    "queen":
        "1. The wife of a king. 2. A woman who is the sovereign of a kingdom; a female monarch; as, Elizabeth, queen of England; Mary, queen of Scots. In faith, and by the heaven's quene. Chaucer. 3. A woman eminent in power or attractions; the highest of her kind; as, a queen in society; -- also used figuratively of cities, countries, etc. \" This queen of cities.\" \" Albion, queen of isles.\" Cowper. 4. The fertile, or fully developed, female of social bees, ants, and termites. 5 5, (Chess)  The most powerful, and except the king the most important, piece in a set of chessmen. 6. A playing card bearing the picture of a queen; as, the queen of spades.  A male homosexual, esp. one who is effeminate or dresses in women's clothing. Sometimes pejorative. Queen apple. Etym: [Cf. OE. quyne aple quince apple.] A kind of apple; a queening. \"Queen apples and red cherries.\" Spenser. -- Queen bee (Zoöl.), a female bee, especially the female of the honeybee. See Honeybee. -- Queen conch (Zoöl.), a very large West Indian cameo conch (Cassis cameo). It is much used for making cameos. -- Queen consort, the wife of a reigning king. Blackstone. -- Queen dowager, the widow of a king. -- Queen gold, formerly a revenue of the queen consort of England, arising from gifts, fines, etc. -- Queen mother, a queen dowager who is also mother of the reigning king or queen. -- Queen of May. See May queen, under May. -- Queen of the meadow (Bot.), a European herbaceous plant (Spiræa Ulmaria). See Meadowsweet. -- Queen of the prairie (Bot.), an American herb (Spiræa lobata) with ample clusters of pale pink flowers. -- Queen pigeon (Zoöl.), any one of several species of very large and handsome crested ground pigeons of the genus Goura, native of New Guinea and the adjacent islands. They are mostly pale blue, or ash- blue, marked with white, and have a large occipital crest of spatulate feathers. Called also crowned pigeon, goura, and Victoria pigeon. -- Queen regent, or Queen regnant, a queen reigning in her own right. -- Queen's Bench. See King's Bench. -- Queen's counsel, Queen's evidence. See King's counsel, King's evidence, under King. -- Queen's delight (Bot.), an American plant (Stillinqia sylvatica) of the Spurge family, having an herbaceous stem and a perennial woody root. -- Queen's metal (Metal.), an alloy somewhat resembling pewter or britannia, and consisting essentially of tin with a slight admixture of antimony, bismuth, and lead or copper. -- Queen's pigeon. (Zoöl.) Same as Queen pigeon, above. -- Queen's ware, glazed English earthenware of a cream color. -- Queen's yellow (Old Chem.), a heavy yellow powder consisting of a basic mercuric sulphate; -- formerly called turpetum minerale, or Turbith's mineral.\n\nTo act the part of a queen. Shak.\n\nTo make a queen (or other piece, at the player's discretion) of by moving it to the eighth row; as, to queen a pawn.",
    "quicken":
        "1. To make alive; to vivify; to revive or resuscitate, as from death or an inanimate state; hence, to excite; to, stimulate; to incite. The mistress which I serve quickens what's dead. Shak. Like a fruitful garden without an hedge, that quickens the appetite to enjoy so tempting a prize. South. 2. To make lively, active, or sprightly; to impart additional energy to; to stimulate; to make quick or rapid; to hasten; to accelerate; as, to quicken one's steps or thoughts; to quicken one's departure or speed. 3. (Shipbuilding)  To shorten the radius of (a curve); to make (a curve) sharper; as, to quicken the sheer, that is, to make its curve more pronounced. Syn. -- To revive; resuscitate; animate; reinvigorate; vivify; refresh; stimulate; sharpen; incite; hasten; accelerate; expedite; dispatch; speed.\n\n1. To come to life; to become alive; to become vivified or enlivened; hence, to exhibit signs of life; to move, as the fetus in the womb. The heart is the first part that quickens, and the last that dies. Ray. And keener lightnings quicken in her eye. Pope. When the pale and bloodless east began To quicken to the sun. Tennyson. 2. To move with rapidity or activity; to become accelerated; as, his pulse quickened.",
    "quindecylic":
        "Pertaining to, or designating, an acid of the fatty acid series, containing fifteen atoms of carbon; called also pentadecylic acid.",
    "quartation":
        "The act, process, or result (in the process of parting) of alloying a button of nearly pure gold with enough silver to reduce the fineness so as to allow acids to attack and remove all metals except the gold; -- called also inquartation. Compare Parting.",
    "quenouille training":
        "A method of training trees or shrubs in the shape of a cone or distaff by tying down the branches and pruning.",
    "quinate":
        "Growing in sets of five; -- said especially of leaves composed of five leaflets set at the end of a common petiole.\n\nA salt of quinic acid. [Written also kinate.]",
    "quitrent":
        "A rent reserved in grants of land, by the payment of which the tenant is quit from other service. Blackstone. Note: In some of the United States a fee-farm rent is so termed. Burrill.",
    "queasily": "In a queasy manner.",
    "questioner":
        "One who asks questions; an inquirer. \"Little time for idle questioners.\" Tennyson.",
    "quinquelocular":
        "Having five cells or loculi; five-celled; as, a quinquelocular pericarp.",
    "quinquefoliated": "Having five leaves or leaflets. Gray.",
    "quiescent":
        "1. Being in a state of repose; at rest; still; not moving; as, a quiescent body or fluid. 2. Not ruffed with passion; unagitated; not in action; not excited; quiet; dormant; resting. In times of national security, the feeling of patriotism . . . is so quiescent that it seems hardly to exist. Prof. Wilson. 3. (Gram.)  Not sounded; silent; as, y is quiescent in \"day\" and \"say.\"\n\nA silent letter. M. Stuart.",
    "quadruplication":
        "The act of making fourfold; a taking four times the simple sum or amount.",
    "quitclaim":
        "A release or relinquishment of a claim; a deed of release; an instrument by which some right, title, interest, or claim, which one person has, or is supposed to have, in or to an estate held by himself or another, is released or relinquished, the grantor generally covenanting only against persons who claim under himself.\n\nTo release or relinquish a claim to; to release a claim to by deed, without covenants of warranty against adverse and paramount titles.",
    "quitter": "1. One who quits. 2. A deliverer. [Obs.] Ainsworth.",
    "quinhydrone":
        "A green crystalline substance formed by the union of quinone with hydroquinone, or as an intermediate product in the oxidation of hydroquinone or the reduction of quinone. [Written also chinhydrone.]",
    "quadrille":
        "1. A dance having five figures, in common time, four couples of dancers being in each set. 2. The appropriate music for a quadrille.\n\nA game played by four persons with forty cards, being the remainder of an ordinary pack after the tens, nines, and eights are discarded. Hoyle.",
    "quaschi": "The brown coati. See Coati.",
    "quarter-saw":
        "To saw (a log) into quarters; specif., to saw into quarters and then into boards, as by cutting alternately from each face of a quarter, to secure lumber that will warp relatively little or show the grain advantageously.",
    "quarry-man": "A man who is engaged in quarrying stones; a quarrier.",
    "quair":
        "A quire; a book. [Obs.] \" The king's quhair.\" James I. (of Scotland).",
    "quietism":
        "1. Peace or tranquillity of mind; calmness; indifference; apathy; dispassion; indisturbance; inaction. 2. (Eccl. Hist.)  The system of the Quietists, who maintained that religion consists in the withdrawal of the mind from worldly interests and anxieties and its constant employment in the passive contemplation of God and his attributes.",
    "quincewort": "The squinancy. Called also quinsywort.",
    "quish": "See Cuish.",
    "quindecemvir":
        "One of a sacerdotal college of fifteen men whose chief duty was to take care of the Sibylline books.",
    "quadriga": "A car or chariot drawn by four horses abreast.",
    "quietistic": "Of or pertaining to the Quietists, or to Quietism.",
    "quaigh":
        "A small shallow cup or drinking vessel. [Scot.] [Written also quegh.]",
    "quayage": "Wharfage. [Also keyage.]",
    "quandary":
        "A state of difficulty or perplexity; doubt; uncertainty.\n\nTo bring into a state of uncertainty, perplexity, or difficulty. [Obs.] Otway.",
    "quinizarin":
        "A yellow crystalline substance produced artificially. It is isomeric with alizarin.",
    "quininism": "See Cinchonism.",
    "quinquelobate":
        "Cut less than halfway into portions, usually somewhat rounded; five-lobed; as, a quinquelobate leaf or corolla.",
    "quicken tree":
        "The European rowan tree; -- called also quickbeam, and quickenbeam. See Rowan tree.",
    "quinqueangled": "Having five angles; quinquangular.",
    "quixotically": "In a quixotic way.",
    "qualified":
        "1. Fitted by accomplishments or endowments. 2. Modified; limited; as, a qualified statement. Qualified fee (Law), a base fee, or an estate which has a qualification annexed to it, the fee ceasing with the qualification, as a grant to A and his heirs, tenants of the manor of Dale. -- Qualified indorsement (Law), an indorsement which modifies the liability of the indorser that would result from the general principles of law, but does not affect the negotiability of the instrument. Story. -- Qualified negative (Legislation), a limited veto power, by which the chief executive in a constitutional government may refuse assent to bills passed by the legislative body, which bills therefore fail to become laws unless upon a reconsideration the legislature again passes them by a certain majority specified in the constitution, when they become laws without the approval of the executive. Qualified property (Law), that which depends on temporary possession, as that in wild animals reclaimed, or as in the case of a bailment. Syn. -- Competent; fit; adapted. -- Qualified, Competent. Competent is most commonly used with respect to native endowments and general ability suited to the performance of a task or duty; qualified with respect to specific acquirements and training.",
    "quandy": "The old squaw. [Local, U. S.]",
    "quadrate":
        "1. Having four equal sides, the opposite sides parallel, and four right angles; square. Figures, some round, some triangle, some quadrate. Foxe. 2. Produced by multiplying a number by itself; square. \" Quadrate and cubical numbers.\" Sir T. Browne. 3. Square; even; balanced; equal; exact. [Archaic] \" A quadrate, solid, wise man.\" Howell. 4. Squared; suited; correspondent. [Archaic] \" A generical description quadrate to both.\" Harvey. Quadrate bone (Anat.), a bone between the base of the lower jaw and the skull in most vertebrates below the mammals. In reptiles and birds it articulates the lower jaw with the skull; in mammals it is represented by the malleus or incus.\n\n1. (Geom.)  A plane surface with four equal sides and four right angles; a square; hence, figuratively, anything having the outline of a square. At which command, the powers militant That stood for heaven, in mighty quadrate joined. Milton. 2. (Astrol.)  An aspect of the heavenly bodies in which they are distant from each other 90º, or the quarter of a circle; quartile. See the Note under Aspect, 6. 3. (Anat.)  The quadrate bone.\n\nTo square; to agree; to suit; to correspond; -- followed by with. [Archaic] The objections of these speculatists of its forms do not quadrate with their theories. Burke.\n\nTo adjust (a gun) on its carriage; also, to train (a gun) for horizontal firing.",
    "quadrennial":
        "1. Comprising four years; as, a quadrennial period. 2. Occurring once in four years, or at the end of every four years; as, quadrennial games.",
    "quadripartite": "Divided into four parts.",
    "qui vive":
        "The challenge of a French sentinel, or patrol; -- used like the English challenge: \"Who comes there\" To be on the qui vive, to be on guard; to be watchful and alert, like a sentinel.",
    "quick":
        "1. Alive; living; animate; -- opposed to dead or inanimate. Not fully quyke, ne fully dead they were. Chaucer. The Lord Jesus Christ, who shall judge the quick and the dead at his appearing and his kingdom. 2 Tim. iv. 1. Man is no star, but a quick coal Of mortal fire. Herbert. Note: In this sense the word is nearly obsolete, except in some compounds, or in particular phrases. 2. Characterized by life or liveliness; animated; sprightly; agile; brisk; ready. \" A quick wit.\" Shak. 3. Speedy; hasty; swift; not slow; as, be quick Oft he her his charge of quick return Repeated. Milton. 4. Impatient; passionate; hasty; eager; eager; sharp; unceremonious; as, a quick temper. The bishop was somewhat quick with them, and signified that he was much offended. Latimer. 5. Fresh; bracing; sharp; keen. The air is quick there, And it pierces and sharpens the stomach. Shak. 6. Sensitive; perceptive in a high degree; ready; as, a quick ear. \"To have an open ear, a quick eye.\" Shak. They say that women are so quick. Tennyson. 7. Pregnant; with child. Shak. Quick grass. (Bot.) See Quitch grass. -- Quick match. See under Match. -- Quick vein (Mining), a vein of ore which is productive, not barren. -- Quick vinegar, vinegar made by allowing a weak solution of alcohol to trickle slowly over shavings or other porous material. -- Quick water, quicksilver water. -- Quick with child, pregnant with a living child. Syn. -- Speedy; expeditious; swift; rapid; hasty; prompt; ready; active; brisk; nimble; fleet; alert; agile; lively; sprightly.\n\nIn a quick manner; quickly; promptly; rapidly; with haste; speedily; without delay; as, run quick; get back quick. If we consider how very quick the actions of the mind are performed. Locke.\n\n1. That which is quick, or alive; a living animal or plant; especially, the hawthorn, or other plants used in making a living hedge. The works . . . are curiously hedged with quick. Evelyn. 2. The life; the mortal point; a vital part; a part susceptible of serious injury or keen feeling; the sensitive living flesh; the part of a finger or toe to which the nail is attached; the tender emotions; as, to cut a finger nail to the quick; to thrust a sword to the quick, to taunt one to the quick; -- used figuratively. This test nippeth, . . . this toucheth the quick. Latimer. How feebly and unlike themselves they reason when they come to the quick of the difference ! Fuller. 3. (Bot.)  Quitch grass. Tennyson.\n\nTo revive; to quicken; to be or become alive. [Obs.] Chaucer.",
    "quinquennial":
        "Occurring once in five years, or at the end of every five years; also, lasting five years. A quinquennial event.",
    "quadrilobate": "Having four lobes; as, a quadrilobate leaf.",
    "quellio": "A ruff for the neck. [Obs.] B. Jonson.",
    "quern":
        "A mill for grinding grain, the upper stone of which was turned by hand; -- used before the invention of windmills and watermills. Shak. They made him at the querne grind. Chaucer.",
    "quaere":
        "Inquire; question; see; -- used to signify doubt or to suggest investigation.",
    "quester": "One who seeks; a seeker. [Obs.]",
    "quinquefoliate": "Having five leaves or leaflets. Gray.",
    "quencher": "One who, or that which, quenches. Hammond.",
    "quoke": "imp. of Quake. Chaucer.",
    "quotient":
        "1. (Arith.)  The number resulting from the division of one number by another, and showing how often a less number is contained in a greater; thus, the quotient of twelve divided by four is three. 2. (Higher Alg.)  The result of any process inverse to multiplication. See the Note under Multiplication.",
    "quinquevalve": "Having five valves, as a pericarp.",
    "quotationist":
        "One who makes, or is given to making, quotations. The narrow intellectuals of quotationists. Milton.",
    "quartzose":
        "Containing, or resembling, quartz; partaking of the nature or qualities of quartz.",
    "quintilllion":
        "According to the French notation, which is used on the Continent and in America, the cube of a million, or a unit with eighteen ciphers annexed; according to the English notation, a number produced by involving a million to the fifth power, or a unit with thirty ciphers annexed. See the Note under Numeration.",
    "quittor":
        "A chronic abscess, or fistula of the coronet, in a horse's foot, resulting from inflammation of the tissues investing the coffin bone.",
    "quitch":
        "1. (Bot.)  Same as Quitch grass. 2. Figuratively: A vice; a taint; an evil. To pick the vicious quitch Of blood and custom wholly out of him. Tennyson .",
    "qualifiable": "Capable of being qualified; abatable; modifiable. Barrow.",
    "quite":
        "See Quit. [Obs.] Chaucer.\n\n1. Completely; wholly; entirely; totally; perfectly; as, the work is not quite done; the object is quite accomplished; to be quite mistaken. Man shall not quite be lost, but saved who will. Milton. The same actions may be aimed at different ends, and arise from quite contrary principles. Spectator. 2. To a great extent or degree; very; very much; considerably. \"Quite amusing.\" Macaulay. He really looks quite concerned. Landor. The island stretches along the land and is quite close to it. Jowett (Thucyd. ).",
    "quotable":
        "Capable or worthy of being quoted; as, a quotable writer; a quotable sentence. -- Quot`a*bit\"i*ty, n. Poe.",
    "quinoyl":
        "A radical of which quinone is the hydride, analogous to phenyl. [Written also kinoyl.]",
    "quartzoid":
        "A form of crystal common with quartz, consisting of two six- sided pyramids, base to base.",
    "quadricorn": "Any quadricornous animal.",
    "quadrumane": "One of the Quadrumana.",
    "quave": "See Quaver. [Obs.]\n\nTo quaver. [Obs. or Prov. Eng.]",
    "quet": "The common guillemot. [Prov. Eng.]",
    "quadrans":
        "1. (Rom. Antiq.)  A fourth part of the coin called an as. See 3d As, 2. 2. The fourth of a penny; a farthing. See Cur.",
    "quadratics": "That branch of algebra which treats of quadratic equations.",
    "quartzy": "Quartzose.",
    "quiddative":
        "Constituting, or containing, the essence of a thing; quidditative.",
    "quaverer": "One who quavers; a warbler.",
    "quadrin":
        "A small piece of money, in value about a farthing, or a half cent. [Obs.]",
    "quamash": "See Camass.",
    "queerness": "The quality or state of being queer.",
    "quadratojugal":
        "(a) Of or pertaining to the quadrate and jugal bones. (b) Of or pertaining to the quadratojugal bone. -- n.  The quadratojugal bone. Quadratojugal bone (Anat.), a bone at the base of the lower jaw in many animals.",
    "quoter": "One who quotes the words of another.",
    "quartziferous": "Consisting chiefly of quartz; containing quartz.",
    "quirinal":
        "Of, pertaining to, or designating, the hill Collis Quirinalis, now Monte Quirinale (one of the seven hills of Rome), or a modern royal place situated upon it. Also used substantively.",
    "quackish": "Like a quack; boasting; characterized by quackery. Burke.",
    "quadrible": "Quadrable. [R.]",
    "quassin":
        "The bitter principle of quassia, extracted as a white crystalline substance; -- formerly called quassite. [Written also quassiin, and quassine.]",
    "quercitannic":
        "Pertaining to, or designating, a tannic acid found in oak bark and extracted as a yellowish brown amorphous substance.",
    "queasy":
        "1. Sick at the stomach; affected with nausea; inclined to vomit; qualmish. 2. Fastidious; squeamish; delicate; easily disturbed; unsettled; ticklish. \" A queasy question.\" Shak. Some seek, when queasy conscience has its qualms. Cowper.",
    "quinone":
        "A crystalline substance, C6H4O2 (called also benzoketone), first obtained by the oxidation of quinic acid and regarded as a double ketone; also, by extension, any one of the series of which quinone proper is the type. [Written also chinone, kinone.]",
    "quinquangular": "Having five angles or corners.",
    "quadric":
        "Of or pertaining to the second degree.\n\n(a) (Alg.) A quantic of the second degree. See Quantic. (b) (Geom.) A surface whose equation in three variables is of the second degree. Spheres, spheroids, ellipsoids, paraboloids, hyperboloids, also cones and cylinders with circular bases, are quadrics.",
    "quoiffure": "See Coiffure.",
    "quidnunc":
        "One who is curious to know everything that passes; one who knows, or pretends to know, all that is going on. \"The idle stories of quidnuncs.\" Motley.",
    "quarterage": "A quarterly allowance.",
    "quinovic":
        "Pertaining to, or designating, a crystalline acid obtained from some varieties of cinchona bark. [Written also chinovic, and kinovic.]",
    "quinquepartite":
        "1. Consisting of five parts. 2. (Bot.)  Divided into five parts almost to the base.",
    "quadrangular":
        "Having four angles, and consequently four sides; tetragonal. -- Quad*ran\"gu*lar*ly, adv.",
    "quizzism": "The act or habit of quizzing.",
    "questionary":
        "Inquiring; asking questions; testing. \"Questionary epistles.\" Pope.\n\nOne who makes it his business to seek after relics and carry them about for sale.",
    "quasi":
        "As if; as though; as it were; in a manner sense or degree; having some resemblance to; qualified; -- used as an adjective, or a prefix with a noun or an adjective; as, a quasi contract, an implied contract, an obligation which has arisen from some act, as if from a contract; a quasi corporation, a body that has some, but not all, of the peculiar attributes of a corporation; a quasi argument, that which resembles, or is used as, an argument; quasi historical, apparently historical, seeming to be historical.",
    "quebracho":
