    "reflex":
        "1. Directed back; attended by reflection; retroactive; introspective. The reflex act of the soul, or the turning of the intellectual eye inward upon its own actions. Sir M. Hale. 2. Produced in reaction, in resistance, or in return. 3. (Physiol.)  Of, pertaining to, or produced by, stimulus or excitation without the necessary intervention of consciousness. Reflex action (Physiol.), any action performed involuntarily in consequence of an impulse or impression transmitted along afferent nerves to a nerve center, from which it is reflected to an efferent nerve, and so calls into action certain muscles, organs, or cells. -- Reflex nerve (Physiol.), an excito-motory nerve. See Exito- motory.\n\n1. Reflection; the light reflected from an illuminated surface to one in shade. Yon gray is not the morning's eye, 'Tis but the pale reflex of Cynthia's brow. Shak. On the depths of death there swims The reflex of a human face. Tennyson. 2. (Physiol.)  An involuntary movement produced by reflex action. Patellar reflex. See Knee jerk, under Knee.\n\n1. To reflect. [Obs.] Shak. 2. To bend back; to turn back. J. Gregory.",
    "representative":
        "1. Fitted to represent; exhibiting a similitude. 2. Bearing the character or power of another; acting for another or others; as, a council representative of the people. Swift. 3. Conducted by persons chosen to represent, or act as deputies for, the people; as, a representative government. 4. (Nat.Hist.) (a) Serving or fitted to present the full characters of the type of a group; typical; as, a representative genus in a family. (b) Similar in general appearance, structure, and habits, but living in different regions; -- said of certain species and varieties. 5. (Metaph.)  Giving, or existing as, a transcript of what was originally presentative knowledge; as, representative faculties; representative knowledge. See Presentative, 3 and Represent, 8.\n\n1. One who, or that which, represents (anything); that which exhibits a likeness or similitude. A statute of Rumor, whispering an idiot in the ear, who was the representative of Credulity. Addison. Difficulty must cumber this doctrine which supposes that the perfections of God are the representatives to us of whatever we perceive in the creatures. Locke. 2. An agent, deputy, or substitute, who supplies the place of another, or others, being invested with his or their authority. 3. (Law)  One who represents, or stands in the place of, another. Note: The executor or administrator is ordinarily held to be the representative of a deceased person, and is sometimes called the legal representative, or the personal representative. The heir is sometimes called the real representative of his deceased ancestor. The heirs and executors or administrators of a deceased person are sometimes compendiously described as his real and personal representatives. Wharton. Burrill. 4. A member of the lower or popular house in a State legislature, or in the national Congress. [U.S.] 5. (Nat.Hist.) (a) That which presents the full character of the type of a group. (b) A species or variety which, in any region, takes the place of a similar one in another region.",
    "russophilist":
