    "robust":
        "1. Evincing strength; indicating vigorous health; strong; sinewy; muscular; vigorous; sound; as, a robust body; robust youth; robust health. 2. Violent; rough; rude. While romp-loving miss Is hauled about in gallantry robust. Thomson. 3. Requiring strength or vigor; as, robust employment. Locke. Syn. -- Strong; lusty; sinewy; sturdy; muscular; hale; hearty; vigorous; forceful; sound. -- Robust, Strong. Robust means, literally, made of oak, and hence implies great compactness and toughness of muscle, connected with a thick-set frame and great powers of endurance. Strong denotes the power of exerting great physical force. The robust man can bear heat or cold, excess or privation, and toil on through every kind of hardship; the strong man can lift a great weight, can give a heavy blow, and a hard gripe. \"Robust, tough sinews bred to toil.\" Cowper. Then 'gan the villain wax so fierce and strong, That nothing may sustain his furious force. Spenser.",
