    "superintend":
        "To have or exercise the charge and oversight of; to oversee with the power of direction; to take care of with authority; to supervise; as, an officer superintends the building of a ship or the construction of a fort. The king may appoint a council, who may superintend the works of this nature. Bacon. Syn. -- Superintend, Supervise. These words in general use are the synonymous. As sometimes used, supervise implies the more general, and superintend, the more particular and constant, inspection or direction. Among architects there is a disposition to use the word supervise in the sense of a general oversight of the main points of construction with reference to the design, etc., and to employ the word superintend to signify a constant, careful attention to all the details of construction. But this technical distinction is not firmly established.",
    "synonymicon": "A dictionary of synonyms. C. J. Smith.",
    "sprinkle":
        "1. To scatter in small drops or particles, as water, seed, etc. 2. To scatter on; to disperse something over in small drops or particles; to besprinkle; as, to sprinkle the earth with water; to sprinkle a floor with sand. 3. To baptize by the application of a few drops, or a small quantity, of water; hence, to cleanse; to purify. Having our hearts sprinkled from an evil conscience. Heb. x. 22.\n\n1. To scatter a liquid, or any fine substance, so that it may fall in particles. And the priest shall . . . sprinkle of the oil with his finger seven times before the Lord. Lev. xiv. 16. 2. To rain moderately, or with scattered drops falling now and then; as, it sprinkles. 3. To fly or be scattered in small drops or particles.\n\n1. A small quantity scattered, or sparsely distributed; a sprinkling. 2. A utensil for sprinkling; a sprinkler. [Obs.]",
