        "a. & p. p. from Throw, v. Thrown silk, silk thread consisting of two or more singles twisted together like a rope, in a direction contrary to that in which the singles of which it is composed are twisted. M'Culloch. -- Thrown singles, silk thread or cord made by three processes of twisting, first into singles, two or more of which are twisted together making dumb singles, and several of these twisted together to make thrown singles.",
