        "Telling tales; babbling. \"The telltale heart.\" Poe.\n\n1. One who officiously communicates information of the private concerns of others; one who tells that which prudence should suppress. 2. (Mus.)  A movable piece of ivory, lead, or other material, connected with the bellows of an organ, that gives notice, by its position, when the wind is exhausted. 3. (Naut.) (a) A mechanical attachment to the steering wheel, which, in the absence of a tiller, shows the position of the helm. (b) A compass in the cabin of a vessel, usually placed where the captain can see it at all hours, and thus inform himself of the vessel's course. 4. (Mach.)  A machine or contrivance for indicating or recording something, particularly for keeping a check upon employees, as factory hands, watchmen, drivers, check takers, and the like, by revealing to their employers what they have done or omitted. 5. (Zoöl.)  The tattler. See Tattler.",
    "ticement": "Enticement. [Obs.]",
    "tonnage":
        "1. The weight of goods carried in a boat or a ship. 2. The cubical content or burden of a vessel, or vessels, in tons; or, the amount of weight which one or several vessels may carry. See Ton, n. (b). A fleet . . . with an aggregate tonnage of 60,000 seemed sufficient to conquer the world. Motley. 3. A duty or impost on vessels, estimated per ton, or, a duty, toll, or rate payable on goods per ton transported on canals . 4. The whole amount of shipping estimated by tons; as, the tonnage of the United States. See Ton. Note: There are in common use the following terms relating to tonnage: (a) Displacement. (b) Register tonnage, gross and net. (c) Freight tonnage. (d) Builders' measurement. (e) Yacht measurement. The first is mainly used for war vessels, where the total weight is likely to be nearly constant. The second is the most important, being that used for commercial purposes. The third and fourth are different rules for ascertaining the actual burden-carrying power of a vessel, and the fifth is for the proper classification of pleasure craft. Gross tonnage expresses the total cubical interior of a vessel; net tonnage, the cubical space actually available for freight-carrying purposes. Rules for ascertaining these measurements are established by law.",
    "troglodyte":
        "1. (Ethnol.)  One of any savage race that dwells in caves, instead of constructing dwellings; a cave dweller. Most of the primitive races of man were troglodytes. In the troglodytes' country there is a lake, for the hurtful water it beareth called the \"mad lake.\" Holland. 2. (Zoöl.)  An anthropoid ape, as the chimpanzee. 3. (Zoöl.)  The wren.",
    "trochilic":
        "OF or pertaining to rotary motion; having power to draw out or turn round. \"By art trochilic.\" Camden.",
    "tulip-eared":
        "Having erect, pointed ears; prick-eared; -- said of certain dogs.",
    "thievish":
        "1. Given to stealing; addicted to theft; as, a thievish boy, a thievish magpie. 2. Like a thief; acting by stealth; sly; secret. Time's thievish progress to eternity. Shak. 3. Partaking of the nature of theft; accomplished by stealing; dishonest; as, a thievish practice. Or with a base and biosterous sword enforce A thievish living on the common road. Shak. -- Thiev\"ish*ly, adv. -- Thiev\"ish*ness, n.",
    "trimurti":
        "The triad, or trinity, of Hindoo gods, consisting of Brahma, the Creator, Vishnu, the Preserver, and Siva, the Destroyer. [Spelled also Trimurtti.]",
    "tariff":
        "1. A schedule, system, or scheme of duties imposed by the government of a country upon goods imported or exported; as, a revenue tariff; a protective tariff; Clay's compromise tariff. (U.S. 1833). Note: The United States and Great Britain impose no duties on exports; hence, in these countries the tariff refers only to imports. 2. The duty, or rate of duty, so imposed; as, the tariff on wool; a tariff of two cents a pound. 3. Any schedule or system of rates, changes, etc.; as, a tariff of fees, or of railroad fares. Bolingbroke.\n\nTo make a list of duties on, as goods.",
    "tivy": "With great speed; -- a huntsman's word or sound. Dryden.",
    "thyroideal": "Thyroid.",
    "triglyph":
        "An ornament in the frieze of the Doric order, repeated at equal intervals. Each triglyph consists of a rectangular tablet, slightly projecting, and divided nearly to the top by two parallel and perpendicular gutters, or channels, called glyphs, into three parts, or spaces, called femora. A half channel, or glyph, is also cut upon each of the perpendicular edges of the tablet. See Illust. of Entablature.",
    "tango":
        "(a) A difficult dance in two-four time characterized by graceful posturing, frequent pointing positions, and a great variety of steps, including the cross step and turning steps. The dance is of Spanish origin, and is believed to have been in its original form a part of the fandango. (b) Any of various popular forms derived from this.",
    "tinge":
        "To imbue or impregnate with something different or foreign; as, to tinge a decoction with a bitter taste; to affect in some degree with the qualities of another substance, either by mixture, or by application to the surface; especially, to color slightly; to stain; as, to tinge a blue color with red; an infusion tinged with a yellow color by saffron. His [Sir Roger's] virtues, as well as imperfections, are tinged by a certain extravagance. Addison. Syn. -- To color; dye; stain.\n\nA degree, usually a slight degree, of some color, taste, or something foreign, infused into another substance or mixture, or added to it; tincture; color; dye; hue; shade; taste. His notions, too, respecting the government of the state, took a tinge from his notions respecting the government of the church. Macaulay.",
    "tautoousian":
        "Having the same essence; being identically of the same nature. [R.] Cudworth.",
    "toned":
        "Having (such) a tone; -- chiefly used in composition; as, high- toned; sweet-toned. Toned paper, paper having a slight tint, in distinction from paper which is quite white.",
    "ton mile":
        "A unit of measurement of the freight transportation performed by a railroad during a given period, usually a year, the total of which consists of the sum of the products obtained by multiplying the aggregate weight of each shipment in tons during the given period by the number of miles for which it is carried.",
    "tonsorial": "Of or pertaining to a barber, or shaving.",
    "tsarina": "The title of the empress of Russia. See Czarina.",
    "typification": "The act of typifying, or representing by a figure.",
    "teend": "To kindle; to burn. [Obs.] Herrick.",
    "thible":
        "A slice; a skimmer; a spatula; a pudding stick. [Obs. or Prov. Eng.] Ainsworth.",
    "trimly": "In a trim manner; nicely.",
    "torques":
        "A cervical ring of hair or feathers, distinguished by its color or structure; a collar.",
    "tapiser": "A maker of tapestry; an upholsterer. [R.] Chaucer.",
    "tamworth":
        "One of a long-established English breed of large pigs. They are red, often spotted with black, with a long snout and erect or forwardly pointed ears, and are valued as bacon producers.",
    "teetee":
        "1. (Zoöl.)  Any one of several species of small, soft-furred South American monkeys belonging to Callithrix, Chrysothrix, and allied genera; as, the collared teetee (Callithrix torquatus), and the squirrel teetee (Chrysothrix sciurea). Called also pinche, titi, and saimiri. See Squirrel monkey, under Squirrel. 2. (Zoöl.)  A diving petrel of Australia (Halodroma wrinatrix).",
    "trommel":
        "A revolving buddle or sieve for separating, or sizing, ores. Raymond.",
    "tolane":
        "A hydrocarbon, C14H10, related both to the acetylene and the aromatic series, and produced artificially as a white crystalline substance; -- called also diphenyl acetylene.",
    "torcher":
        "One who gives light with a torch, or as if with a torch. [Obs.] Shak.",
    "turn-buckle":
        "(a) A loop or sleeve with a screw thread at one end and a swivel at the other, -- used for tightening a rod, stay, etc. (b) A gravitating catch, as for fastening a shutter, the end of a chain, or a hasp. TURNBULL'S BLUE Turn\"bull's blue`. (Chem.)  The double cyanide of ferrous and ferric iron, a dark blue amorphous substance having a coppery luster, used in dyeing, calico printing, etc. Cf. Prussian blue, under Prussian.",
    "tetradactylous":
        "Having, or characterized by, four digits to the foot or hand.",
    "thlipsis":
        "Compression, especially constriction of vessels by an external cause.",
    "track-road": "A towing path.",
    "tetrastich":
        "A stanza, epigram, or poem, consisting of four verses or lines. Pope.",
    "technicalness": "The quality or state of being technical; technicality.",
    "tabifical": "Producing tabes; wasting; tabefying.",
    "thistle":
        "Any one of several prickly composite plants, especially those of the genera Cnicus, Craduus, and Onopordon. The name is often also applied to other prickly plants. Blessed thistle, Carduus benedictus, so named because it was formerly considered an antidote to the bite of venomous creatures. -- Bull thistle, Cnicus lanceolatus, the common large thistle of neglected pastures. -- Canada thistle, Cnicus arvensis, a native of Europe, but introduced into the United States from Canada. -- Cotton thistle, Onopordon Acanthium. -- Fuller's thistle, the teasel. -- Globe thistle, Melon thistle, etc. See under Globe, Melon, etc. -- Pine thistle, Atractylis gummifera, a native of the Mediterranean region. A vicid gum resin flows from the involucre. -- Scotch thistle, either the cotton thistle, or the musk thistle, or the spear thistle; -- all used national emblems of Scotland. -- Sow thistle, Sonchus oleraceus. -- Spear thistle. Same as Bull thistle. -- Star thistle, a species of Centaurea. See Centaurea. -- Torch thistle, a candelabra-shaped plant of the genus Cereus. See Cereus. -- Yellow thistle, Cincus horridulus. Thistle bird (Zoöl.), the American goldfinch, or yellow-bird (Spinus tristis); -- so called on account of its feeding on the seeds of thistles. See Illust. under Goldfinch. -- Thistle butterfly (Zoöl.), a handsomely colored American butterfly (Vanessa cardui) whose larva feeds upon thistles; -- called also painted lady. -- Thistle cock (Zoöl.), the corn bunting (Emberiza militaria). [Prov. Eng.] -- Thistle crown, a gold coin of England of the reign of James I., worth four shillings. -- Thistle finch (Zoöl.), the goldfinch; -- so called from its fondness for thistle seeds. [Prov. Eng.] -- Thistle funnel, a funnel having a bulging body and flaring mouth.",
    "transitionary": "Transitional.",
    "transposal":
        "The act of transposing, or the state of being transposed; transposition.",
    "tatterdemalion":
        "A ragged fellow; a ragamuffin. L'Estrange. TATTERSALL'S Tat\"ter*sall's, n.  A famous horse market in London, established in 1766 by Richard Tattersall, also used as the headquarters of credit betting on English horse races; hence, a large horse market elsewhere.",
    "tautochronous":
        "Occupying the same time; pertaining to, or having the properties of, a tautochrone.",
    "teaberry": "The checkerberry.",
    "tetra":
        "1. A combining form or prefix signifying four, as in tetrabasic, tetrapetalous. 2. (Chem.)  A combining form (also used adjectively) denoting four proportional or combining parts of the substance or ingredient denoted by the term to which it is prefixed, as in tetra-chloride, tetroxide.",
    "teeth": "pl. of Tooth.\n\nTo breed, or grow, teeth.",
    "to-do": "Bustle; stir; commotion; ado. [Colloq.]",
    "transportability": "The quality or state of being transportable.",
    "trimethyl":
        "(Chem.) A prefix or combining form (also used adjectively) indicating the presence of three methyl groups.",
    "tumultuate":
        "To make a tumult. [Obs.] \"He will murmur and tumultuate.\" South.",
    "terrene":
        "A tureen. [Obs.] Walpole.\n\n1. Of or pertaining to the earth; earthy; as, terrene substance. Holland. 2. Earthy; terrestrial. God set before him a mortal and immortal life, a nature celestial and terrene. Sir W. Raleigh. Be true and faithful to the king and his heirs, and truth and faith to bear of life and limb, and terrene honor. O. Eng. Oath of Allegiance, quoted by Blackstone. Common conceptions of the matters which lie at the basis of our terrene experience. Hickok.\n\n1. The earth's surface; the earth. [Poetic] Tenfold the length of this terrene. Milton. 2. (Surv.)  The surface of the ground.",
    "ter-tenant": "See Terre-tenant.",
    "thereat":
        "1. At that place; there. Wide is the gate, and broad is the way, that leadeth to destruction, and many there be which go in thereat. Matt. vii. 13. 2. At that occurrence or event; on that account. Every error is a stain to the beauty of nature; for which cause it blusheth thereat. Hooker.",
    "ticklish":
        "1. Sensible to slight touches; easily tickled; as, the sole of the foot is very ticklish; the hardened palm of the hand is not ticklish. Bacon. 2. Standing so as to be liable to totter and fall at the slightest touch; unfixed; easily affected; unstable. Can any man with comfort lodge in a condition so dismally ticklish Barrow. 3. Difficult; nice; critical; as, a ticklish business. Surely princes had need, in tender matters and ticklish times, to beware what they say. Bacon. -- Tic\"klish*ly, adv. -- Tic\"klish*ness, n.",
    "tymbal":
        "A kind of kettledrum. [Written also trimbal.] A tymbal's sound were better than my voice. Prior.",
    "treadfowl": "A cock. [Obs.] Chaucer.",
    "triangulation":
        "The series or network of triangles into which the face of a country, or any portion of it, is divided in a trigonometrical survey; the operation of measuring the elements necessary to determine the triangles into which the country to be surveyed is supposed to be divided, and thus to fix the positions and distances of the several points connected by them.",
    "tolypeutine": "The apar.",
    "theorically": "In a theoretic manner. [Obs.]",
    "traumatism":
        "A wound or injury directly produced by causes external to the body; also, violence producing a wound or injury; as, rupture of the stomach caused by traumatism.",
    "tights":
        "Close-fitting garments, especially for the lower part of the body and the legs.",
    "tiebeam":
        "A beam acting as a tie, as at the bottom of a pair of principal rafters, to prevent them from thrusting out the wall. See Illust. of Timbers, under Roof. Gwilt.",
    "tough-head": "The ruddy duck. [ Local U.S. ]",
    "transcur": "To run or rove to and fro. [Obs.] Bacon.",
    "travertine":
        "A white concretionary form of calcium carbonate, usually hard and semicrystalline. It is deposited from the water of springs or streams holding lime in solution. Extensive deposits exist at Tivoli, near Rome.",
    "tolerable":
        "1. Capable of being borne or endured; supportable, either physically or mentally. As may affect tionearth with cold and heat Scarce tolerable. Milton. 2. Moderately good or agreeable; not contemptible; not very excellent or pleasing, but such as can be borne or received without disgust, resentment, or opposition; passable; as, a tolerable administration; a tolerable entertainment; a tolerable translation. Dryden. -- Tol\"er*a*ble*ness, n. -- Tol\"er*a*bly, adv.",
    "towardness": "Quality or state of being toward.",
    "trething": "A tax; an impost. [Obs.] Johnson.",
    "tankling": "A tinkling. [Obs.]",
    "trusting":
        "Having or exercising trust; confiding; unsuspecting; trustful. -- Trust\"ing*ly, adv.",
    "tell":
        "1. To mention one by one, or piece by piece; to recount; to enumerate; to reckon; to number; to count; as, to tell money. \"An heap of coin he told.\" Spenser. He telleth the number of the stars. Ps. cxlvii. 4. Tell the joints of the body. Jer. Taylor. 2. To utter or recite in detail; to give an account of; to narrate. Of which I shall tell all the array. Chaucer. And not a man appears to tell their fate. Pope. 3. To make known; to publish; to disclose; to divulge. Why didst thou not tell me that she was thy wife Gen. xii. 18. 4. To give instruction to; to make report to; to acquaint; to teach; to inform. A secret pilgrimage, That you to-day promised to tell me of Shak. 5. To order; to request; to command. He told her not to be frightened. Dickens. 6. To discern so as to report; to ascertain by observing; to find out; to discover; as, I can not tell where one color ends and the other begins. 7. To make account of; to regard; to reckon; to value; to estimate. [Obs.] I ne told no dainity of her love. Chaucer. Note: Tell, though equivalent in some respect to speak and say, has not always the same application. We say, to tell truth or falsehood, to tell a number, to tell the reasons, to tell something or nothing; but we never say, to tell a speech, discourse, or oration, or to tell an argument or a lesson. It is much used in commands; as, tell me the whole story; tell me all you know. To tell off, to count; to divide. Sir W. Scott. Syn. -- To communicate; impart; reveal; disclose; inform; acquaint; report; repeat; rehearse; recite.\n\n1. To give an account; to make report. That I may publish with the voice of thankgiving, and tell of all thy wondrous works. Ps. xxvi. 7. 2. To take effect; to produce a marked effect; as, every shot tells; every expression tells. To tell of. (a) To speak of; to mention; to narrate or describe. (b) To inform against; to disclose some fault of. -- To tell on, to inform against. [Archaic & Colloq.] Lest they should tell on us, saying, So did David. 1 Sam. xxvii. 11.\n\nThat which is told; tale; account. [R.] I am at the end of my tell. Walpole.\n\nA hill or mound. W. M. Thomson.",
    "tunicate":
        "1. (Bot.)  Covered with a tunic; covered or coated with layers; as, a tunicated bulb. 2. (Zoöl.) (a) Having a tunic, or mantle; of or pertaining to the Tunicata. (b) Having each joint buried in the preceding funnel-shaped one, as in certain antennæ of insects.\n\nOne of the Tunicata.",
    "thrombus":
        "(a) A clot of blood formed of a passage of a vessel and remaining at the site of coagulation. (b) A tumor produced by the escape of blood into the subcutaneous cellular tissue.",
    "therapy": "Therapeutics.",
    "teaming":
        "1. The act or occupation of driving a team, or of hauling or carrying, as logs, goods, or the like, with a team. 2. (Manuf.)  Contract work. [R.] Knight.",
    "telic":
        "Denoting the final end or purpose, as distinguished from ecbatic. See Ecbatic. Gibbs.",
    "threatful":
        "Full of threats; having a menacing appearance. Spenser. -- Threat\"ful*ly, adv.",
    "transmittal": "Transmission. Swift.",
    "triarticulate": "Having three joints.",
    "tamarack":
        "(a) The American larch; also, the larch of Oregon and British Columbia (Larix occidentalis). See Hackmatack, and Larch. (b) The black pine (Pinus Murrayana) of Alaska, California, etc. It is a small tree with fine-grained wood.",
    "treen":
        "1. Made of wood; wooden. [Obs.] \" Treen cups.\" Camden. 2. Relating to, or drawn from, trees. [Obs.] Spenser. Treen liquors, especially that of the date. Evelyn.\n\npl. of Tree. \" The shady treen.\" Fairfax.",
    "triple-headed":
        "Having three heads; three-headed; as, the triple-headed dog Cerberus.",
    "tellurous":
        "Of or pertaining to tellurium; derived from, or containing, tellurium; specifically, designating those compounds in which the element has a lower valence as contrasted with telluric compounds; as, tellurous acid, which is analogous to sulphurous acid.",
    "taxgatherer":
        "One who collects taxes or revenues. -- Tax\"gath`er*ing, n.",
    "tossel": "See Tassel.",
    "tenesmus":
        "An urgent and distressing sensation, as if a discharge from the intestines must take place, although none can be effected; -- always referred to the lower extremity of the rectum. Vesical tenesmus, a similar sensation as to the evacuation of urine, referred to the region of the bladder.",
    "titter":
        "To laugh with the tongue striking against the root of the upper teeth; to laugh with restraint, or without much noise; to giggle. A group of tittering pages ran before. Longfellow.\n\nA restrained laugh. \"There was a titter of . . . delight on his countenance.\" Coleridge.\n\nTo seesaw. See Teeter.",
    "tangence": "Tangency. [R.]",
    "torrent":
        "1. A violent stream, as of water, lava, or the like; a stream suddenly raised and running rapidly, as down a precipice. The roaring torrent is deep and wide. Longfellow. 2. Fig.: A violent or rapid flow; a strong current; a flood; as, a torrent of vices; a torrent of eloquence. At length, Erasmus, that great injured name, . . . Stemmed the wild torrent of a barbarous age. Pope.\n\nRolling or rushing in a rapid stream. \"Waves of torrent fire.\" Milton.",
    "tile-drain": "To drain by means of tiles; to furnish with a tile drain.",
    "thematic":
        "1. (Gram.)  Of or pertaining to the theme of a word. See Theme, n., 4. 2. (Mus.)  Of or pertaining to a theme, or subject. Thematic catalogue (Mus.), a catalogue of musical works which, besides the title and other particulars, gives in notes the theme, or first few measures, of the whole work or of its several movements.",
    "trioecious":
        "Having three sorts of flowers on the same or on different plants, some of the flowers being staminate, others pistillate, and others both staminate and pistillate; belonging to the order Trioecia.",
    "tremulant":
        "Tremulous; trembling; shaking. [R.] \" With tremulent white rod.\" Carlyle.",
    "tweag":
        "To tweak. [Obs.]\n\nA pinching condition; perplexity; trouble; distress. [Obs. or Prov. Eng.] This put the old fellow in a rare tweague. Arbuthnot.",
    "tailoring": "The business or the work of a tailor or a tailoress.",
    "touter":
        "One who seeks customers, as for an inn, a public conveyance, shops, and the like: hence, an obtrusive candidate for office. [Colloq.] The prey of ring droppers, . . . duffers, touters, or any of those bloodless sharpers who are, perhaps, better known to the police. Dickens.",
    "thorium":
        "A metallic element found in certain rare minerals, as thorite, pyrochlore, monazite, etc., and isolated as an infusible gray metallic powder which burns in the air and forms thoria; -- formerly called also thorinum. Symbol Th. Atomic weight 232.0.",
    "three-handed":
        "Said of games or contests where three persons play against each other, or two against one; as, a three-handed game of cards.",
    "trigraph":
        "Three letters united in pronunciation so as to have but one sound, or to form but one syllable, as -ieu in adieu; a triphthong.",
    "tetric":
        "Forward; perverse; harsh; sour; rugged. [Obs.] -- Tet\"ric*al*ness, n.",
    "trihedral":
        "Having three sides or faces; thus, a trihedral angle is a solid angle bounded by three plane angles. [Written also triedral.]",
    "theologer": "A theologian. Cudworth.",
    "talewise": "In a way of a tale or story.",
    "terreen": "See Turren.",
    "tripudiation": "The act of dancing. [R.] Bacon. Carlyle.",
    "typist": "A person who operates a typewriting machine; a typewriter.",
    "thedom":
        "Success; fortune; luck; chance. [Obs.] Evil thedom on his monk's snout. Chaucer.",
    "the gapes":
        "(a) A fit of yawning. (b) A disease of young poultry and other birds, attended with much gaping. It is caused by a parasitic nematode worm (Syngamus trachealis), in the windpipe, which obstructs the breathing. See Gapeworm.",
    "teleorganic": "Vital; as, teleorganic functions.",
    "taleteller":
        "One who tells tales or stories, especially in a mischievous or officious manner; a talebearer; a telltale; a tattler.",
    "tigella":
        "That part of an embryo which represents the young stem; the caulicle or radicle.",
    "tractory": "A tractrix.",
    "tranquilization":
        "The act of tranquilizing, or the state of being tranquilized.",
    "thomite": "A Thomæan.",
    "tamarisk":
        "Any shrub or tree of the genus Tamarix, the species of which are European and Asiatic. They have minute scalelike leaves, and small flowers in spikes. An Arabian species (T. mannifera) is the source of one kind of manna. Tamarisk salt tree, an East Indian tree (Tamarix orientalis) which produces an incrustation of salt.",
    "thryfallow":
        "To plow for the third time in summer; to trifallow. [R.] [Written also thrifallow.] Tusser.",
    "tickle-footed": "Uncertain; inconstant; slippery. [Obs. & R.] Beau. & Fl.",
    "tetrapneumona":
        "A division of Arachnida including those spiders which have four lungs, or pulmonary sacs. It includes the bird spiders (Mygale) and the trapdoor spiders. See Mygale.",
    "theocrat":
        "One who lives under a theocratic form of government; one who in civil affairs conforms to divine law.",
    "tuba": "(a) An ancient trumpet. (b) A sax-tuba. See Sax-tuba.",
    "titillation":
        "1. The act of tickling, or the state of being tickled; a tickling sensation. A. Tucker. 2. Any pleasurable sensation. Those titillations that reach no higher than the senses. Glanvill.",
    "torchwort":
        "The common mullein, the stalks of which, dipped in suet, anciently served for torches. Called also torch, and hig-taper.",
    "timorsome":
        "Easily frightened; timorous. [Written also timersome.] [Scot.] Sir W. Scott.",
    "tumid":
        "1. Swelled, enlarged, or distended; as, a tumid leg; tumid flesh. 2. Rising above the level; protuberant. So high as heaved the tumid hills. Milton. 3. Swelling in sound or sense; pompous; puffy; inflated; bombastic; falsely sublime; turgid; as, a tumid expression; a tumid style. -- Tu\"mid*ly, adv. -- Tu\"mid*ness, n.",
    "tupman": "A man who breeds, or deals in tups. [Prov. Eng.]",
    "thirl":
        "To bore; to drill or thrill. See Thrill. [Obs. or Prov.] That with a spear was thirled his breast bone. Chaucer.",
    "tenancy":
        "(a) A holding, or a mode of holding, an estate; tenure; the temporary possession of what belongs to another. (b) (O. Eng. Law) A house for habitation, or place to live in, held of another. Blount. Blackstone. Wharton.",
    "ton":
        "pl. of Toe. Chaucer.\n\nThe common tunny, or house mackerel.\n\nThe prevailing fashion or mode; vogue; as, things of ton. Byron. If our people of ton are selfish, at any rate they show they are selfish. Thackeray. Bon ton. See in the Vocabulary.\n\nA measure of weight or quantity. Specifically: -- (a) The weight of twenty hundredweight. Note: In England, the ton is 2,240 pounds. In the United States the ton is commonly estimated at 2,000 pounds, this being sometimes called the short ton, while that of 2,240 pounds is called the long ton. (b) (Naut. & Com.) Forty cubic feet of space, being the unit of measurement of the burden, or carrying capacity, of a vessel; as a vessel of 300 tons burden. See the Note under Tonnage. (c) (Naut. & Com.) A certain weight or quantity of merchandise, with reference to transportation as freight; as, six hundred weight of ship bread in casks, seven hundred weight in bags, eight hundred weight in bulk; ten bushels of potatoes; eight sacks, or ten barrels, of flour; forty cubic feet of rough, or fifty cubic feet of hewn, timber, etc. Note: Ton and tun have the same etymology, and were formerly used interchangeably; but now ton generally designates the weight, and tun the cask. See Tun.",
    "trimesitic":
        "Of, pertaining to, or designating, a tribasic acid, C6H3.(CO2)3, of the aromatic series, obtained, by the oxidation of mesitylene, as a white crystalline substance. [Written also trimesic.]",
    "tersanctus":
        "An ancient ascription of praise (containing the word \"Holy\" -- in its Latin form, \"Sanctus\" -- thrice repeated), used in the Mass of the Roman Catholic Church and before the prayer of consecration in the communion service of the Church of England and the Protestant Episcopal Church. Cf. Trisagion.",
    "thermoelectric":
        "Pertaining to thermoelectricity; as, thermoelectric currents.",
    "trance":
        "1. A tedious journey. [Prov. Eng.] Halliwell. 2. A state in which the soul seems to have passed out of the body into another state of being, or to be rapt into visions; an ecstasy. And he became very hungry, and would have eaten; but while they made ready, he fell into a trance. Acts. x. 10. My soul was ravished quite as in a trance. Spenser. 3. (Med.)  A condition, often simulating death, in which there is a total suspension of the power of voluntary movement, with abolition of all evidences of mental activity and the reduction to a minimum of all the vital functions so that the patient lies still and apparently unconscious of surrounding objects, while the pulsation of the heart and the breathing, although still present, are almost or altogether imperceptible. He fell down in a trance. Chaucer.\n\n1. To entrance. And three I left him tranced. Shak. 2. To pass over or across; to traverse. [Poetic] Trance the world over. Beau. & Fl. When thickest dark did trance the sky. Tennyson.\n\nTo pass; to travel. [Obs.]",
    "technically":
        "In a technical manner; according to the signification of terms as used in any art, business, or profession.",
    "trigonodont": "See Trituberculy.",
    "thirlage":
