    "vitis": "A genus of plants including all true grapevines.",
    "vengeancely":
        "Extremely; excessively. [Obs.] \"He loves that vengeancely.\" Beau. & Fl.",
    "vaginitis":
        "Inflammation of the vagina, or the genital canal, usually of its mucous living membrane.",
    "velleity":
        "The lowest degree of desire; imperfect or incomplete volition. Locke.",
    "viscount":
        "1. (O. Eng. Law)  An officer who formerly supplied the place of the count, or earl; the sheriff of the county. 2. A nobleman of the fourth rank, next in order below an earl and next above a baron; also, his degree or title of nobility. See Peer, n., 3. [Eng.] Chaucer.",
    "venturer":
        "1. One who ventures, or puts to hazard; an adventurer. Beau. & Fl. 2. A strumpet; a prostitute. [R.] J. Webster (1607).",
    "vulturish": "Vulturous.",
    "visualizer":
        "One who visualizes or is proficient in visualization; esp. (Physiol.),  one whose mental imagery is prevailingly visualization.",
    "vegeto-animal":
        "Partaking of the nature both of vegetable and animal matter; -- a term sometimes applied to vegetable albumen and gluten, from their resemblance to similar animal products.",
    "varier":
        "A wanderer; one who strays in search of variety. [Poetic] Pious variers from the church. Tennyson.",
    "visit":
        "1. To go or come to see, as for the purpose of friendship, business, curiosity, etc.; to attend; to call upon; as, the physician visits his patient. 2. Specifically: To go or come to see for inspection, examination, correction of abuses, etc.; to examine, to inspect; as, a bishop visits his diocese; a superintendent visits persons or works under his charge. 3. (Script.)  To come to for the purpose of chastising, rewarding, comforting; to come upon with reward or retribution; to appear before or judge; as, to visit in mercy; to visit one in wrath. [God] hath visited and redeemed his people. Like i. 68.\n\nTo make a visit or visits; to maintain visiting relations; to practice calling on others.\n\n1. The act of visiting, or going to see a person or thing; a brief stay of business, friendship, ceremony, curiosity, or the like, usually longer than a call; as, a visit of civility or respect; a visit to Saratoga; the visit of a physician. 2. The act of going to view or inspect; an official or formal inspection; examination; visitation; as, the visit of a trustee or inspector. Right of visit (Internat. Law), the right of visitation. See Visitation, 4.",
    "validation": "The act of giving validity. [R.] Knowles.",
    "vinegary": "Having the nature of vinegar; sour; unamiable.",
    "verdurous":
        "Covered with verdure; clothed with the fresh green of vegetation; verdured; verdant; as, verdurous pastures. Milton.",
    "vermil": "See Vermeil. [Obs.] Spenser.",
    "valkyria":
        "One of the maidens of Odin, represented as awful and beautiful, who presided over battle and marked out those who were to be slain, and who also ministered at the feasts of heroes in Valhalla. [Written also Valkyr, and Walkyr.]",
    "vainglorious":
        "Feeling or indicating vainglory; elated by vanity; boastful. \"Arrogant and vainglorious expression.\" Sir M. Hale. -- Vain`glo\"ri*ous*ly, adv. -- Vain`glo\"ri*ous*ness, n.",
    "vark": "The bush hog, or boshvark.",
    "verruculose": "Minutely verrucose; as, a verruculose leaf or stalk.",
    "victorium":
        "A probable chemical element discovered by Sir William Crookes in 1898. Its nitrate is obtained byy practical decomposition and crystallization of yttrium nitrate. At. wt., about 117.",
    "verecundious":
        "Verecund. [Obs.] \"Verecundious generosity.\" Sir H. Wotton.",
    "vertebra":
        "1. (Anat.)  One of the serial segments of the spinal column. Note: In many fishes the vertebræ are simple cartilaginous disks or short cylinders, but in the higher vertebrates they are composed of many parts, and the vertebræ in different portions of the same column vary very greatly. A well-developed vertebra usually consists of a more or less cylindrical and solid body, or centrum, which is surmounted dorsally by an arch, leaving an opening which forms a part of the canal containing the spinal cord. From this dorsal, or neural, arch spring various processes, or apophyses, which have received special names: a dorsal, or neural, spine, spinous process, or neurapophysis, on the middle of the arch; two anterior and two posterior articular processes, or zygapophyses; and one or two transverse processes on each side. In those vertebræ which bear well- developed ribs, a tubercle near the end of the rib articulates at a tubercular facet on the transverse process (diapophysis), while the end, or head, of the rib articulates at a more ventral capitular facet which is sometimes developed into a second, or ventral, transverse process (parapophysis). In vertebrates with well-developed hind limbs, the spinal column is divided into five regions in each of which the vertebræ are specially designated: those vertebræ in front of, or anterior to, the first vertebra which bears ribs connected with the sternum are cervical; all those which bear ribs and are back of the cervicals are dorsal; the one or more directly supporting the pelvis are sacral and form the sacrum; those between the sacral and dorsal are lumbar; and all those back of the sacral are caudal, or coccygeal. In man there are seven cervical vertebræ, twelve dorsal, five lumbar, five sacral, and usually four, but sometimes five and rarely three, coccygeal. 2. (Zoöl.)  One of the central ossicles in each joint of the arms of an ophiuran.",
    "vibrator":
        "(a) (Elec.) (1)  A trembler, as of an electric bell. (2)  A vibrating reed for transmitting or receiving pulsating currents in a harmonic telegraph system. (3)  A device for vibrating the pen of a siphon recorder to diminish frictional resistance on the paper. (4) An oscillator. (b) An ink-distributing roller in a printing machine, having an additional vibratory motion. (a) (Music) A vibrating reed, esp. in a reed organ. (d) (Weaving) Any of various vibrating devices, as one for slackening the warp as a shed opens. (e) An attachment, usually pneumatic, in a molding machine to shake the pattern loose.",
    "vouchee":
        "The person who is vouched, or called into court to support or make good his warranty of title in the process of common recovery. Blackstone.",
    "violable":
        "Capable of being violated, broken, or injured. -- Vi\"o*la*bly, adv.",
    "vacancy":
        "1. The quality or state of being vacant; emptiness; hence, freedom from employment; intermission; leisure; idleness; listlessness. All dispositions to idleness or vacancy, even before they are habits, are dangerous. Sir H. Wotton. 2. That which is vacant. Specifically: -- (a) Empty space; vacuity; vacuum. How is't with you, That you do bend your eye on vacancy Shak. (b) An open or unoccupied space between bodies or things; an interruption of continuity; chasm; gap; as, a vacancy between buildings; a vacancy between sentences or thoughts. (c) Unemployed time; interval of leisure; time of intermission; vacation. Time lost partly in too oft idle vacancies given both to schools and universities. Milton. No interim, not a minute's vacancy. Shak. Those little vacancies from toil are sweet. Dryden. (d) A place or post unfilled; an unoccupied office; as, a vacancy in the senate, in a school, etc.",
    "volution":
        "1. A spiral turn or wreath. 2. (Zoöl.)  A whorl of a spiral shell.",
    "vedro":
        "A Russian liquid measure, equal to 3.249 gallons of U.S. standard measure, or 2.706 imperial gallons. McElrath.",
    "vinegarroon":
        "A whip scorpion, esp. a large Mexican species (Thelyphonus giganteus) popularly supposed to be very venomous; -- from the odor that it emits when alarmed.",
    "velum":
        "1. (Anat.)  Curtain or covering; -- applied to various membranous partitions, especially to the soft palate. See under Palate. 2. (Bot.) (a) See Veil, n., 3 (b). (b) A thin membrane surrounding the sporocarps of quillworts Isoetes). 3. (Zoöl.)  A veil-like organ or part. Especially: (a) The circular membrane that partially incloses the space beneath the umbrella of hydroid medusæ. (b) A delicate funnel-like membrane around the flagellum of certain Infusoria. See Illust. a of Protozoa.",
    "volubility":
        "The quality or state of being voluble (in any of the senses of the adjective).",
    "vaniloquence": "Vain or foolish talk. [Obs.]",
    "volant":
        "1. Passing through the air upon wings, or as if upon wings; flying; hence, passing from place to place; current. English silver now was current, and our gold volant in the pope's court. Fuller. 2. Nimble; light and quick; active; rapid. \"His volant touch.\" Milton. 3. (Her.)  Represented as flying, or having the wings spread; as, an eagle volant. Volant piece (Anc. Armor), an adjustable piece of armor, for guarding the throat, etc., in a joust.",
    "vedanta":
        "A system of philosophy among the Hindoos, founded on scattered texts of the Vedas, and thence termed the \"Anta,\" or end or substance. Balfour (Cyc. of India.)",
    "voluntarily": "In a voluntary manner; of one's own will; spontaneously.",
    "vortical":
        "Of or pertaining to a vortex or vortexes; resembling a vortex in form or motion; whirling; as, a vortical motion. -- Vor\"ti*cal*ly, adv.",
    "villanella": "An old rustic dance, accompanied with singing.",
    "vergency":
        "1. The act of verging or approaching; tendency; approach. [R.] 2. (Opt.)  The reciprocal of the focal distance of a lens, used as measure of the divergence or convergence of a pencil of rays. [R.] Humphrey Lloyd.",
    "vibration":
        "1. The act of vibrating, or the state of being vibrated, or in vibratory motion; quick motion to and fro; oscillation, as of a pendulum or musical string. As a harper lays his open palm Upon his harp, to deaden its vibrations. Longfellow. 2. (Physics)  A limited reciprocating motion of a particle of an elastic body or medium in alternately opposite directions from its position of equilibrium, when that equilibrium has been disturbed, as when a stretched cord or other body produces musical notes, or particles of air transmit sounds to the ear. The path of the particle may be in a straight line, in a circular arc, or in any curve whatever. Note: Vibration and oscillation are both used, in mechanics, of the swinging, or rising and falling, motion of a suspended or balanced body; the latter term more appropriately, as signifying such motion produced by gravity, and of any degree of slowness, while the former applies especially to the quick, short motion to and fro which results from elasticity, or the action of molecular forces among the particles of a body when disturbed from their position of rest, as in a spring. Amplitude of vibration, the maximum displacement of a vibrating particle or body from its position of rest. -- Phase of vibration, any part of the path described by a particle or body in making a complete vibration, in distinction from other parts, as while moving from one extreme to the other, or on one side of the line of rest, in distinction from the opposite. Two particles are said to be in the same phase when they are moving in the same direction and with the same velocity, or in corresponding parts of their paths.",
    "violet-ear":
        "Any tropical humming bird of the genus Petasophora, having violet or purplish ear tufts.",
    "variolitic":
        "1. Thickly marked with small, round specks; spotted. 2. (Geol.)  Of, pertaining to, or resembling, variolite.",
    "vulturism": "The quality or state of being like a vulture; rapaciousness.",
    "vachette clasp":
        "A piece of strong steel wire with the ends curved and pointed, used on toe or quarter cracks to bind the edges together and prevent motion. It is clasped into two notches, one on each side of the crack, burned into the wall with a cautery iron.",
    "velure": "Velvet. [Obs.] \"A woman's crupper of velure.\" Shak.",
    "veneficious":
        "Acting by poison; used in poisoning or in sorcery. [Obs.] \"An old veneficious practice.\" Sir T. Browne. -- Ven`e*fi\"cious*ly, adv. [Obs.]",
    "vindicatory":
        "1. Tending or serving to vindicate or justify; justificatory; vindicative. 2. Inflicting punishment; avenging; punitory. The afflictions of Job were no vindicatory punishments to take vengeance of his sins. Abp. Bramhall.",
    "vowelish":
        "Of the nature of a vowel. [R.] \"The power [of w] is always vowelish.\" B. Jonson.",
    "vindication":
        "1. The act of vindicating, or the state of being vindicated; defense; justification against denial or censure; as, the vindication of opinions; his vindication is complete. Occasion for the vindication of this passage in my book. Locke. 2. (Civil Law)  The claiming a thing as one's own; the asserting of a right or title in, or to, a thing. Burrill.",
    "vermiculite":
        "A group of minerals having, a micaceous structure. They are hydrous silicates, derived generally from the alteration of some kind of mica. So called because the scales, when heated, open out into wormlike forms.",
    "vert":
        "1. (Eng. Forest Law) (a) Everything that grows, and bears a green leaf, within the forest; as, to preserve vert and venison is the duty of the verderer. (b) The right or privilege of cutting growing wood. 2. (Her.)  The color green, represented in a drawing or engraving by parallel lines sloping downward toward the right.",
    "varveled":
        "Having varvels, or rings. [Written also varvelled, and vervelled.] Note: In heraldry, when the jesses attached to the legs of hawks hang loose, or have pendent ends with rings at the tips, the blazon is a hawk (or a hawk's leg) jessed and varveled.",
    "vasoconstrictor":
        "Causing constriction of the blood vessels; as, the vasoconstrictor nerves, stimulation of which causes constriction of the blood vessels to which they go. These nerves are also called vasohypertonic. n.  A substance which causes constriction of the blood vessels. Such substances are used in medicine to raise blood pressure.",
    "vagient": "Crying like a child. [Obs.]",
    "valure": "Value. [Obs.] Ld. Berners.",
    "viraginian":
        "Of or pertaining to a virago; having the qualities of a virago. Milton.",
    "velutina":
        "Any one of several species of marine gastropods belonging to Velutina and allied genera.",
    "vultern":
        "The brush turkey (Talegallus Lathami) of Australia. See Brush turkey.",
    "valerian":
        "Any plant of the genus Valeriana. The root of the officinal valerian (V. officinalis) has a strong smell, and is much used in medicine as an antispasmodic. Greek valerian (Bot.), a plant (Polemonium cæruleum) with blue or white flowers, and leaves resembling those of the officinal valerian.",
    "villatic":
        "Of or pertaining to a farm or a village; rural. \"Tame villatic fowl.\" Milton.",
    "vinaceous":
        "1. Belonging to, or like, wine or grapes. 2. Of the color of wine, especially of red wine.",
    "venger": "An avenger. [Obs.] Spenser.",
    "vesica":
        "A bladder. Vesica piscis. Etym: [L., dish bladder.] (Eccl. Art) A glory, or aureole, of oval shape, or composed of two arcs of circles usually represented as surrounding a divine personage. More rarely, an oval composed of two arcs not representing a glory; a solid oval, etc.",
    "ventilate":
        "1. To open and expose to the free passage of air; to supply with fresh air, and remove impure air from; to air; as, to ventilate a room; to ventilate a cellar; to ventilate a mine. 2. To provide with a vent, or escape, for air, gas, etc.; as, to ventilate a mold, or a water-wheel bucket. 3. To change or renew, as the air of a room. Harvey. 4. To winnow; to fan; as, to ventilate wheat. 5. To sift and examine; to bring out, and subject to penetrating scrutiny; to expose to examination and discussion; as, to ventilate questions of policy. Ayliffe. 6. To give vent; to utter; to make public. Macaulay took occasion to ventilate one of those starling, but not very profound, paradoxes. J. C. Shairp.",
    "vendetta": "A blood feud; private revenge for the murder of a kinsman.",
    "vermiculate":
        "To form or work, as by inlaying, with irregular lines or impressions resembling the tracks of worms, or appearing as if formed by the motion of worms.\n\n1. Wormlike in shape; covered with wormlike elevations; marked with irregular fine lines of color, or with irregular wavy impressed lines like worm tracks; as, a vermiculate nut. 2. Crawling or creeping like a worm; hence, insinuating; sophistical. \"Vermiculate questions.\" Bacon. \"Vermiculate logic.\" R. Choate.",
    "varicosity":
        "1. The quality or state of being varicose. 2. An enlargement or swelling in a vessel, fiber, or the like; a varix; as, the varicosities of nerve fibers.",
    "villi": ", pl. of Villus.",
    "vintager": "One who gathers the vintage.",
    "visionist": "A visionary.",
    "votive":
        "Given by vow, or in fulfillment of a vow; consecrated by a vow; devoted; as, votive offerings; a votive tablet. \"Votive incense.\" Keble. We reached a votive stone, that bears the name Of Aloys Reding. Wordsworth. Embellishments of flowers and votive garlands. Motley. Votive medal, a medal struck in grateful commemoration of some auspicious event. -- Votive offering, an offering in fulfillment of a religious vow, as of one's person or property. -- Vo\"tive*ly, adv. -- Vo\"tive*ness, n.",
    "valuably": "So as to be of value.",
    "vasum":
        "A genus including several species of large marine gastropods having massive pyriform shells, with conspicuous folds on the columella.",
    "vacher":
        "A keeper of stock or cattle; a herdsman. [Southwestern U. S.] Bartlett.",
    "vista":
        "A view; especially, a view through or between intervening objects, as trees; a view or prospect through an avenue, or the like; hence, the trees or other objects that form the avenue. The finished garden to the view Its vistas opens, and its alleys green. Thomson. In the groves of their academy, at the end of every vista, you see nothing but the gallows. Burke. The shattered tower which now forms a vista from his window. Sir W. Scott.",
    "versicle":
        "A little verse; especially, a short verse or text said or sung in public worship by the priest or minister, and followed by a response from the people. The psalms were in number fifteen, . . . being digested into versicles. Strype.",
    "vaudois":
        "1. An inhabitant, or the inhabitants, of the Swiss canton of Vaud. 2. A modern name of the Waldenses.",
    "vastness": "The quality or state of being vast.",
    "vanner": "A machine for concentrating ore. See Frue vanner.",
    "venge":
        "To avenge; to punish; to revenge. [Obs.] See Avenge, and Revenge. Chaucer. \"To venge me, as I may.\" Shak.",
    "villanousness": "See Villainous, etc.",
    "vively":
        "In a lively manner. [Obs.] If I see a thing vively represented on the stage. B. Jonson.",
    "vellet": "Velvet. [Obs.] Spenser.",
    "vesbium":
        "A rare metallic element of which little is known. It is said by Scacchi to have been extracted from a yellowish incrustation from the cracks of a Vesuvian lava erupted in 1631.",
    "vivificate":
        "1. To give life to; to animate; to revive; to vivify. [R.] God vivificates and actuates the whole world. Dr. H. More. 2. (Chem.)  To bring back a metal to the metallic form, as from an oxide or solution; to reduce. [Obs.]",
    "vaut":
        "To vault; to leap. [Obs.] Spenser.\n\nA vault; a leap. [Obs.] Spenser.",
    "vertuous": "Virtuous; powerful. [Obs.] Spenser.",
    "vaccination":
        "The act, art, or practice of vaccinating, or inoculating with the cowpox, in order to prevent or mitigate an attack of smallpox. Cf. Inoculation. Note: In recent use, vaccination sometimes includes inoculation with any virus as a preventive measure; as, vaccination of cholera.",
    "variciform": "Resembling a varix.",
    "vexillary":
        "1. Of or pertaining to an ensign or standard. 2. (Bot.)  Of or pertaining to the vexillum, or upper petal of papilionaceous flowers. Vexilary æstivation (Bot.), a mode of æstivation in which one large upper petal folds over, and covers, the other smaller petals, as in most papilionaceous plants.\n\nA standard bearer. Tennyson.",
    "vaccinate":
        "To inoculate with the cowpox by means of a virus, called vaccine, taken either directly or indirectly from cows.",
    "virent": "Green; not withered. [R.] Sir T. Browne.",
    "volume":
        "1. A roll; a scroll; a written document rolled up for keeping or for use, after the manner of the ancients. [Obs.] The papyrus, and afterward the parchment, was joined together [by the ancients] to form one sheet, and then rolled upon a staff into a volume (volumen). Encyc. Brit. 2. Hence, a collection of printed sheets bound together, whether containing a single work, or a part of a work, or more than one work; a book; a tome; especially, that part of an extended work which is bound up together in one cover; as, a work in four volumes. An odd volume of a set of books bears not the value of its proportion to the set. Franklin. 4. Anything of a rounded or swelling form resembling a roll; a turn; a convolution; a coil. So glides some trodden serpent on the grass, And long behind wounded volume trails. Dryden. Undulating billows rolling their silver volumes. W. Irving. 4. Dimensions; compass; space occupied, as measured by cubic units, that is, cubic inches, feet, yards, etc.; mass; bulk; as, the volume of an elephant's body; a volume of gas. 5. (Mus.)  Amount, fullness, quantity, or caliber of voice or tone. Atomic volume, Molecular volume (Chem.), the ratio of the atomic and molecular weights divided respectively by the specific gravity of the substance in question. -- Specific volume (Physics & Chem.), the quotient obtained by dividing unity by the specific gravity; the reciprocal of the specific gravity. It is equal (when the specific gravity is referred to water at 4º C. as a standard) to the number of cubic centimeters occupied by one gram of the substance.",
    "verisimilous": "Verisimilar. [Obs.]",
    "vaginismus":
        "A painful spasmodic contraction of the vagina, often rendering copulation impossible.",
    "vegetability":
        "The quality or state of being vegetable. [Obs.] Sir T. Browne.",
    "verdine": "A commercial name for green aniline dye.",
    "visiting":
        "a. & vb. n. from Visit. Visiting ant. (Zoöl.) See Driver ant, under Driver. -- Visiting book, a book in which a record of visits received, made, and to be made, is kept. Thackeray. -- Visiting card. See under Card.",
    "velivolant": "Flying with sails; passing under full sail. [R.]",
    "vampire":
        "1. A blood-sucking ghost; a soul of a dead person superstitiously believed to come from the grave and wander about by night sucking the blood of persons asleep, thus causing their death. This superstition is now prevalent in parts of Eastern Europe, and was especially current in Hungary about the year 1730. The persons who turn vampires are generally wizards, witches, suicides, and persons who have come to a violent end, or have been cursed by their parents or by the church, Encyc. Brit. 2. Fig.: One who lives by preying on others; an extortioner; a bloodsucker. 3. (Zoöl.)  Either one of two or more species of South American blood- sucking bats belonging to the genera Desmodus and Diphylla. These bats are destitute of molar teeth, but have strong, sharp cutting incisors with which they make punctured wounds from which they suck the blood of horses, cattle, and other animals, as well as man, chiefly during sleep. They have a cæcal appendage to the stomach, in which the blood with which they gorge themselves is stored. 4. (Zoöl.)  Any one of several species of harmless tropical American bats of the genus Vampyrus, especially V. spectrum. These bats feed upon insects and fruit, but were formerly erroneously supposed to suck the blood of man and animals. Called also false vampire. Vampire bat (Zoöl.), a vampire, 3.",
    "venite":
        "The 95th Psalm, which is said or sung regularly in the public worship of many churches. Also, a musical composition adapted to this Psalm.",
    "vitrification": "Same as Vitrifaction. Sir T. Browne. Ure.",
    "verification":
        "1. The act of verifying, or the state of being verified; confirmation; authentication. 2. (Law) (a) Confirmation by evidence. (b) A formal phrase used in concluding a plea. Verification of an equation (Math.), the operation of testing the equation of a problem, to see whether it expresses truly the conditions of the problem. Davies & Peck. (Math. Dict.)",
    "vakeel": "A native attorney or agent; also, an ambassador. [India]",
    "verisimility":
        "Verisimilitude. [Obs.] The verisimility or probable truth. Sir T. Browne.",
    "vixenish": "Of or pertaining to a vixen; resembling a vixen.",
    "vend":
        "To transfer to another person for a pecuniary equivalent; to make an object of trade; to dispose of by sale; to sell; as, to vend goods; to vend vegetables. Note: Vend differs from barter. We vend for money; we barter for commodities. Vend is used chiefly of wares, merchandise, or other small articles, not of lands and tenements.\n\n1. The act of vending or selling; a sale. 2. The total sales of coal from a colliery. [Eng.]",
    "voltaism":
        "That form of electricity which is developed by the chemical action between metals and different liquids; voltaic electricity; also, the science which treats of this form of electricity; -- called also galvanism, from Galvani, on account of his experiments showing the remarkable influence of this agent on animals.",
    "vitrescence":
        "The quality or state of being vitreous; glassiness, or the quality of being vitrescent; capability of conversion into glass; susceptibility of being formed into glass. Kirwan.",
    "vesicula": "A vesicle.",
    "vitriolate":
        "(a) To convert into, or change to, a vitriol; to make into sulphuric acid or a sulphate. (b) To subject to the action of, or impregnate with, vitriol.\n\nVitriolated. [R.]\n\nA sulphate.",
    "volcanically": "Like a volcano.",
    "voltatype": "An electrotype. [R.]",
    "vacillation":
        "1. The act of vacillating; a moving one way and the other; a wavering. His vacillations, or an alternation of knowledge and doubt. Jer. Taylor.",
    "veering": "Shifting. -- Veer\"ing*ly, adv.",
    "veneracea":
        "An extensive tribe of bivalve mollusks of which the genus Venus is the type. The shells are usually oval, or somewhat heartshaped, with a conspicuous lunule. See Venus.",
    "vegetism": "Vegetal state or characteristic.",
    "volupere": "A woman's cap. [Obs.] Chaucer.",
    "voltzite":
        "An oxysulphide of lead occurring in implanted spherical globules of a yellowish or brownish color; -- called also voltzine.",
    "volutation": "A rolling of a body; a wallowing. [R.] Sir T. Browne.",
    "verily":
        "In very truth; beyond doubt or question; in fact; certainly. Bacon. Trust in the Lord and do good; so shalt thou dwell in the verily thou shalt be fed. Ps. xxxvii. 3.",
    "valvular":
        "1. Of or pertaining to a valve or valves; specifically (Med.), of or pertaining to the valves of the heart; as, valvular disease. 2. Containing valves; serving as a valve; opening by valves; valvate; as, a valvular capsule.",
    "vagabondage":
        "The condition of a vagabond; a state or habit of wandering about in idleness; vagrancy.",
    "victus": "Food; diet.",
    "vaticinal": "Of or pertaining to prophecy; prophetic. T. Warton.",
    "votist": "One who makes a vow. [Obs.] Chapman.",
    "vulcanizer":
        "One who, or that which, vulcanizes; esp., an apparatus for vulcanizing caoutchouc.",
    "vers de societe": "See Society verses, under Society.",
    "vociferance": "Vociferation; noise; clamor. [R.] R. Browning.",
    "vivisect":
        "To perform vivisection upon; to dissect alive. [Colloq.] Pop. Sci. Monthly.",
    "vadium":
        "Pledge; security; bail. See Mortgage. Vadium vivum Etym: [LL.] (Law), a living pledge, which exists where an estate is granted until a debt is paid out of its proceeds.",
    "vugh": "A cavity in a lode; -- called also vogle.",
    "verbalization":
        "The act of verbalizing, or the state of being verbalized.",
    "verticillate":
        "Arranged in a transverse whorl or whorls like the rays of a wheel; as, verticillate leaves of a plant; a verticillate shell.",
    "ventriloquist":
        "One who practices, or is skilled in, ventriloquism. Ventriloquist monkey (Zoöl.), the onappo; -- so called from the character of its cry.",
    "vehiculary": "Vehicular.",
    "vomito":
        "The yellow fever in its worst form, when it is usually attended with black vomit. See Black vomit.",
    "vengeful":
        "Vindictive; retributive; revengeful. \"Vengeful ire.\" Milton. -- Venge\"ful*ly, adv.",
    "vinegar":
        "1. A sour liquid used as a condiment, or as a preservative, and obtained by the spontaneous (acetous) fermentation, or by the artificial oxidation, of wine, cider, beer, or the like. Note: The characteristic sourness of vinegar is due to acetic acid, of which it contains from three to five per cent. Wine vinegar contains also tartaric acid, citric acid, etc. 2. Hence, anything sour; -- used also metaphorically. Here's the challenge: . . . I warrant there's vinegar and pepper in't. Shak. Aromatic vinegar, strong acetic acid highly flavored with aromatic substances. -- Mother of vinegar. See 4th Mother. -- Radical vinegar, acetic acid. -- Thieves' vinegar. See under Thief. -- Vinegar eel (Zoöl.), a minute nematode worm (Leptodera oxophila, or Anguillula acetiglutinis), commonly found in great numbers in vinegar, sour paste, and other fermenting vegetable substances; -- called also vinegar worm. -- Vinegar lamp (Chem.), a fanciful name of an apparatus designed to oxidize alcohol to acetic acid by means of platinum. -- Vinegar plant. See 4th Mother. -- Vinegar tree (Bot.), the stag-horn sumac (Rhus typhina), whose acid berries have been used to intensify the sourness of vinegar. -- Wood vinegar. See under Wood.\n\nTo convert into vinegar; to make like vinegar; to render sour or sharp. [Obs.] Hoping that he hath vinegared his senses As he was bid. B. Jonson.",
    "visitant":
        "One who visits; a guest; a visitor. When the visitant comes again, he is no more a stranger. South.\n\nVisiting. Wordsworth.",
    "viceman": "A smith who works at the vice instead of at the anvil.",
    "viviparously": "In a viviparous manner.",
    "vanning":
