    "volcanist":
        "1. One versed in the history and phenomena of volcanoes. 2. One who believes in the igneous, as opposed to the aqueous, origin of the rocks of the earth's crust; a vulcanist. Cf. Neptunist.",
    "venerous": "Venereous. [Obs.] Burton.",
    "varioloid":
        "Resembling smallpox; pertaining to the disease called varioloid.\n\nThe smallpox as modified by previous inoculation or vaccination. Note: It is almost always a milder disease than smallpox, and this circumstance, with its shorter duration, exhibits the salutary effects of previous vaccination or inoculation. Dunglison.",
    "vagantes":
        "A tribe of spiders, comprising some of those which take their prey in a web, but which also frequently run with agility, and chase and seize their prey.",
    "venulose": "Full of venules, or small veins.",
    "vaticanism":
