    "venturesome":
        "Inclined to venture; not loth to run risk or danger; venturous; bold; daring; adventurous; as, a venturesome boy or act. -- Ven\"ture*some*ly, adv. -- Ven\"ture*some*ness, n.",
    "villan": "A villain. [R.]",
    "volapuek":
        "Literally, world's speech; the name of an artificial language invented by Johan Martin Schleyer, of Constance, Switzerland, about 1879.",
    "vapor pressure":
        "The pressure or tension of a confined body of vapor. The pressure of a given saturated vapor is a function of the temperature only, and may be measured by introducing a small quantity of the substance into a barometer and noting the depression of the column of mercury.",
    "vapory":
        "1. Full of vapors; vaporous. 2. Hypochondriacal; splenetic; peevish.",
    "versed":
        "Acquainted or familiar, as the result of experience, study, practice, etc.; skilled; practiced. Deep versed in books and shallow in himself. Milton. Opinions . . . derived from studying the Scriptures, wherein he was versed beyond any person of his age. Southey. These men were versed in the details of business. Macaulay.\n\nTurned. Versed sine. See under Sine, and Illust. of Functions.",
    "vestal":
        "Of or pertaining to Vesta, the virgin goddess of the hearth; hence, pure; chaste.\n\n1. (Rom. Antiq.)  A virgin consecrated to Vesta, and to the service of watching the sacred fire, which was to be perpetually kept burning upon her altar. Note: The Vestals were originally four, but afterward six, in number. Their term of service lasted thirty years, the period of admission being from the sixth to the tenth year of the candidate's age. 2. A virgin; a woman pure and chaste; also, a nun. How happy is the blameless vestal's lot! Pope.",
    "vidual":
        "Of or pertaining to the state of a widow; widowed. [R.] Jer. Taylor.",
    "viewer":
        "1. One who views or examines. 2. (Law)  A person appointed to inspect highways, fences, or the like, and to report upon the same. 3. The superintendent of a coal mine. [Eng.]",
    "vigoroso":
        "Vigorous; energetic; with energy; -- a direction to perform a passage with energy and force.",
    "vital":
        "1. Belonging or relating to life, either animal or vegetable; as, vital energies; vital functions; vital actions. 2. Contributing to life; necessary to, or supporting, life; as, vital blood. Do the heavens afford him vital food Spenser. And vital virtue infused, and vital warmth. Milton. 3. Containing life; living. \"Spirits that live throughout, vital in every part.\" Milton. 4. Being the seat of life; being that on which life depends; mortal. The dart flew on, and pierced a vital part. Pope. 5. Very necessary; highly important; essential. A competence is vital to content. Young. 6. Capable of living; in a state to live; viable. [R.] Pythagoras and Hippocrates . . . affirm the birth of the seventh month to be vital. Sir T. Browne. Vital air, oxygen gas; -- so called because essential to animal life. [Obs.] -- Vital capacity (Physiol.), the breathing capacity of the lungs; -- expressed by the number of cubic inches of air which can be forcibly exhaled after a full inspiration. -- Vital force. (Biol.) See under Force. The vital forces, according to Cope, are nerve force (neurism), growth force (bathmism), and thought force (phrenism), all under the direction and control of the vital principle. Apart from the phenomena of consciousness, vital actions no longer need to be considered as of a mysterious and unfathomable character, nor vital force as anything other than a form of physical energy derived from, and convertible into, other well- known forces of nature. -- Vital functions (Physiol.), those functions or actions of the body on which life is directly dependent, as the circulation of the blood, digestion, etc. -- Vital principle, an immaterial force, to which the functions peculiar to living beings are ascribed. -- Vital statistics, statistics respecting the duration of life, and the circumstances affecting its duration. -- Vital tripod. (Physiol.) See under Tripod. -- Vital vessels (Bot.), a name for latex tubes, now disused. See Latex.\n\nA vital part; one of the vitals. [R.]",
    "vase clock":
        "A clock whose decorative case has the general form of a vase, esp. one in which there is no ordinary dial, but in which a part of a vase revolves while a single stationary indicator serves as a hand.",
    "vegetate":
        "1. To grow, as plants, by nutriment imbibed by means of roots and leaves; to start into growth; to sprout; to germinate. See dying vegetables life sustain, See life dissolving vegetate again. Pope. 2. Fig.: To lead a live too low for an animate creature; to do nothing but eat and grow. Cowper. Persons who . . . would have vegetated stupidly in the places where fortune had fixed them. Jeffrey. 3. (Med.)  To grow exuberantly; to produce fleshy or warty outgrowths; as, a vegetating papule.",
    "vestment":
        "A covering or garment; some part of clothing or dress; specifically (Eccl.), any priestly garment. \"Royal vestiment.\" Chaucer. \"Priests in holy vestments.\" Shak. The sculptor could not give vestments suitable to the quality of the persons represented. Dryden.",
    "vibraculum":
