        "An aquatic American plant (Brasenia peltata) having floating oval leaves, and the covered with a clear jelly.",
    "weal":
        "The mark of a stripe. See Wale.\n\nTo mark with stripes. See Wale.\n\n1. A sound, healthy, or prosperous state of a person or thing; prosperity; happiness; welfare. God . . . grant you wele and prosperity. Chaucer. As we love the weal of our souls and bodies. Bacon. To him linked in weal or woe. Milton. Never was there a time when it more concerned the public weal that the character of the Parliament should stand high. Macaulay. 2. The body politic; the state; common wealth. [Obs.] The special watchmen of our English weal. Shak.\n\nTo promote the weal of; to cause to be prosperous. [Obs.] Beau. & Fl.",
    "want":
        "1. The state of not having; the condition of being without anything; absence or scarcity of what is needed or desired; deficiency; lack; as, a want of power or knowledge for any purpose; want of food and clothing. And me, his parent, would full soon devour For want of other prey. Milton. From having wishes in consequence of our wants, we often feel wants in consequence of our wishes. Rambler. Pride is as loud a beggar as want, and more saucy. Franklin. 2. Specifically, absence or lack of necessaries; destitution; poverty; penury; indigence; need. Nothing is so hard for those who abound in riches, as to conceive how others can be in want. Swift. 3. That which is needed or desired; a thing of which the loss is felt; what is not possessed, and is necessary for use or pleasure. Habitual superfluities become actual wants. Paley. 4. (Mining)  A depression in coal strata, hollowed out before the subsequent deposition took place. [Eng.] Syn. -- Indigence; deficiency; defect; destitution; lack; failure; dearth; scarceness.\n\n1. To be without; to be destitute of, or deficient in; not to have; to lack; as, to want knowledge; to want judgment; to want learning; to want food and clothing. They that want honesty, want anything. Beau. & Fl. Nor think, though men were none, That heaven would want spectators, God want praise. Milton. The unhappy never want enemies. Richardson. 2. To have occasion for, as useful, proper, or requisite; to require; to need; as, in winter we want a fire; in summer we want cooling breezes. 3. To feel need of; to wish or long for; to desire; to crave. \" What wants my son\" Addison. I want to speak to you about something. A. Trollope.\n\n1. To be absent; to be deficient or lacking; to fail; not to be sufficient; to fall or come short; to lack; -- often used impersonally with of; as, it wants ten minutes of four. The disposition, the manners, and the thoughts are all before it; where any of those are wanting or imperfect, so much wants or is imperfect in the imitation of human life. Dryden. 2. To be in a state of destitution; to be needy; to lack. You have a gift, sir (thank your education), Will never let you want. B. Jonson. For as in bodies, thus in souls, we find What wants in blood and spirits, swelled with wind. Pope. Note: Want was formerly used impersonally with an indirect object. \"Him wanted audience.\" Chaucer. WA'N'T Wa'n't.  A colloquial contraction of was not.",
    "water-standing":
        "Tear-filled. [R.] \"Many an orphan's water-standing eye.\" Shak.",
    "waxy":
        "Resembling wax in appearance or consistency; viscid; adhesive; soft; hence, yielding; pliable; impressible. \"Waxy to persuasion.\" Bp. Hall. Waxy degeneration (Med.), amyloid degeneration. See under Amyloid. -- Waxy kidney, Waxy liver, etc. (Med.), a kidney or liver affected by waxy degeneration.",
    "weariful":
        "Abounding in qualities which cause weariness; wearisome. -- Wea\"ri*ful*ly, adv.",
    "wherewith":
        "1. With which; -- used relatively. The love wherewith thou hast loved me. John xvii. 26. 2. With what; -- used interrogatively. Wherewith shall I save Israel Judg. vi. 15.\n\nThe necessary means or instrument. So shall I have wherewith to answer him. Ps. cxix. 42. The wherewith to meet excessive loss by radiation. H. Spencer.",
    "wool-dyed":
        "Dyed before being made into cloth, in distinction from piece- dyed; ingrain.",
    "water engine":
        "An engine to raise water; or an engine moved by water; also, an engine or machine for extinguishing fires; a fire engine.",
    "water cure": "1. (Med.)  Hydropathy. 2. A hydropathic institution.",
    "water tabby": "A kind of waved or watered tabby. See Tabby, n., 1.",
    "web-toed":
        "Having the toes united by a web for a considerable part of their length.",
    "winkingly": "In a winking manner; with the eye almost closed. Peacham.",
    "warty-back":
        "An American fresh-water mussel (Quadrula pustulosa). Its shell is used in making buttons.",
    "wheen":
        "A quantity; a goodly number. [Scot.] \"A wheen other dogs.\" Sir W. Scott.",
    "wordish":
        "Respecting words; full of words; wordy. [R.] Sir P. Sidney. -- Word\"ish*ness, n. The truth they hide by their dark woordishness. Sir K. Digby.",
    "water pheasant":
        "(a) The pintail. See Pintail, n., 1. (b) The goosander. (c) The hooded merganser.",
    "week-end":
        "The end of the week; specif., though loosely, the period observed commonly as a holiday, from Saturday noon or Friday night to Monday; as, to visit one for a week-end; also, a house party during a week-end.",
    "workshop": "A shop where any manufacture or handiwork is carried on.",
    "water grass":
        "(a) A tall march perennial grass (Paspalum dilatatum) of the southern United States and the American tropics. (b) Manna grass. (c) The grass Chloris elegans. (d) [Dial. Eng.] (1) Velvet grass. (2)  The water cress. (3)  One of various horsetails.",
    "water pipe": "A pipe for conveying water.",
    "waterpot":
        "A vessel for holding or conveying water, or for sprinkling water on cloth, plants, etc.",
    "whalebone":
        "A firm, elastic substance resembling horn, taken from the upper jaw of the right whale; baleen. It is used as a stiffening in stays, fans, screens, and for various other purposes. See Baleen. Note: Whalebone is chiefly obtained from the bowhead, or Greenland, whale, the Biscay whale, and the Antarctic, or southern, whale. It is prepared for manufacture by being softened by boiling, and dyed black.",
    "wiclifite": "See Wyclifite.",
    "wealthily":
        "In a wealthy manner; richly. I come to wive it wealthily in Padua. Shak.",
    "widower":
        "A man who has lost his wife by death, and has not married again. Shak.",
    "worst":
        "Bad, evil, or pernicious, in the highest degree, whether in a physical or moral sense. See Worse. \"Heard so oft in worst extremes.\" Milton. I have a wife, the worst that may be. Chaucer. If thou hadst not been born the worst of men, Thou hadst been a knave and flatterer. Shak.\n\nThat which is most bad or evil; the most severe, pernicious, calamitous, or wicked state or degree. The worst is not So long as we can say, This is the worst. Shak. He is always sure of finding diversion when the worst comes to the worst. Addison.\n\nTo gain advantage over, in contest or competition; to get the better of; to defeat; to overthrow; to discomfit. The . . . Philistines were worsted by the captivated ark. South.\n\nTo grow worse; to deteriorate. [R.] \"Every face . . . worsting.\" Jane Austen.",
    "willow":
        "1. (Bot.)  Any tree or shrub of the genus Salix, including many species, most of which are characterized often used as an emblem of sorrow, desolation, or desertion. \"A wreath of willow to show my forsaken plight.\" Sir W. Scott. Hence, a lover forsaken by, or having lost, the person beloved, is said to wear the willow. And I must wear the willow garland For him that's dead or false to me. Campbell. 2. (Textile Manuf.)  A machine in which cotton or wool is opened and cleansed by the action of long spikes projecting from a drum which revolves within a box studded with similar spikes; -- probably so called from having been originally a cylindrical cage made of willow rods, though some derive the term from winnow, as denoting the winnowing, or cleansing, action of the machine. Called also willy, twilly, twilly devil, and devil. Almond willow, Pussy willow, Weeping willow. (Bot.) See under Almond, Pussy, and Weeping. -- Willow biter (Zoöl.) the blue tit. [Prov. Eng.] -- Willow fly (Zoöl.), a greenish European stone fly (Chloroperla viridis); -- called also yellow Sally. -- Willow gall (Zoöl.), a conical, scaly gall produced on willows by the larva of a small dipterous fly (Cecidomyia strobiloides). -- Willow grouse (Zoöl.), the white ptarmigan. See ptarmigan. -- Willow lark (Zoöl.), the sedge warbler. [Prov. Eng.] -- Willow ptarmigan (Zoöl.) (a) The European reed bunting, or black-headed bunting. See under Reed. (b) A sparrow (Passer salicicolus) native of Asia, Africa, and Southern Europe. -- Willow tea, the prepared leaves of a species of willow largely grown in the neighborhood of Shanghai, extensively used by the poorer classes of Chinese as a substitute for tea. McElrath. -- Willow thrush (Zoöl.), a variety of the veery, or Wilson's thrush. See Veery. -- Willow warbler (Zoöl.), a very small European warbler (Phylloscopus trochilus); -- called also bee bird, haybird, golden wren, pettychaps, sweet William, Tom Thumb, and willow wren.\n\nTo open and cleanse, as cotton, flax, or wool, by means of a willow. See Willow, n., 2.",
    "whistle":
        "1. To make a kind of musical sound, or series of sounds, by forcing the breath through a small orifice formed by contracting the lips; also, to emit a similar sound, or series of notes, from the mouth or beak, as birds. The weary plowman leaves the task of day, And, trudging homeward, whistles on the way. Gay. 2. To make a shrill sound with a wind or steam instrument, somewhat like that made with the lips; to blow a sharp, shrill tone. 3. To sound shrill, or like a pipe; to make a sharp, shrill sound; as, a bullet whistles through the air. The wild winds whistle, and the billows roar. Pope.\n\n1. To form, utter, or modulate by whistling; as, to whistle a tune or an air. 2. To send, signal, or call by a whistle. He chanced to miss his dog; we stood still till he had whistled him up. Addison. To whistle off. (a) To dismiss by a whistle; -- a term in hawking. \"AS a long-winged hawk when he is first whistled off the fist, mounts aloft.\" Burton. (b) Hence, in general, to turn loose; to abandon; to dismiss. I 'ld whistle her off, and let her down the wind To prey at fortune. Shak. Note: \"A hawk seems to have been usually sent off in this way, against the wind when sent in search of prey; with or down the wind, when turned loose, and abandoned.\" Nares.\n\n1. A sharp, shrill, more or less musical sound, made by forcing the breath through a small orifice of the lips, or through or instrument which gives a similar sound; the sound used by a sportsman in calling his dogs; the shrill note of a bird; as, the sharp whistle of a boy, or of a boatswain's pipe; the blackbird's mellow whistle. Might we but hear The folded flocks, penned in their wattled cotes, . . . Or whistle from the lodge. Milton. The countryman could not forbear smiling, . . . and by that means lost his whistle. Spectator. They fear his whistle, and forsake the seas. Dryden. 2. The shrill sound made by wind passing among trees or through crevices, or that made by bullet, or the like, passing rapidly through the air; the shrill noise (much used as a signal, etc.) made by steam or gas escaping through a small orifice, or impinging against the edge of a metallic bell or cup. 3. An instrument in which gas or steam forced into a cavity, or against a thin edge, produces a sound more or less like that made by one who whistles through the compressed lips; as, a child's whistle; a boatswain's whistle; a steam whistle (see Steam whistle, under Steam). The bells she jingled, and the whistle blew. Pope. 4. The mouth and throat; -- so called as being the organs of whistling. [Colloq.] So was her jolly whistle well ywet. Chaucer. Let's drink the other cup to wet our whistles. Walton. Whistle duck (Zoöl.), the American golden-eye.",
    "water ice":
        "Water flavored, sweetened, and frozen, to be eaten as a confection.",
    "waif":
        "1. (Eng. Law.)  Goods found of which the owner is not known; originally, such goods as a pursued thief threw away to prevent being apprehended, which belonged to the king unless the owner made pursuit of the felon, took him, and brought him to justice. Blackstone. 2. Hence, anything found, or without an owner; that which comes along, as it were, by chance. \"Rolling in his mind old waifs of rhyme.\" Tennyson. 3. A wanderer; a castaway; a stray; a homeless child. A waif Desirous to return, and not received. Cowper.",
    "whewer": "The European widgeon. [Prov. Eng.]",
    "wels": "The sheatfish; -- called also waller.",
    "wonderly": "Wonderfully; wondrously. [Obs.] Chaucer.",
    "wall street":
        "A street towards the southern end of the borough of Manhattan, New York City, extending from Broadway to the East River; -- so called from the old wall which extended along it when the city belonged to the Dutch. It is the chief financial center of the United States, hence the name is often used for the money market and the financial interests of the country.",
    "whirling":
        "a. & n. from Whirl, v. t. Whirling table. (a) (Physics) An apparatus provided with one or more revolving disks, with weights, pulleys, and other attachments, for illustrating the phenomena and laws of centrifugal force, and the like. (b) A potter's wheel.",
    "whitebait":
        "(a) The young of several species of herrings, especially of the common herring, esteemed a great delicacy by epicures in England. (b) A small translucent fish (Salanx Chinensis) abundant at certain seasons on the coasts of China and Japan, and used in the same manner as the European whitebait.",
    "wost": "2d pers. sing. pres. of Wit, to know. [Obs.] Spenser.",
    "wind-up":
        "Act of winding up, or closing; a concluding act or part; the end.",
    "withholder": "One who withholds.",
    "water buffalo": "The European buffalo.",
    "whennes": "Whence. [Obs.] Chaucer.",
    "wharfage":
        "1. The fee or duty paid for the privilege of using a wharf for loading or unloading goods; pierage, collectively; quayage. 2. A wharf or wharfs, collectively; wharfing.",
    "wrestler": "One who wrestles; one who is skillful in wrestling.",
    "whereform": "From which; from which or what place. Tennyson.",
    "whitebeard": "An old man; a graybeard.",
    "windstorm": "A storm characterized by high wind with little or no rain.",
    "whiggish":
        "Of or pertaining to Whigs; partaking of, or characterized by, the principles of Whigs.",
    "whit":
        "The smallest part or particle imaginable; a bit; a jot; an iota; -- generally used in an adverbial phrase in a negative sentence. \"Samuel told him every whit.\" 1 Sam. iii. 18. \"Every whit as great.\" South. So shall I no whit be behind in duty. Shak. It does not me a whit displease. Cowley.",
    "windsor":
        "A town in Berkshire, England. Windsor bean. (Bot.) See under Bean. -- Windsor chair, a kind of strong, plain, polished, wooden chair. Simmonds. -- Windsor soap, a scented soap well known for its excellence.",
    "workbench":
        "A bench on which work is performed, as in a carpenter's shop.",
    "wishful":
        "1. Having desire, or ardent desire; longing. 2. Showing desire; as, wishful eyes. From Scotland am I stolen, even of pure love To greet mine own land with my wishful sight. Shak. 3. Desirable; exciting wishes. [R.] Chapman. -- Wish\"ful*ly, adv. -- Wish\"ful*ness, n.",
    "whurry":
        "To whisk along quickly; to hurry. [R.] Whurrying the chariot with them to the shore. Vicars.",
    "waterboard":
        "A board set up to windward in a boat, to keep out water. Ham. Nav. Encyc.",
    "welk":
        "To wither; to fade; also, to decay; to decline; to wane. [Obs.] When ruddy Phwelk in west. Spenser. The church, that before by insensible degrees welked and impaired, now with large steps went down hill decaying. Milton.\n\n1. To cause to wither; to wilt. [Obs.] Mot thy welked neck be to-broke [broken]. Chaucer. 2. To contract; to shorten. [Obs.] Now sad winter welked hath the day. Spenser. 3. To soak; also, to beat severely. [Prov. Eng.]\n\nA pustule. See 2d Whelk.\n\nA whelk. [R.]",
    "wearisome":
        "Causing weariness; tiresome; tedious; weariful; as, a wearisome march; a wearisome day's work; a wearisome book. These high wild hills and rough uneven ways Draws out our miles, and makes them wearisome. Shak. Syn. -- Irksome; tiresome; tedious; fatiguing; annoying; vexatious. See Irksome. -- Wea\"ri*some*ly, adv. -- Wea\"ri*some*ness, n.",
    "woodenness":
        "Quality of being wooden; clumsiness; stupidity; blockishness. We set our faces against the woodenness which then characterized German philology. Sweet.",
    "windingly": "In a winding manner.",
    "wearer":
        "1. One who wears or carries as appendant to the body; as, the wearer of a cloak, a sword, a crown, a shackle, etc. Cowls, hoods, and habits, with their wearers, tossed, And fluttered into rags. Milton. 2. That which wastes or diminishes.",
    "wainage":
        "A finding of carriages, carts, etc., for the transportation of goods, produce, etc. Ainsworth.\n\nSee Gainage, a.",
    "whichsoever":
        "Whether one or another; whether one or the other; which; that one (of two or more) which; as, whichever road you take, it will lead you to town.",
    "whiskered":
        "1. Formed into whiskers; furnished with whiskers; having or wearing whiskers. Our forefathers, a grave, whiskered race. Cowper. 2. (Zoöl.)  Having elongated hairs, feathers, or bristles on the cheeks. The whiskered vermin race. Grainger.",
    "wol": "See 2d Will. [Obs.] Chaucer.",
    "washbowl":
        "A basin, or bowl, to hold water for washing one's hands, face, etc.",
    "wattling":
        "The act or process of binding or platting with twigs; also, the network so formed. Made with a wattling of canes or sticks. Dampier.",
    "wharp":
        "A kind of fine sand from the banks of the Trent, used as a polishing powder. [Eng.]",
    "werche": "To work. [Obs.] Chaucer.",
    "wallhick": "The lesser spotted woodpecker (Dryobates minor). [Prov. Eng.]",
    "warehouse":
        "A storehouse for wares, or goods. Addison.\n\n1. To deposit or secure in a warehouse. 2. To place in the warehouse of the government or customhouse stores, to be kept until duties are paid.",
    "water horehound": "Bugleweed.",
    "water supply":
        "A supply of water; specifically, water collected, as in reservoirs, and conveyed, as by pipes, for use in a city, mill, or the like.",
    "wherewithal":
        "Wherewith. \"Wherewithal shall we be clothed\" Matt. vi. 31. Wherewithal shall a young man cleanse his way Ps. cxix. 9. [The builders of Babel], still with vain design, New Babels, had they wherewithal, would build. Milton.",
    "whippersnapper":
        "A diminutive, insignificant, or presumptuous person. [Colloq.] \"Little whippersnappers like you.\" T. Hughes.",
    "wolde": "imp. of Will. See Would.",
    "watchdog":
        "A dog kept to watch and guard premises or property, and to give notice of the approach of intruders.",
    "weryangle": "See Wariangle. [Obs.] Chaucer.",
    "wincey": "Linsey-woolsey.",
    "worker":
        "1. One who, or that which, works; a laborer; a performer; as, a worker in brass. Professors of holiness, but workers of iniquity. Shak. 2. (Zoöl.)  One of the neuter, or sterile, individuals of the social ants, bees, and white ants. The workers are generally females having the sexual organs imperfectly developed. See Ant, and White ant, under White.",
    "wildwood":
        "A wild or unfrequented wood. Also used adjectively; as, wildwood flowers; wildwood echoes. Burns.",
    "wlatsome":
        "Loathsome; disgusting; hateful. [Obs.] Murder is . . . wlatsom and abhominable to God. Chaucer.",
    "wove": "p. pr. & rare vb. n. of Weave.",
    "weeping-ripe": "Ripe for weeping; ready to weep. [Obs.] Shak.",
    "wafture":
        "The act of waving; a wavelike motion; a waft. R. Browning. An angry wafture of your hand. Shak.",
    "whiteflaw": "A whitlow. [Obs.] Holland.",
    "water willow":
        "An American aquatic plant (Dianthera Americana) with long willowlike leaves, and spikes of small purplish flowers.",
    "womanhood":
        "1. The state of being a woman; the distinguishing character or qualities of a woman, or of womankind. Unspotted faith, and comely womanhood. Spenser. Perhaps the smile and the tender tone Came out of her pitying womanhood. Tennyson. 2. Women, collectively; womankind.",
    "weevily": "Having weevils; weeviled. [Written also weevilly.]",
    "water torch":
        "The common cat-tail (Typha latifolia), the spike of which makes a good torch soaked in oil. Dr. Prior.",
    "water sparrow":
        "(a) The reed warbler. [Prov. Eng.] (b) The reed bunting. [Prov. Eng.]",
    "woosy": "Oozy; wet. [Obs.] Drayton.",
    "wore": "imp. of Wear.\n\nimp. of Ware.",
    "wahoo":
        "(a) A certain shrub (Evonymus atropurpureus) having purple capsules which in dehiscence expose the scarlet-ariled seeds; -- called also burning bush. (b) Cascara buckthorn. (c) Basswood.\n\nA dark blue scombroid food fish (Acanthocibium solandri or petus) of Florida and the West Indies.",
    "weely": "A kind of trap or snare for fish, made of twigs. [Obs.] Carew.",
    "woad":
        "1. (Bot.)  An herbaceous cruciferous plant (Isatis tinctoria). It was formerly cultivated for the blue coloring matter derived from its leaves. 2. A blue dyestuff, or coloring matter, consisting of the powdered and fermented leaves of the Isatis tinctoria. It is now superseded by indigo, but is somewhat used with indigo as a ferment in dyeing. Their bodies . . . painted with woad in sundry figures. Milton. Wild woad (Bot.), the weld (Reseda luteola). See Weld. -- Woad mill, a mill grinding and preparing woad.",
    "water junket": "The common sandpiper.",
    "water flounder": "The windowpane (Pleuronectes maculatus). [Local, U. S.]",
    "wordle":
        "One of several pivoted pieces forming the throat of an adjustable die used in drawing wire, lead pipe, etc. Knight.",
    "water butt":
        "A large, open-headed cask, set up on end, to contain water. Dickens.",
    "warre":
        "Worse. [Obs.] They say the world is much warre than it wont. Spenser.",
    "whirlwig": "A whirligig.",
    "waterleaf":
        "Any plant of the American genus Hydrophyllum, herbs having white or pale blue bell-shaped flowers. Gray.",
    "whilk":
        "1. (Zoöl.)  A kind of mollusk, a whelk. [Prov. Eng.] 2. (Zoöl.)  The scoter. [Prov. Eng.]\n\nWhich. [Obs. or Scot.] Note: Whilk is sometimes used in Chaucer to represent the Northern dialect.",
    "waddle":
        "To walk with short steps, swaying the body from one side to the other, like a duck or very fat person; to move clumsily and totteringly along; to toddle; to stumble; as, a child waddles when he begins to walk; a goose waddles. Shak. She drawls her words, and waddles in her pace. Young.\n\nTo trample or tread down, as high grass, by walking through it. [R.] Drayton.",
    "wintergreen":
        "A plant which keeps its leaves green through the winter. Note: In England, the name wintergreen is applied to the species of Pyrola which in America are called English wintergreen, and shin leaf (see Shin leaf, under Shin.) In America, the name wintergreen is given to Gaultheria procumbens, a low evergreen aromatic plant with oval leaves clustered at the top of a short stem, and bearing small white flowers followed by red berries; -- called also checkerberry, and sometimes, though improperly, partridge berry. Chickweed wintergreen, a low perennial primulaceous herb (Trientalis Americana); -- also called star flower. -- Flowering wintergreen, a low plant (Polygala paucifolia) with leaves somewhat like those of the wintergreen (Gaultheria), and bearing a few showy, rose-purple blossoms. -- Spotted wintergreen, a low evergreen plant (Chimaphila maculata) with ovate, white-spotted leaves.",
    "whipstock": "The rod or handle to which the lash of a whip is fastened.",
    "whirligig":
        "1. A child's toy, spun or whirled around like a wheel upon an axis, or like a top. Johnson. 2. Anything which whirls around, or in which persons or things are whirled about, as a frame with seats or wooden horses. With a whirligig of jubilant mosquitoes spinning about each head. G. W. Cable. 3. A mediæval instrument for punishing petty offenders, being a kind of wooden cage turning on a pivot, in which the offender was whirled round with great velocity. 4. (Zoöl.)  Any one of numerous species of beetles belonging to Gyrinus and allied genera. The body is firm, oval or boatlike in form, and usually dark colored with a bronzelike luster. These beetles live mostly on the surface of water, and move about with great celerity in a gyrating, or circular, manner, but they are also able to dive and swim rapidly. The larva is aquatic. Called also weaver, whirlwig, and whirlwig beetle.",
    "water level":
        "1. The level formed by the surface of still water. 2. A kind of leveling instrument. See under Level, n.",
    "waker": "One who wakes.",
    "wage":
        "1. To pledge; to hazard on the event of a contest; to stake; to bet, to lay; to wager; as, to wage a dollar. Hakluyt. My life I never but as a pawn To wage against thy enemies. Shak. 2. To expose one's self to, as a risk; to incur, as a danger; to venture; to hazard. \"Too weak to wage an instant trial with the king.\" Shak. To wake and wage a danger profitless. Shak. 3. To engage in, as a contest, as if by previous gage or pledge; to carry on, as a war. [He pondered] which of all his sons was fit To reign and wage immortal war with wit. Dryden. The two are waging war, and the one triumphs by the destruction of the other. I. Taylor. 4. To adventure, or lay out, for hire or reward; to hire out. [Obs.] \"Thou . . . must wage thy works for wealth.\" Spenser. 5. To put upon wages; to hire; to employ; to pay wages to. [Obs.] Abundance of treasure which he had in store, wherewith he might wage soldiers. Holinshed. I would have them waged for their labor. Latimer. 6. (O. Eng. Law)  To give security for the performance of. Burrill. To wage battle (O. Eng. Law), to give gage, or security, for joining in the duellum, or combat. See Wager of battel, under Wager, n. Burrill. -- To wage one's law (Law), to give security to make one's law. See Wager of law, under Wager, n.\n\nTo bind one's self; to engage. [Obs.]\n\n1. That which is staked or ventured; that for which one incurs risk or danger; prize; gage. [Obs.] \"That warlike wage.\" Spenser. 2. That for which one labors; meed; reward; stipulated payment for service performed; hire; pay; compensation; -- at present generally used in the plural. See Wages. \"My day's wage.\" Sir W. Scott. \"At least I earned my wage.\" Thackeray. \"Pay them a wage in advance.\" J. Morley. \"The wages of virtue.\" Tennyson. By Tom Thumb, a fairy page, He sent it, and doth him engage, By promise of a mighty wage, It secretly to carry. Drayton. Our praises are our wages. Shak. Existing legislation on the subject of wages. Encyc. Brit. Note: Wage is used adjectively and as the first part of compounds which are usually self-explaining; as, wage worker, or wage-worker; wage-earner, etc. Board wages. See under 1st Board. Syn. -- Hire; reward; stipend; salary; allowance; pay; compensation; remuneration; fruit.",
    "wise-like":
        "Resembling that which is wise or sensible; judicious. The only wise-like thing I heard anybody say. Sir W. Scott.",
    "wadding":
        "1. A wad, or the materials for wads; any pliable substance of which wads may be made. 2. Any soft stuff of loose texture, used for stuffing or padding garments; esp., sheets of carded cotton prepared for the purpose.",
    "wust": "imp. of Wit. Piers Plowman.",
