    "wariness":
        "The quality or state of being wary; care to foresee and guard against evil; cautiousness. \"An almost reptile wariness.\" G. W. Cable. To determine what are little things in religion, great wariness is to be used. Sprat. Syn. -- Caution; watchfulness; circumspection; foresight; care; vigilance; scrupulousness.",
    "warkloom": "A tool; an implement. [Scot.]",
    "water jacket":
        "A chamber surrounding a vessel or tube in which water may be circulated, thereby regulating the temperature or supply of heat to the vessel. Used in laboratory and manufacturing equipment. water- jacketed. Having a water jacket; -- as, a water-jacketed condenser.",
    "wilt":
        "2d pers. sing. of Will.\n\nTo begin to wither; to lose freshness and become flaccid, as a plant when exposed when exposed to drought, or to great heat in a dry day, or when separated from its root; to droop;. to wither. [Prov. Eng. & U. S.]\n\n1. To cause to begin to wither; to make flaccid, as a green plant. [Prov. Eng. U. S.] 2. Hence, to cause to languish; to depress or destroy the vigor and energy of. [Prov. Eng. & U. S.] Despots have wilted the human race into sloth and imbecility. Dr. T. Dwight.",
    "wimble":
        "An instrument for boring holes, turned by a handle. Specifically: (a) A gimlet. \" It is but like the little wimble, to let in the greater auger.\" Selden. (b) A stonecutter's brace for boring holes in stone. (c) An auger used for boring in earth.\n\nTo bore or pierce, as with a wimble. \"A foot soldier . . . wimbled also a hole through said coffin.\" Wood.\n\nActive; nimble.[Obs.] Spenser.",
    "womb":
        "1. The belly; the abdomen. [Obs.] Chaucer. And he coveted to fill his woman of the cods that the hogs eat, and no man gave him. Wyclif (Luke xv. 16). An I had but a belly of any indifferency, I were simply the most active fellow in Europe. My womb, my womb, my womb undoes me. Shak. 2. (Anat.)  The uterus. See Uterus. 3. The place where anything is generated or produced. The womb of earth the genial seed receives. Dryden. 4. Any cavity containing and enveloping anything. The center spike of gold Which burns deep in the bluebell's womb. R. Browning.\n\nTo inclose in a womb, or as in a womb; to breed or hold in secret. [Obs.] Shak.",
    "wastor":
