    "wheeling":
        "1. The act of conveying anything, or traveling, on wheels, or in a wheeled vehicle. 2. The act or practice of using a cycle; cycling. 3. Condition of a road or roads, which admits of passing on wheels; as, it is good wheeling, or bad wheeling. 4. A turning, or circular movement.",
    "wappato": "See Wapatoo.",
    "windward":
        "The point or side from which the wind blows; as, to ply to the windward; -- opposed to Ant: leeward. To lay an anchor to the windward, a figurative expression, signifying to adopt precautionary or anticipatory measures for success or security.\n\nSituated toward the point from which the wind blows; as, the Windward Islands.\n\nToward the wind; in the direction from which the wind blows.",
    "wardenry": "The office or jurisdiction of a warden.",
    "water plate":
        "A plate heated by hot water contained in a double bottom or jacket. Knight.",
    "whiffler":
        "1. One who whiffles, or frequently changes his opinion or course; one who uses shifts and evasions in argument; hence, a trifler. Every whiffler in a laced coat who frequents the chocolate house shall talk of the constitution. Swift. 2. One who plays on a whiffle; a fifer or piper. [Obs.] 3. An officer who went before procession to clear the way by blowing a horn, or otherwise; hence, any person who marched at the head of a procession; a harbinger. Which like a mighty whiffler 'fore the king, Seems to prepare his way. Shak. Note: \"Whifflers, or fifers, generally went first in a procession, from which circumstance the name was transferred to other persons who succeeded to that office, and at length was given to those who went forward merely to clear the way for the procession. . . . In the city of London, young freemen, who march at the head of their proper companies on the Lord Mayor's day, sometimes with flags, were called whifflers, or bachelor whifflers, not because they cleared the way, but because they went first, as whifflers did.\" Nares. 4. (Zoöl)  The golden-eye. [Local, U.S.]",
    "writ":
        "3d pers. sing. pres. of Write, for writeth. Chaucer.\n\nimp. & p. p. of Write. Dryden.\n\n1. That which is written; writing; scripture; -- applied especially to the Scriptures, or the books of the Old and New testaments; as, sacred writ. \"Though in Holy Writ not named.\" Milton. Then to his hands that writ he did betake, Which he disclosing read, thus as the paper spake. Spenser. Babylon, so much spoken of in Holy Writ. Knolles. 2. (Law)  An instrument in writing, under seal, in an epistolary form, issued from the proper authority, commanding the performance or nonperformance of some act by the person to whom it is directed; as, a writ of entry, of error, of execution, of injunction, of mandamus, of return, of summons, and the like. Note: Writs are usually witnessed, or tested, in the name of the chief justice or principal judge of the court out of which they are issued; and those directed to a sheriff, or other ministerial officer, require him to return them on a day specified. In former English law and practice, writs in civil cases were either original or judicial; the former were issued out of the Court of Chancery, under the great seal, for the summoning of a defendant to appear, and were granted before the suit began and in order to begin the same; the latter were issued out of the court where the original was returned, after the suit was begun and during the pendency of it. Tomlins. Brande. Encyc. Brit. The term writ is supposed by Mr. Reeves to have been derived from the fact of these formulæ having always been expressed in writing, being, in this respect, distinguished from the other proceedings in the ancient action, which were conducted orally. Writ of account, Writ of capias, etc. See under Account, Capias, etc. -- Service of a writ. See under Service.",
    "wholesale":
        "Sale of goods by the piece or large quantity, as distinguished from retail. By wholesale, in the mass; in large quantities; without distinction or discrimination. Some, from vanity or envy, despise a valuable book, and throw contempt upon it by wholesale. I. Watts.\n\n1. Pertaining to, or engaged in, trade by the piece or large quantity; selling to retailers or jobbers rather than to consumers; as, a wholesale merchant; the wholesale price. 2. Extensive and indiscriminate; as, wholesale slaughter. \"A time for wholesale trust.\" Mrs. Humphry Ward.",
    "wert":
        ", The second person singular, indicative and subjunctive moods, imperfect tense, of the verb be. It is formed from were, with the ending -t, after the analogy of wast. Now used only in solemn or poetic style.\n\nA wart. [Obs.] Chaucer.",
    "whitleather":
        "1. Leather dressed or tawed with alum, salt, etc., remarkable for its pliability and toughness; white leather. 2. (Anat.)  The paxwax. See Paxwax.",
    "warworn":
