    "wolframite":
        "Tungstate of iron and manganese, generally of a brownish or grayish black color, submetallic luster, and high specific gravity. It occurs in cleavable masses, and also crystallized. Called also wolfram.",
    "wettish": "Somewhat wet; moist; humid.",
    "winning":
        "Attracting; adapted to gain favor; charming; as, a winning address. \"Each mild and winning note.\" Keble.\n\n1. The act of obtaining something, as in a contest or by competition. 2. The money, etc., gained by success in competition or contest, esp, in gambling; -- usually in the plural. Ye seek land and sea for your winnings. Chaucer. 3. (Mining) (a) A new opening. (b) The portion of a coal field out for working. Winning headway (Mining), an excavation for exploration, in post-and-stall working. -- Winning post, the post, or goal, at the end of a race.",
    "waxwork":
