    "yllanraton": "The agouara.",
    "yeast":
        "1. The foam, or troth (top yeast), or the sediment (bottom yeast), of beer or other in fermentation, which contains the yeast plant or its spores, and under certain conditions produces fermentation in saccharine or farinaceous substances; a preparation used for raising dough for bread or cakes, and making it light and puffy; barm; ferment. 2. Spume, or foam, of water. They melt thy yeast of waves, which mar Alike the Armada's pride, or spoils of Trafalgar. Byron.  A form of fungus which grows as indvidual rounded cells, rather than in a mycelium, and reproduces by budding; esp. members of the orders Endomycetales and Moniliales. Some fungi may grow both as a yeast or as a mycelium, depending on the conditions of growth. Yeast cake, a mealy cake impregnated with the live germs of the yeast plant, and used as a conveniently transportable substitute for yeast. -- Yeast plant (Bot.), the vegetable organism, or fungus, of which beer yeast consists. The yeast plant is composed of simple cells, or granules, about one three-thousandth of an inch in diameter, often united into filaments which reproduce by budding, and under certain circumstances by the formation of spores. The name is extended to other ferments of the same genus. See Saccharomyces. -- Yeast powder, a baling powder, -- used instead of yeast in leavening bread.",
    "yamp":
        "An umbelliferous plant (Carum Gairdneri); also, its small fleshy roots, which are eaten by the Indians from Idaho to California.",
    "yard":
        "1. A rod; a stick; a staff. [Obs.] P. Plowman. If men smote it with a yerde. Chaucer. 2. A branch; a twig. [Obs.] The bitter frosts with the sleet and rain Destroyed hath the green in every yerd. Chaucer. 3. A long piece of timber, as a rafter, etc. [Obs.] 4. A measure of length, equaling three feet, or thirty-six inches, being the standard of English and American measure. 5. The penis. 6. (Naut.)  A long piece of timber, nearly cylindrical, tapering toward the ends, and designed to support and extend a square sail. A yard is usually hung by the center to the mast. See Illust. of Ship. Golden Yard, or Yard and Ell (Astron.), a popular name the three stars in the belt of Orion. -- Under yard [i. e., under the rod], under contract. [Obs.] Chaucer.\n\n1. An inclosure; usually, a small inclosed place in front of, or around, a house or barn; as, a courtyard; a cowyard; a barnyard. A yard . . . inclosed all about with sticks In which she had a cock, hight chanticleer. Chaucer. 2. An inclosure within which any work or business is carried on; as, a dockyard; a shipyard. Liberty of the yard, a liberty, granted to persons imprisoned for debt, of walking in the yard, or within any other limits prescribed by law, on their giving bond not to go beyond those limits. -- Prison yard, an inclosure about a prison, or attached to it. -- Yard grass (Bot.), a low-growing grass (Eleusine Indica) having digitate spikes. It is common in dooryards, and like places, especially in the Southern United States. Called also crab grass. -- Yard of land. See Yardland.\n\nTo confine (cattle) to the yard; to shut up, or keep, in a yard; as, to yard cows.",
    "yodle":
        "To sing in a manner common among the Swiss and Tyrolese mountaineers, by suddenly changing from the head voice, or falsetto, to the chest voice, and the contrary; to warble.\n\nA song sung by yodeling, as by the Swiss mountaineers.",
    "yug":
        "Any one of the four ages, Krita, or Satya, Treta, Dwapara, and Kali, into which the Hindoos divide the duration or existence of the world.",
    "yend": "To throw; to cast. [Prov. Eng.]",
    "yarely": "In a yare manner. [Obs.] Shak.",
    "ywis":
        "Certainly; most likely; truly; probably. [Obs. or Archaic] \"Ywis,\" quod he, \"it is full dear, I say.\" Chaucer. She answered me, \"I-wisse, all their sport in the park is but a shadow to that pleasure that I find in Plato.\" Ascham. A right good knight, and true of word ywis. Spenser. Note: The common form iwis was often written with the prefix apart from the rest of the word and capitalized, as, I wis, I wisse, etc. The prefix was mistaken for the pronoun, I and wis, wisse, for a form of the verb wit to know. See Wis, and cf. Wit, to know. Our ship, I wis, Shall be of another form than this. Longfellow.",
    "yeanling": "A lamb or a kid; an eanling. Shak.",
    "yauper": "One who, or that which, yaups.",
    "yew":
        "See Yaw.\n\n1. (Bot.)  An evergreen tree (Taxus baccata) of Europe, allied to the pines, but having a peculiar berrylike fruit instead of a cone. It frequently grows in British churchyards. 2. The wood of the yew. It is light red in color, compact, fine- grained, and very elastic. It is preferred to all other kinds of wood for bows and whipstocks, the best for these purposes coming from Spain. Note: The American yew (Taxus baccata, var. Canadensis) is a low and straggling or prostrate bush, never forming an erect trunk. The California yew (Taxus brevifolia) is a good-sized tree, and its wood is used for bows, spear handles, paddles, and other similar implements. Another yew is found in Florida, and there are species in Japan and the Himalayas. 3. A bow for shooting, made of the yew.\n\nOf or pertaining to yew trees; made of the wood of a yew tree; as, a yew whipstock.",
    "yaw-weed":
        "A low, shrubby, rubiaceous plant (Morinda Royoc) growing along the seacoast of the West Indies. It has small, white, odorous flowers.",
    "yesterday":
        "1. The day last past; the day next before the present. All our yesterdays have lighted fools The way to dusty death. Shak. We are but of yesterday, and know nothing. Job viii. 9. 2. Fig.: A recent time; time not long past. The proudest royal houses are but of yesterday, when compared with the line of supreme pontiffs. Macaulay.\n\nOn the day last past; on the day preceding to-day; as, the affair took place yesterday.",
    "yaksha": "A kind of demigod attendant on Kuvera, the god of wealth.",
    "yerk":
        "1. To throw or thrust with a sudden, smart movement; to kick or strike suddenly; to jerk. Their wounded steeds . . . Yerk out their armed heels at their dead masters. Shak. 2. To strike or lash with a whip. [Obs. or Scot.]\n\n1. To throw out the heels; to kick; to jerk. They flirt, they yerk, they backward . . . fling. Drayton. 2. To move a quick, jerking motion.\n\nA sudden or quick thrust or motion; a jerk.",
