    "yourself":
        "An emphasized or reflexive form of the pronoun of the second person; -- used as a subject commonly with you; as, you yourself shall see it; also, alone in the predicate, either in the nominative or objective case; as, you have injured yourself. Of which right now ye han yourselve heard. Chaucer. If yourselves are old, make it your cause. Shak. Why should you be so cruel to yourself Milton. The religious movement which you yourself, as well as I, so faithfully followed from first to last. J. H. Newman.",
    "yajur-veda": "See Veda.",
    "youth":
        "1. The quality or state of being young; youthfulness; juvenility. \"In my flower of youth.\" Milton. Such as in his face Youth smiled celestial. Milton. 2. The part of life that succeeds to childhood; the period of existence preceding maturity or age; the whole early part of life, from childhood, or, sometimes, from infancy, to manhood. He wondered that your lordship Would suffer him to spend his youth at home. Shak. Those who pass their youth in vice are justly condemned to spend their age in folly. Rambler. 3. A young person; especially, a young man. Seven youths from Athens yearly sent. Dryden. 4. Young persons, collectively. It is fit to read the best authors to youth first. B. Jonson.",
    "youngthly":
        "Pertaining to, or resembling, youth; youthful. [Obs.] Spenser. YOUNG WOMEN'S CHRISTIAN ASSOCIATION Young Women's Christian Association.  An organization for promoting the spiritual, intellectual, social, and economic welfare of young women, originating in 1855 with Lady Kinnaird's home for young women, and Miss Emma Robert's prayer union for young women,in England, which were combined in the year 1884 as a national association. Now nearly all the civilized countries, and esp. the United States, have local, national, and international organizations.",
