    "yaul": "See Yawl.",
    "yaws":
        "A disease, occurring in the Antilles and in Africa, characterized by yellowish or reddish tumors, of a contagious character, which, in shape and appearance, often resemble currants, strawberries, or raspberries. There are several varieties of this disease, variously known as framboesia, pian, verrugas, and crab- yaws.",
    "yuen":
        "The crowned gibbon (Hylobates pileatus), native of Siam, Southern China, and the Island of Hainan. It is entirely arboreal in its habits, and has very long arms. the males are dark brown or blackish, with a caplike mass of long dark hair, and usually with a white band around the face. The females are yellowish white, with a dark spot on the breast and another on the crown. Called also wooyen, and wooyen ape.",
    "yux": "See Yex, n. [Obs.]",
    "yaw":
        "To rise in blisters, breaking in white froth, as cane juice in the clarifiers in sugar works.\n\nTo steer wild, or out of the line of her course; to deviate from her course, as when struck by a heavy sea; -- said of a ship. Just as he would lay the ship's course, all yawing being out of the question. Lowell.\n\nA movement of a vessel by which she temporarily alters her course; a deviation from a straight course in steering.",
    "yaup":
        "To cry out like a child; to yelp. [Scot. & Colloq. U. S.] [Written also yawp.]\n\n1. A cry of distress, rage, or the like, as the cry of a sickly bird, or of a child in pain. [Scot. & Colloq. U. S.] 2. (Zoöl.)  The blue titmouse. [Prov. Eng.]",
    "yaupon":
        "A shrub (Ilex Cassine) of the Holly family, native from Virginia to Florida. The smooth elliptical leaves are used as a substitute for tea, and were formerly used in preparing the black drink of the Indians of North Carolina. Called also South-Sea tea. [Written also yapon, youpon, and yupon.]",
    "yellow-eyed":
        "Having yellow eyes. Yellow-eyed grass (Bot.), any plant of the genus Xyris.",
    "yawd":
