    "yiddisher": "A Yid. [Slang]",
    "yeomanlike": "Resembling, or suitable to, a yeoman; yeomanly.",
    "yttric": "Pertaining to, derived from, or containing, yttrium.",
    "yeve": "To give. [Obs.] Chaucer.",
    "yazoo fraud":
        "The grant by the State of Georgia, by Act of Jan. 7, 1795, of 35,000,000 acres of her western territory, for 500,000, to four companies known as the Yazoo Companies from the region granted ; -- commonly so called, the act being known as the Yazoo Frauds Act, because of alleged corruption of the legislature, every member but one being a shareholder in one or more of the companies. The act granting the land was repealed in 1796 by a new legislature, and the repealing provision was incorporated in the State constitution in 1798. In 1802 the territory was ceded to the United States. The claims of the purchasers, whom Georgia had refused to compensate, were sustained by the United States Supreme Court, which (1810) declared the repealing act of 1796 unconstitutional. Congress in 1814 ordered the lands sold and appropriated 5,000,000 to pay the claims.",
    "yom":
        "Day; -- a Hebrew word used in the names of various Jewish feast days; as, Yom Kippur, the Day of Atonement; Yom Teruah (lit., day of shouting), the Feast of Trumpets.",
    "yellowbill": "The American scoter.",
    "yokel": "A country bumpkin. [Eng.] Dickens.",
    "yule":
        "Christmas or Christmastide; the feast of the Nativity of our Savior. And at each pause they kiss; was never seen such rule In any place but here, at bonfire, or at Yule. Drayton. Yule block, or Yule log, a large log of wood formerly put on the hearth of Christmas eve, as the foundation of the fire. It was brought in with much ceremony. -- Yule clog, the yule log. Halliwell. W. Irving.",
    "yellowbird":
        "(a) The American goldfinch, or thistle bird. See Goldfinch. (b) The common yellow warbler; -- called also summer yellowbird. See Illust. of Yellow warbler, under Yellow, a.",
    "yea":
        "1. Yes; ay; a word expressing assent, or an affirmative, or an affirmative answer to a question, now superseded by yes. See Yes. Let your communication be yea, yea; nay, nay. Matt. v. 37. 2. More than this; not only so, but; -- used to mark the addition of a more specific or more emphatic clause. Cf. Nay, adv., 2. I therein do rejoice, yea, and will rejoice. Phil. i. 18. Note: Yea sometimes introduces a clause, with the sense of indeed, verily, truly. \"Yea, hath God said, Ye shall not eat of every tree of the garden\" Gen. iii. 1.\n\nAn affirmative vote; one who votes in the affirmative; as, a vote by yeas and nays. Note: In the Scriptures, yea is used as a sign of certainty or stability. \"All the promises of God in him are yea, and in him Amen.\" 2 Cor. i. 20.",
    "yore":
        "In time long past; in old time; long since. [Obs. or Poetic] As it hath been of olde times yore. Chaucer. Which though he hath polluted oft and yore, Yet I to them for judgment just do fly. Spenser. Of yore, of old time; long ago; as, in times or days of yore. \"But Satan now is wiser than of yore.\" Pope. Where Abraham fed his flock of yore. Keble.",
    "yttria": "The oxide, Y2O3, or earth, of yttrium.",
    "yearbook":
        "1. A book published yearly; any annual report or summary of the statistics or facts of a year, designed to be used as a reference book; as, the Congregational Yearbook. 2. (Eng. Law)  A book containing annual reports of cases adjudged in the courts of England. Note: The Yearbooks are the oldest English reports extant, beginning with the reign of Edward II., and ending with the reign of Henry VIII. They were published annually, and derive their name from that fact. They consist of eleven parts, or volumes, are written in Law French, and extend over nearly two hundred years. There are, however, several hiatuses, or chasms, in the series. Kent. Bouvier.",
    "yead":
        "Properly, a variant of the defective imperfect yode, but sometimes mistaken for a present. See the Note under Yede. [Obs.] Years yead away and faces fair deflower. Drant.",
    "yacare":
        "A South American crocodilian (Jacare sclerops) resembling the alligator in size and habits. The eye orbits are connected together, and surrounded by prominent bony ridges. Called also spectacled alligator, and spectacled cayman. [Written also jacare.] Note: The name is also applied to allied species.",
    "yeasty": "Frothy; foamy; spumy, like yeast.",
    "yieldless": "Without yielding; unyielding. [Obs.]",
    "yellowtail":
        "(a) Any one of several species of marine carangoid fishes of the genus Seriola; especially, the large California species (S. dorsalis) which sometimes weighs thirty or forty pounds, and is highly esteemed as a food fish; -- called also cavasina, and white salmon. (b) The mademoiselle, or silver perch. (c) The menhaden. (d) The runner, 12. (e) A California rockfish (Sebastodes flavidus). (f) The sailor's choice (Diplodus rhomboides). Note: Several other fishes are also locally called yellowtail.",
    "yoni":
        "The symbol under which Sakti, or the personification of the female power in nature, is worshiped. Cf. Lingam.",
    "yede":
        "Went. See Yode. All as he bade fulfilled was indeed This ilke servant anon right out yede. Chaucer. Note: Spenser and some later writers mistook this for a present of the defective imperfect yode. It is, however, only a variant of yode. See Yode, and cf. Yead. [He] on foot was forced for to yeed. Spenser",
    "yap": "To bark; to yelp. L'Estrange.\n\nA bark; a yelp.",
    "yarage":
        "The power of moving, or being managed, at sea; -- said with reference to a ship. Sir T. North.",
    "yester-evening": "The evening of yesterday; the evening last past.",
    "your":
        "The form of the possessive case of the personal pronoun you. Note: The possessive takes the form yours when the noun to which it refers is not expressed, but implied; as, this book is yours. \"An old fellow of yours.\" Chaucer.",
    "youngly":
        "Like a young person or thing; young; youthful. [Obs.] Shak.\n\n1. In a young manner; in the period of youth; early in life. [Obs.] Shak. 2. Ignorantly; weakly. [R.] YOUNG MEN'S CHRISTIAN ASSOCIATION Young Men's Christian Association.  An organization for promoting the spiritual, intellectual, social, and physical welfare of young men, founded, June 6, 1844, by George Williams (knighted therefor by Queen Victoria) in London. In 1851 it extended to the United States and Canada, and in 1855 representatives of similar organizations throughout Europe and America formed an international body. The movement has successfully expanded not only among young men in general, but also specifically among railroad men, in the army and navy, with provision for Indians and negroes, and a full duplication of all the various lines of oepration in the boys' departments.",
    "youthsome": "Youthful. [Obs.] Pepys.",
    "ypres lace":
        "Fine bobbin lace made at Ypres in Belgium, usually exactly like Valenciennes lace.",
    "youngness": "The quality or state of being young.",
    "yakare": "Same as Yacare.",
    "yot": "To unite closely. [Prov. Eng.]",
    "yt":
        ", an old method of printing that (AS. æt, edhæt) the \"y\" taking the place of the old letter \"Þ\"). Cf. Ye, the.\n\nan old method of printing that (AS. þæt, ðæt) the \"y\" taking the place of the old letter \"thorn\" (þ).  Cf. Ye, the.\n\nan old method of printing that (AS. þæt, ðæt) the \"y\" taking the place of the old letter \"thorn\" (þ).  Cf. Ye, the.",
    "yunx": "A genus of birds comprising the wrynecks.",
    "y level": "See under Y, n.",
    "youngish": "Somewhat young. Tatler.",
    "yankee":
        "A nickname for a native of citizen of New England, especially one descended from old New England stock; by extension, an inhabitant of the Northern States as distinguished from a Southerner; also, applied sometimes by foreigners to any inhabitant of the United States. From meanness first this Portsmouth Yankey rose, And still to meanness all his conduct flows. Oppression, A poem by an American (Boston, 1765).\n\nOf or pertaining to a Yankee; characteristic of the Yankees. The alertness of the Yankee aspect. Hawthorne. Yankee clover. (Bot.) See Japan clover, under Japan.",
    "yacht":
        "A light and elegantly furnished vessel, used either for private parties of pleasure, or as a vessel of state to convey distinguished persons from one place to another; a seagoing vessel used only for pleasure trips, racing, etc. Yacht measurement. See the Note under Tonnage, 4.\n\nTo manage a yacht; to voyage in a yacht.",
    "yarr": "To growl or snarl as a dog. [Obs.] Ainsworth.",
    "yaffle":
        "The European green woodpecker (Picus, or Genius, viridis). It is noted for its loud laughlike note. Called also eccle, hewhole, highhoe, laughing bird, popinjay, rain bird, yaffil, yaffler, yaffingale, yappingale, yackel, and woodhack.",
    "yachter": "One engaged in sailing a jacht.",
    "youze": "The cheetah.",
    "yellowroot":
        "Any one of several plants with yellow roots. Specifically: (a) See Xanthorhiza. (b) Same as Orangeroot.",
    "yucca":
        "See Flicker, n., 2.\n\nA genus of American liliaceous, sometimes arborescent, plants having long, pointed, and often rigid, leaves at the top of a more or less woody stem, and bearing a large panicle of showy white blossoms. Note: The species with more rigid leaves (as Yucca aloifolia, Y. Treculiana, and Y. baccata) are called Spanish bayonet, and one with softer leaves (Y. filamentosa) is called bear grass, and Adam's needle. Yucca moth (Zoöl.), a small silvery moth (Pronuba yuccasella) whose larvæ feed on plants of the genus Yucca.",
    "yezidee": "Same as Izedi.",
    "yielder": "One who yields. Shak.",
    "yiddish":
        "A language used by German and other Jews, being a Middle German dialect developed under Hebrew and Slavic influence. It is written in Hebrew characters.",
    "yakut":
        "The Turkish language of the Yakuts, a Mongolian people of northeastern Siberia, which is lingua franca over much of eastern Siberia.",
    "yground": "p. p. of Grind. Chaucer.",
    "yid":
        "A Jew. [Slang or Colloq.] \"Almost any young Yid who goes out from among her people.\"  John Corbin.",
    "ydo": "Done. Chaucer.",
    "yholde": "p. p. of Hold. Chaucer.",
    "yellowshanks": "See Yellolegs.",
    "yockel": "The yaffle.",
    "yren": "Iron. [Obs.] Chaucer.",
    "ydrad": "Dreaded. Yet nothing did he dread, but ever was ydrad. Spenser.",
    "yokefellow":
        "An associate or companion in, or as in; a mate; a fellow; especially, a partner in marriage. Phil. iv. 3. The two languages [English and French] became yokefellows in a still more intimate manner. Earle. Those who have most distinguished themselves by railing at the sex, very often choose one of the most worthless for a companion and yokefellow. Addison.",
    "yoke":
        "1. A bar or frame of wood by which two oxen are joined at the heads or necks for working together. A yearling bullock to thy name shall smoke, Untamed, unconscious of the galling yoke. Pope. Note: The modern yoke for oxen is usually a piece of timber hollowed, or made curving, near each end, and laid on the necks of the oxen, being secured in place by two bows, one inclosing each neck, and fastened through the timber. In some countries the yoke consists of a flat piece of wood fastened to the foreheads of the oxen by thongs about the horns. 2. A frame or piece resembling a yoke, as in use or shape. Specifically: (a) A frame of wood fitted to a person's shoulders for carrying pails, etc., suspended on each side; as, a milkmaid's yoke. (b) A frame worn on the neck of an animal, as a cow, a pig, a goose, to prevent passage through a fence. (c) A frame or convex piece by which a bell is hung for ringing it. See Illust. of Bell. (d) A crosspiece upon the head of a boat's rudder. To its ends lines are attached which lead forward so that the boat can be steered from amidships. (e) (Mach.) A bent crosspiece connecting two other parts. (f) (Arch.) A tie securing two timbers together, not used for part of a regular truss, but serving a temporary purpose, as to provide against unusual strain. (g) (Dressmaking) A band shaped to fit the shoulders or the hips, and joined to the upper full edge of the waist or the skirt. 3. Fig.: That which connects or binds; a chain; a link; a bond connection. Boweth your neck under that blissful yoke . . . Which that men clepeth spousal or wedlock. Chaucer. This yoke of marriage from us both remove. Dryden. 4. A mark of servitude; hence, servitude; slavery; bondage; service. Our country sinks beneath the yoke. Shak. My yoke is easy, and my burden is light. Matt. xi. 30. 5. Two animals yoked together; a couple; a pair that work together. I have bought five yoke of oxen, and I go to prove them. Luke xiv. 19. 6. The quantity of land plowed in a day by a yoke of oxen. [Obs.] Gardner. 7. A portion of the working day; as, to work two yokes, that is, to work both portions of the day, or morning and afternoon. [Prov. Eng.] Halliwell. Neck yoke, Pig yoke. See under Neck, and Pig. -- Yoke elm (Bot.), the European hornbeam (Carpinus Betulus), a small tree with tough white wood, often used for making yokes for cattle.\n\n1. To put a yoke on; to join in or with a yoke; as, to yoke oxen, or pair of oxen. 2. To couple; to join with another. \"Be ye not unequally yoked with unbelievers.\" 2 Cor. vi. 14. Cassius, you are yoked with a lamb. Shak. 3. To enslave; to bring into bondage; to restrain; to confine. Then were they yoked with garrisons. Milton. The words and promises that yoke The conqueror are quickly broke. Hudibras.\n\nTo be joined or associated; to be intimately connected; to consort closely; to mate. We 'll yoke together, like a double shadow. Shak.",
    "yellowhammer":
        "(a) A common European finch (Emberiza citrinella). The color of the male is bright yellow on the breast, neck, and sides of the head, with the back yellow and brown, and the top of the head and the tail quills blackish. Called also yellow bunting, scribbling lark, and writing lark. [Written also yellow-ammer.] (b) The flicker. [Local, U. S.]",
    "yernut":
        "An earthnut, or groundnut. See Groundnut (d). [Written also yarnut.]",
    "yoicks": "A cry of encouragement to foxhounds.",
    "yapon": "Same as Yaupon.",
    "yeast-bitten":
        "A term used of beer when the froth of the yeast has reëntered the body of the beer.",
    "y":
        "Y, the twenty-fifth letter of the English alphabet, at the beginning of a word or syllable, except when a prefix (see Y-), is usually a fricative vocal consonant; as a prefix, and usually in the middle or at the end of a syllable, it is a vowel. See Guide to Pronunciation, §§ 145, 178-9, 272. Note: It derives its form from the Latin Y, which is from the Greek u, i, o, and j. g; as in full, fill, AS. fyllan; E. crypt, grotto; young, juvenile; day, AS. dæg. See U, I, and J, G. Note: Y has been called the Pythagorean letter, because the Greek letter\n\nSomething shaped like the letter Y; a forked piece resembling in form the letter Y. Specifically: (a) One of the forked holders for supporting the telescope of a leveling instrument, or the axis of a theodolite; a wye. (b) A forked or bifurcated pipe fitting. (c) (Railroads) A portion of track consisting of two diverging tracks connected by a cross track. Y level (Surv.), an instrument for measuring differences of level by means of a telescope resting in Y's. -- Y moth (Zoöl.), a handsome European noctuid moth Plusia gamma) which has a bright, silvery mark, shaped like the letter Y, on each of the fore wings. Its larva, which is green with five dorsal white species, feeds on the cabbage, turnip, bean, etc. Called also gamma moth, and silver Y.\n\nI. [Obs.] King Horn. Wyclif.\n\nA prefix of obscure meaning, originally used with verbs, adverbs, adjectives, nouns, and pronouns. In the Middle English period, it was little employed except with verbs, being chiefly used with past participles, though occasionally with the infinitive Ycleped, or yclept, is perhaps the only word not entirely obsolete which shows this use. That no wight mighte it see neither yheere. Chaucer. Neither to ben yburied nor ybrent. Chaucer. Note: Some examples of Chaucer's use of this prefix are; ibe, ibeen, icaught, ycome, ydo, idoon, ygo, iproved, ywrought. It inough, enough, it is combined with an adjective. Other examples are in the Vocabulary. Spenser and later writers frequently employed this prefix when affecting an archaic style, and sometimes used it incorrectly.",
    "yeel": "An eel. [Obs.] Holland.",
    "yote":
        "To pour water on; to soak in, or mix with, water. [Obs. or Prov. Eng.] Grose. My fowls, which well enough, I, as before, found feeding at their trough Their yoted wheat. Chapman.",
    "youthy": "Young. [Obs.] Spectator.",
    "yesternoon": "The noon of yesterday; the noon last past.",
    "youngth":
        "Youth. [Obs.] Youngth is a bubble blown up with breath. Spenser.",
    "yawn":
        "1. To open the mouth involuntarily through drowsiness, dullness, or fatigue; to gape; to oscitate. \"The lazy, yawning drone.\" Shak. And while above he spends his breath, The yawning audience nod beneath. Trumbull. 2. To open wide; to gape, as if to allow the entrance or exit of anything. 't is now the very witching time of night, When churchyards yawn. Shak. 3. To open the mouth, or to gape, through surprise or bewilderment. Shak. 4. To be eager; to desire to swallow anything; to express desire by yawning; as, to yawn for fat livings. \"One long, yawning gaze.\" Landor.\n\n1. An involuntary act, excited by drowsiness, etc., consisting of a deep and long inspiration following several successive attempts at inspiration, the mouth, fauces, etc., being wide open. One person yawning in company will produce a spontaneous yawn in all present. N. Chipman. 2. The act of opening wide, or of gaping. Addison. 3. A chasm, mouth, or passageway. [R.] Now gape the graves, and trough their yawns let loose Imprisoned spirits. Marston.",
    "yttro-tantalite":
        "A tantalate of uranium, yttrium, and calcium, of a brown or black color.",
    "ynambu":
        "A South American tinamou (Rhynchotus rufescens); -- called also perdiz grande, and rufous tinamou. See Illust. of Tinamou.",
    "yahwism":
        "1. The religion or worship of Yahweh (Jehovah), or the system of doctrines, etc., connected with it. 2.  Use of Yahweh as a name of God.",
    "yift": "Gift. [Obs.] \"Great yiftes.\" Chaucer.",
    "yawningly": "In a yawning manner.",
    "yraft": "Bereft. Chaucer.",
    "yttrious": "Same as Yttric.",
    "yager":
        "In the German army, one belonging to a body of light infantry armed with rifles, resembling the chasseur of the French army. [Written also jager.]",
    "yearn":
        "To pain; to grieve; to vex. [Obs.] \"She laments, sir, for it, that it would yearn your heart to see it.\" Shak. It yearns me not if men my garments wear. Shak.\n\nTo be pained or distressed; to grieve; to mourn. [Obs.] \"Falstaff he is dead, and we must yearn therefore.\" Shak.\n\nTo curdle, as milk. [Scot.]\n\nTo be filled with longing desire; to be harassed or rendered uneasy with longing, or feeling the want of a thing; to strain with emotions of affection or tenderness; to long; to be eager. Joseph made haste; for his bowels did yearn upon his brother; and he sought where to weep. Gen. xliii. 30. Your mother's heart yearns towards you. Addison.",
    "yearth":
        "The earth. [Obs.] \"Is my son dead or hurt or on the yerthe felled\" Ld. Berners.",
    "yeven": "Given. [Obs.] Chaucer.",
    "yezdi": "Same as Izedi. Taylor.",
    "ypsiloid": "In the form of the letter Y; Y-shaped.",
    "yokeage": "See Rokeage. [Local, U. S.]",
    "yardarm":
        "Either half of a square-rigged vessel's yard, from the center or mast to the end. Note: Ships are said to be yardarm and yardarm when so near as to touch, or interlock yards.",
    "yuke": "Same as Yuck. [Prov. Eng.]",
    "yulan":
        "A species of Magnolia (M. conspicua) with large white blossoms that open before the leaves. See the Note under Magnolia.",
    "yunca":
        "An Indian of a linguistic stock of tribes of the Peruvian coast who had a developed agricultural civilization at the advent of the Spaniards, before which they had been conquered by the Incas. They constructed irrigation canals which are still in use, adorned their buildings with bas-reliefs and frescoes, and were skilled goldsmiths and silversmiths. -- Yun\"can (#), a.",
    "yachtman": "See Yachtsman.",
    "yestermorn": "The morning of yesterday. Coleridge.",
    "yawp": "See Yaup.",
    "yghe": "Eye. [Obs.] Chaucer.",
    "yama":
        "The king of the infernal regions, corresponding to the Greek Pluto, and also the judge of departed souls. In later times he is more exclusively considered the dire judge of all, and the tormentor of the wicked. He is represented as of a green color, with red garments, having a crown on his head, his eyes inflamed, and sitting on a buffalo, with a club and noose in his hands.",
    "ymaked": "Made.",
    "yellow-covered":
        "Covered or bound in yellow paper. Yellow-covered literature, cheap sensational novels and trashy magazines; -- formerly so called from the usual color of their covers. [Colloq. U. S.] Bartlett.",
    "yellowwood":
        "The wood of any one of several different kinds of trees; also, any one of the trees themselves. Among the trees so called are the Cladrastis tinctoria, an American leguminous tree; the several species of prickly ash (Xanthoxylum); the Australian Flindersia Oxleyana, a tree related to the mahogany; certain South African species of Podocarpus, trees related to the yew; the East Indian Podocarpus latifolia; and the true satinwood (Chloroxylon Swietenia). All these Old World trees furnish valuable timber.",
    "yox": "See Yex. [Obs.] Chaucer.",
    "yaguarundi":
        "Same as Jaguarondi. [Written also yaguarondi, and yagouarondi.]",
    "yardland":
        "A measure of land of uncertain quantity, varying from fifteen to forty acres; a virgate. [Obs.]",
    "yarnut": "See Yernut.",
    "yawl":
        "A small ship's boat, usually rowed by four or six oars. [Written also yaul.]\n\nTo cry out like a dog or cat; to howl; to yell. Tennyson. There howling Scyllas yawling round about. Fairfax.",
    "yautia":
        "In Porto Rico, any of several araceous plants or their starchy edible roots, which are cooked and eaten like yams or potatoes, as the taro.",
    "yellowseed": "A kind of pepper grass (Lepidium campestre).",
    "yacca":
        "A West Indian name for two large timber trees (Podocarpus coriaceus, and P. Purdicanus) of the Yew family. The wood, which is much used, is pale brownish with darker streaks.",
    "yeomanry":
        "1. The position or rank of a yeoman. [Obs.] \"His estate of yeomanry.\" Chaucer. 2. The collective body of yeomen, or freeholders. The enfranchised yeomanry began to feel an instinct for dominion. Bancroft. 3. The yeomanry cavalry. [Eng.] Yeomanry cavalry, certain bodies of volunteer cavalry liable to service in Great Britain only. [Eng.]",
    "yachtsman": "One who owns or sails a yacht; a yachter.",
    "yank":
        "A jerk or twitch. [Colloq. U. S.]\n\nTo twitch; to jerk. [Colloq. U. S.]\n\nAn abbreviation of Yankee. [Slang]",
    "yellowthroat":
        "Any one of several species of American ground warblers of the genus Geothlypis, esp. the Maryland yellowthroat (G. trichas), which is a very common species.",
    "ygo": "Gone. Chaucer.",
    "yellowammer": "See Yellow-hammer.",
    "yezdegerdian":
        "Of or pertaining to Yezdegerd, the last Sassanian monarch of Persia, who was overthrown by the Mohammedans; as, the Yezdegerdian era, which began on the 16th of June, a. d. 632. The era is still used by the Parsees.",
    "york rite":
        "The rite or ceremonial observed by one of the Masonic systems, deriving its name from the city of York, in England; also, the system itself, which, in England, confers only the first three degrees.",
    "young one":
        "A young human being; a child; also, a young animal, as a colt.",
    "youngster":
        "A young person; a youngling; a lad. [Colloq.] \"He felt himself quite a youngster, with a long life before him.\" G. Eliot.",
    "ypocras": "Hippocras. [Obs.] Chaucer.",
    "yearly":
        "1. Happening, accruing, or coming every year; annual; as, a yearly income; a yearly feast. 2. Lasting a year; as, a yearly plant. 3. Accomplished in a year; as, the yearly circuit, or revolution, of the earth. Shak.\n\nAnnually; once a year to year; as, blessings yearly bestowed. Yearly will I do this rite. Shak.",
    "ytterbium":
        "A rare element of the boron group, sometimes associated with yttrium or other related elements, as in euxenite and gadolinite. Symbol Yb; provisional atomic weight 173.2. Cf. Yttrium. Note: Ytterbium is associated with other rare elements, and probably has not been prepared in a pure state.",
    "yelp":
        "1. To boast. [Obs.] I keep [care] not of armes for to yelpe. Chaucer. 2. To utter a sharp, quick cry, as a hound; to bark shrilly with eagerness, pain, or fear; to yaup. A little herd of England's timorous deer, Mazed with a yelping kennel of French curs Shak. At the least flourish of a broomstick or ladle, he would fly to the door with a yelping precipitation. W. Irving.\n\nA sharp, quick cry; a bark. Chaucer.",
    "yuck": "To itch. [Prov. Eng.] Grose.\n\nTo scratch. [Prov. Eng.] Wright.",
    "youthful":
        "1. Not yet mature or aged; young. \"Two youthful knights.\" Dryden.  Also used figuratively. \"The youthful season of the year.\" Shak. 2. Of or pertaining to the early part of life; suitable to early life; as, youthful days; youthful sports. \"Warm, youthful blood.\" Shak. \"Youthful thoughts.\" Milton. 3. Fresh; vigorous, as in youth. After millions of millions of ages . . . still youthful and flourishing. Bentley. Syn. -- Puerile; juvenile. -- Youthful, Puerile, Juvenile. Puerile is always used in a bad sense, or at least in the sense of what is suitable to a boy only; as, puerile objections, puerile amusements, etc. Juvenile is sometimes taken in a bad sense, as when speaking of youth in contrast with manhood; as, juvenile tricks; a juvenile performance. Youthful is commonly employed in a good sense; as, youthful aspirations; or at least by way of extenuating; as, youthful indiscretions. \"Some men, imagining themselves possessed with a divine fury, often fall into toys and trifles, which are only puerilities.\" Dryden. \"Raw, juvenile writers imagine that, by pouring forth figures often, they render their compositions warm and animated.\" Blair. -- Youth\"ful*ly, adv. -- Youth\"ful*ness, n.",
    "yeastiness": "The quality or state of being yeasty, or frothy.",
    "yahwist":
        "The author of the passages of the Old Testament, esp. those of the Hexateuch, in which God is styled Yahweh, or Jehovah; the author of the Yahwistic, or Jehovistic, Prophetic Document (J); also, the document itself.",
    "yen":
        "The unit of value and account in Japan. Since Japan's adoption of the gold standard, in 1897, the value of the yen has been about 50 cents. The yen is equal to 100 sen.",
    "yedding": "The song of a minstrel; hence, any song. [Obs.] Chaucer.",
    "yarrish": "Having a rough, dry taste. [Prov. Eng.]",
    "youpon": "Same as Yaupon.",
    "yearling":
        "An animal one year old, or in the second year of its age; -- applied chiefly to cattle, sheep, and horses.\n\nBeing a year old. \"A yearling bullock to thy name small smoke.\" Pope.",
    "yowl":
        "To utter a loud, long, and mournful cry, as a dog; to howl; to yell.\n\nA loud, protracted, and mournful cry, as that of a dog; a howl.",
    "yaud": "See Yawd. [Prov. Eng. & Scot.]",
    "yielding":
        "Inclined to give way, or comply; flexible; compliant; accommodating; as, a yielding temper. Yielding and paying (Law), the initial words of that clause in leases in which the rent to be paid by the lessee is mentioned and reserved. Burrill. Syn. -- Obsequious; attentive. -- Yielding, Obsequious, Attentive. In many cases a man may be attentive or yielding in a high degree without any sacrifice of his dignity; but he who is obsequious seeks to gain favor by excessive and mean compliances for some selfish end. -- Yield\"ing*ly, adv. -- Yield\"ing*ness, n.",
    "yesteryear": "The year last past; last year.",
    "yaulp": "To yaup.",
    "yestern": "Of or pertaining to yesterday; relating to the day last past.",
    "yive": "To give. [Obs.] Chaucer.",
    "yewen": "Made of yew; as, yewen bows.",
    "yfere":
        "Together. See Ifere. [Obs.] As friends do when they be met yfere. Chaucer.",
    "yearningly": "With yearning.",
    "yl":
        "A suffix used as a characteristic termination of chemical radicals; as in ethyl, carbonyl, hydroxyl, etc. Note: -yl was first used in 1832 by Liebig and Wöhler in naming benzoyl, in the sense of stuff, or fundamental material, then in 1834 by Dumas and Peligot in naming methyl, in the sense of wood. After this -yl was generally used as in benzoyl, in the sense of stuff, characteristic ground, fundamental material.",
    "yle": "Isle. [Obs.] \"The barren yle.\" Chaucer.",
    "yellowfin": "A large squeteague.",
    "yolk":
        "1. The yellow part of an egg; the vitellus. 2. (Zoöl.)  An oily secretion which naturally covers the wool of sheep. Yolk cord (Zoöl.), a slender cord or duct which connects the yolk glands with the egg chambers in certain insects, as in the aphids. -- Yolk gland (Zoöl.), a special organ which secretes the yolk of the eggs in many turbellarians, and in some other invertebrates. See Illust. of Hermaphrodite in Appendix. -- Yolk sack (Anat.), the umbilical vesicle. See under Unbilical.",
    "yesty": "See Yeasty. Shak.",
    "yankeeism": "A Yankee idiom, word, custom, or the like. Lowell.",
    "yogi":
        "A follower of the yoga philosophy; an ascetic. [Spelt also yokin.] Whitworth.",
    "youthhood":
        "The quality or state of being a youth; the period of youth. Cheyne.",
    "yearnful": "Desirous. [Obs.] Ormulum. P. Fletcher.",
    "yonder":
        "At a distance, but within view. Yonder are two apple women scolding. Arbuthnot.\n\nBeing at a distance within view, or conceived of as within view; that or those there; yon. \"Yon flowery arbors, yonder alleys green.\" Milton. \"Yonder sea of light.\" Keble. Yonder men are too many for an embassage. Bacon.",
    "yuckel": "Same as Yockel.",
    "yarrow":
        "An American and European composite plant (Achillea Millefolium) with very finely dissected leaves and small white corymbed flowers. It has a strong, and somewhat aromatic, odor and taste, and is sometimes used in making beer, or is dried for smoking. Called also milfoil, and nosebleed.",
    "yit": "Yet. [Obs.] Chaucer.",
    "yachting": "Sailing for pleasure in a yacht.",
    "yalah": "The oil of the mahwa tree.",
    "yak":
        "A bovine mammal (Poëphagus grunnies) native of the high plains of Central Asia. Its neck, the outer side of its legs, and its flanks, are covered with long, flowing, fine hair. Its tail is long and bushy, often white, and is valued as an ornament and for other purposes in India and China. There are several domesticated varieties, some of which lack the mane and the long hair on the flanks. Called also chauri gua, grunting cow, grunting ox, sarlac, sarlik, and sarluc. Yak lace, a coarse pillow lace made from the silky hair of the yak.",
    "yes":
        "Ay; yea; -- a word which expresses affirmation or consent; -- opposed to Ant: no. Note: Yes is used, like yea, to enforce, by repetition or addition, something which precedes; as, you have done all this -- yes, you have done more. \"Yes, you despise the man books confined.\" Pope. Note: \"The fine distinction between `yea' and `yes,' `nay' and `no,' that once existed in English, has quite disappeared. `Yea' and `nay' in Wyclif's time, and a good deal later, were the answers to questions framed in the affirmative. `Will he come' To this it would have been replied, `Yea' or `Nay', as the case might be. But, `Will he not come' To this the answer would have been `Yes' or `No.' Sir Thomas More finds fault with Tyndale, that in his translation of the Bible he had not observed this distinction, which was evidently therefore going out even then, that is, in the reign of Henry VIII.; and shortly after it was quite forgotten.\" Trench.",
    "ymel": "Among. [Obs.] \"Ymel them all.\" Chaucer.",
    "yuman":
        "Designating, or pertaining to, an important linguistic stock of North American Indians of the southwestern United States and northwestern Mexico, nearly all agriculturists and adept potters and basket makers. Their usual dwelling is the brush wikiup, and in their native state they wear little clothing. The Yuma, Maricopa, Mohave, Walapi, and Yavapai are among the chief tribes, all of fine physique.",
    "yark": "To yerk. [Prov. Eng.]",
    "ycleped":
        "Called; named; -- obsolete, except in archaic or humorous writings. [Spelt also yclept.] It is full fair to ben yclept madame. Chaucer. But come, thou goddess fair and free. In heaven ycleped Euphrosyne. Milton. Those charming little missives ycleped valentines. Lamb.",
    "yeomanly":
        "Pertaining to a yeoman; becoming or suitable to, a yeoman; yeomanlike. B. Jonson. Well could he dress his tackle yeomanly. Chaucer.",
    "yern":
        "See 3d Yearn. [Obs.]\n\nEager; brisk; quick; active. [Obs.] \"Her song . . . loud and yern.\" Chaucer.",
    "yin": "A Chinese weight of 2",
    "yow": "You. [Obs.] Chaucer.",
    "youthly": "Young; youthful. [Obs.] \"All my youthly days.\" Spenser.",
    "yezidi": "Same as Izedi.",
    "ywar": "Aware; wary. [Obs.] \"Be ywar, and his way shun.\" Piers Plowman.",
    "yester-morning": "The morning of yesterday. Coleridge.",
    "year":
        "1. The time of the apparent revolution of the sun trough the ecliptic; the period occupied by the earth in making its revolution around the sun, called the astronomical year; also, a period more or less nearly agreeing with this, adopted by various nations as a measure of time, and called the civil year; as, the common lunar year of 354 days, still in use among the Mohammedans; the year of 360 days, etc. In common usage, the year consists of 365 days, and every fourth year (called bissextile, or leap year) of 366 days, a day being added to February on that year, on account of the excess above 365 days (see Bissextile). Of twenty year of age he was, I guess. Chaucer. Note: The civil, or legal, year, in England, formerly commenced on the 25th of March. This practice continued throughout the British dominions till the year 1752. 2. The time in which any planet completes a revolution about the sun; as, the year of Jupiter or of Saturn. 3. pl.  Age, or old age; as, a man in years. Shak. Anomalistic year, the time of the earth's revolution from perihelion to perihelion again, which is 365 days, 6 hours, 13 minutes, and 48 seconds. -- A year's mind (Eccl.), a commemoration of a deceased person, as by a Mass, a year after his death. Cf. A month's mind, under Month. -- Bissextile year. See Bissextile. -- Canicular year. See under Canicular. -- Civil year, the year adopted by any nation for the computation of time. -- Common lunar year, the period of 12 lunar months, or 354 days. -- Common year, each year of 365 days, as distinguished from leap year. -- Embolismic year, or Intercalary lunar year, the period of 13 lunar months, or 384 days. -- Fiscal year (Com.), the year by which accounts are reckoned, or the year between one annual time of settlement, or balancing of accounts, and another. -- Great year. See Platonic year, under Platonic. -- Gregorian year, Julian year. See under Gregorian, and Julian. -- Leap year. See Leap year, in the Vocabulary. -- Lunar astronomical year, the period of 12 lunar synodical months, or 354 days, 8 hours, 48 minutes, 36 seconds. -- Lunisolar year. See under Lunisolar. -- Periodical year. See Anomalistic year, above. -- Platonic year, Sabbatical year. See under Platonic, and Sabbatical. -- Sidereal year, the time in which the sun, departing from any fixed star, returns to the same. This is 365 days, 6 hours, 9 minutes, and 9.3 seconds. -- Tropical year. See under Tropical. -- Year and a day (O. Eng. Law), a time to be allowed for an act or an event, in order that an entire year might be secured beyond all question. Abbott. -- Year of grace, any year of the Christian era; Anno Domini; A. D. or a. d.",
    "yelper":
        "An animal that yelps, or makes a yelping noise. Specifically: (Zoöl.) (a) The avocet; -- so called from its sharp, shrill cry. [Prov. Eng.] (b) The tattler. [Local, U. S.]",
    "yeldhall": "Guildhall. [Obs.] Chaucer.",
    "ysame":
        "Together. [Obs.] \"And in a bag all sorts of seeds ysame.\" Spenser.",
    "yellow book":
        "In France, an official government publication bound in yellow covers.",
    "yare":
        "Ready; dexterous; eager; lively; quick to move. [Obs.] \"Be yare in thy preparation.\" Shak. The lesser [ship] will come and go, leave or take, and is yare; whereas the greater is slow. Sir W. Raleigh.\n\nSoon. [Obs.] Cursor Mundi.",
    "yellow":
        "Being of a bright saffronlike color; of the color of gold or brass; having the hue of that part of the rainbow, or of the solar spectrum, which is between the orange and the green. Her yellow hair was browded [braided] in a tress. Chaucer. A sweaty reaper from his tillage brought First fruits, the green ear and the yellow sheaf. Milton. The line of yellow light dies fast away. Keble. Yellow atrophy (Med.), a fatal affection of the liver, in which it undergoes fatty degeneration, and becomes rapidly smaller and of a deep yellow tinge. The marked symptoms are black vomit, delirium, convulsions, coma, and jaundice. -- Yellow bark, calisaya bark. -- Yellow bass (Zoöl.), a North American fresh-water bass (Morone interrupta) native of the lower parts of the Mississippi and its tributaries. It is yellow, with several more or less broken black stripes or bars. Called also barfish. -- Yellow berry. (Bot.) Same as Persian berry, under Persian. -- Yellow boy, a gold coin, as a guinea. [Slang] Arbuthnot. -- Yellow brier. (Bot.) See under Brier. -- Yellow bugle (Bot.), a European labiate plant (Ajuga Chamæpitys). -- Yellow bunting (Zoöl.), the European yellow-hammer. -- Yellow cat (Zoöl.), a yellow catfish; especially, the bashaw. -- Yellow copperas (Min.), a hydrous sulphate of iron; -- called also copiapite. -- Yellow copper ore, a sulphide of copper and iron; copper pyrites. See Chalcopyrite. -- Yellow cress (Bot.), a yellow-flowered, cruciferous plant (Barbarea præcox), sometimes grown as a salad plant. -- Yellow dock. (Bot.) See the Note under Dock. -- Yellow earth, a yellowish clay, colored by iron, sometimes used as a yellow pigment. -- Yellow fever (Med.), a malignant, contagious, febrile disease of warm climates, attended with jaundice, producing a yellow color of the skin, and with the black vomit. See Black vomit, in the Vocabulary. -- Yellow flag, the quarantine flag. See under Quarantine, and 3d Flag. -- Yellow jack. (a) The yellow fever. See under 2d Jack. (b) The quarantine flag. See under Quarantine. -- Yellow jacket (Zoöl.), any one of several species of American social wasps of the genus Vespa, in which the color of the body is partly bright yellow. These wasps are noted for their irritability, and for their painful stings. -- Yellow lead ore (Min.), wulfenite. -- Yellow lemur (Zoöl.), the kinkajou. -- Yellow macauco (Zoöl.), the kinkajou. -- Yellow mackerel (Zoöl.), the jurel. -- Yellow metal. Same as Muntz metal, under Metal. -- Yellow ocher (Min.), an impure, earthy variety of brown iron ore, which is used as a pigment. -- Yellow oxeye (Bot.), a yellow-flowered plant (Chrysanthemum segetum) closely related to the oxeye daisy. -- Yellow perch (Zoöl.), the common American perch. See Perch. -- Yellow pike (Zoöl.), the wall-eye. -- Yellow pine (Bot.), any of several kinds of pine; also, their yellowish and generally durable timber. Among the most common are valuable species are Pinus mitis and P. palustris of the Eastern and Southern States, and P. ponderosa and P. Arizonica of the Rocky Mountains and Pacific States. -- Yellow plover (Zoöl.), the golden plover. -- Yellow precipitate (Med. Chem.), an oxide of mercury which is thrown down as an amorphous yellow powder on adding corrosive sublimate to limewater. -- Yellow puccoon. (Bot.) Same as Orangeroot. -- Yellow rail (Zoöl.), a small American rail (Porzana Noveboracensis) in which the lower parts are dull yellow, darkest on the breast. The back is streaked with brownish yellow and with black, and spotted with white. Called also yellow crake. -- Yellow rattle, Yellow rocket. (Bot.) See under Rattle, and Rocket. -- Yellow Sally (Zoöl.), a greenish or yellowish European stone fly of the genus Chloroperla; -- so called by anglers. -- Yellow sculpin (Zoöl.), the dragonet. -- Yellow snake (Zoöl.), a West Indian boa (Chilobothrus inornatus) common in Jamaica. It becomes from eight to ten long. The body is yellowish or yellowish green, mixed with black, and anteriorly with black lines. -- Yellow spot. (a) (Anat.) A small yellowish spot with a central pit, the fovea centralis, in the center of the retina where vision is most accurate. See Eye. (b) (Zoöl.) A small American butterfly (Polites Peckius) of the Skipper family. Its wings are brownish, with a large, irregular, bright yellow spot on each of the hind wings, most conspicuous beneath. Called also Peck's skipper. See Illust. under Skipper, n., 5. -- Yellow tit (Zoöl.), any one of several species of crested titmice of the genus Machlolophus, native of India. The predominating colors of the plumage are yellow and green. -- Yellow viper (Zoöl.), the fer-de-lance. -- Yellow warbler (Zoöl.), any one of several species of American warblers of the genus Dendroica in which the predominant color is yellow, especially D. æstiva, which is a very abundant and familiar species; -- called also garden warbler, golden warbler, summer yellowbird, summer warbler, and yellow-poll warbler. -- Yellow wash (Pharm.), yellow oxide of mercury suspended in water, -- a mixture prepared by adding corrosive sublimate to limewater. -- Yellow wren (Zoöl.) (a) The European willow warbler. (b) The European wood warbler.\n\n1. A bright golden color, reflecting more light than any other except white; the color of that part of the spectrum which is between the orange and green. \"A long motley coat guarded with yellow.\" Shak. 2. A yellow pigment. Cadmium yellow, Chrome yellow, Indigo yellow, King's yellow, etc. See under Cadmium, Chrome, etc. -- Naples yellow, a yellow amorphous pigment, used in oil, porcelain, and enamel painting, consisting of a basic lead metantimonate, obtained by fusing together tartar emetic lead nitrate, and common salt. -- Patent yellow (Old Chem.), a yellow pigment consisting essentially of a lead oxychloride; -- called also Turner's yellow.\n\nTo make yellow; to cause to have a yellow tinge or color; to dye yellow.\n\nTo become yellow or yellower.",
    "yellowish":
        "Somewhat yellow; as, amber is of a yellowish color. -- Yel\"low*ish*ness, n.",
    "yesterweek": "The week last past; last week.",
    "yodel":
        "To sing in a manner common among the Swiss and Tyrolese mountaineers, by suddenly changing from the head voice, or falsetto, to the chest voice, and the contrary; to warble.\n\nA song sung by yodeling, as by the Swiss mountaineers.",
    "yoga":
        "A species of asceticism among the Hindoos, which consists in a complete abstraction from all worldly objects, by which the votary expects to obtain union with the universal spirit, and to acquire superhuman faculties.",
    "yoncopin":
        "A local name in parts of the Mississippi Valley for the American lotus (Nelumbo lutea).",
    "yellowfish":
        "A rock trout (Pleurogrammus monopterygius) found on the coast of Alaska; -- called also striped fish, and Atka mackerel.",
    "yeldrin":
        "The yellow-hammer; -- called also yeldrock, and yoldrin. [Prov. Eng.]",
    "yarn":
        "1. Spun wool; woolen thread; also, thread of other material, as of cotton, flax, hemp, or silk; material spun and prepared for use in weaving, knitting, manufacturing sewing thread, or the like. 2. (Rope Making)  One of the threads of which the strands of a rope are composed. 3. A story told by a sailor for the amusement of his companions; a story or tale; as, to spin a yarn. [Colloq.]",
    "you":
        "The pronoun of the second person, in the nominative, dative, and objective case, indicating the person or persons addressed. See the Note under Ye. Ye go to Canterbury; God you speed. Chaucer. Good sir, I do in friendship counsel you To leave this place. Shak. In vain you tell your parting lover You wish fair winds may waft him over. Prior. Note: Though you is properly a plural, it is in all ordinary discourse used also in addressing a single person, yet properly always with a plural verb. \"Are you he that hangs the verses on the trees, wherein Rosalind is so admired \" Shak. You and your are sometimes used indefinitely, like we, they, one, to express persons not specified. \"The looks at a distance like a new-plowed land; but as you come near it, you see nothing but a long heap of heavy, disjointed clods.\" Addison. \"Your medalist and critic are much nearer related than the world imagine.\" Addison. \"It is always pleasant to be forced to do what you wish to do, but what, until pressed, you dare not attempt.\" Hook. You is often used reflexively for yourself of yourselves. \"Your highness shall repose you at the tower.\" Shak.",
    "yucca borer":
        "(a) A California boring weevil (Yuccaborus frontalis). (b) A large mothlike butterfly (Megathymus yuccæ) of the family Megatimidæ, whose larva bores in yucca roots.",
    "yeman": "A yeoman. [Obs.] Chaucer.",
    "yorkshire":
        "A county in the north of England. Yorkshire grit, a kind of stone used for polishing marble, and copperplates for engravers. Simmonds. -- Yorkshire pudding, a batter pudding baked under meat.",
    "yronne": "Run. Chaucer.",
    "yoke-toed":
        "Having two toes in front and two behind, as the trogons and woodpeckers.",
    "yeara":
        "The California poison oak (Rhus diversiloba). See under Poison, a.",
    "yerd": "See 1st & 2d Yard. [Obs.] Chaucer.",
    "ylang-ylang": "See Ihlang-ihlang.",
    "yellows":
        "1. (Far.)  A disease of the bile in horses, cattle, and sheep, causing yellowness of the eyes; jaundice. His horse . . . sped with spavins, rayed with the yellows. Shak. 2. (Bot.)  A disease of plants, esp. of peach trees, in which the leaves turn to a yellowish color; jeterus. 3. (Zoöl.)  A group of butterflies in which the predominating color is yellow. It includes the common small yellow butterflies. Called also redhorns, and sulphurs. See Sulphur.",
    "yamen":
        "In China, the official headquarters or residence of a mandarin, including court rooms, offices, gardens, prisons, etc.; the place where the business of any public department is transcated.",
    "yakoots":
        "(Ethnol.) A nomadic Mongolian tribe native of Northern Siberia, and supposed to be of Turkish stock. They are mainly pastoral in their habits. [Written also Yakuts.]",
    "yupon": "Same as Yaupon.",
    "yenite":
        "A silicate of iron and lime occurring in black prismatic crystals; -- also called ilvaite. [Spelt also jenite.]",
    "yeoman":
        "1. A common man, or one of the commonly of the first or most respectable class; a freeholder; a man free born. Note: A yeoman in England is considered as next in order to the gentry. The word is little used in the United States, unless as a title in law proceedings and instruments, designating occupation, and this only in particular States. 2. A servant; a retainer. [Obs.] A yeman hadde he and servants no mo. Chaucer. 3. A yeoman of the guard; also, a member of the yeomanry cavalry. [Eng.] 4. (Naut.)  An interior officer under the boatswain, gunner, or carpenters, charged with the stowage, account, and distribution of the stores. Yeoman of the guard, one of the bodyguard of the English sovereign, consisting of the hundred yeomen, armed with partisans, and habited in the costume of the sixteenth century. They are members of the royal household.",
    "yarke": "Same as Saki.",
    "ylike": "Like; alike. [Obs.] \"All . . . yliche good.\" Chaucer.",
    "yeldrine":
        "The yellow-hammer; -- called also yeldrock, and yoldrin. [Prov. Eng.]",
    "yite": "The European yellow-hammer.",
    "yvel": "Evil; ill. [Obs.] Chaucer.",
    "yam":
        "A large, esculent, farinaceous tuber of various climbing plants of the genus Dioscorea; also, the plants themselves. Mostly natives of warm climates. The plants have netted-veined, petioled leaves, and pods with three broad wings. The commonest species is D. sativa, but several others are cultivated. Chinese yam, a plant (Dioscorea Batatas) with a long and slender tuber, hardier than most of the other species. -- Wild yam. (a) A common plant (Dioscorea villosa) of the Eastern United States, having a hard and knotty rootstock. (b) An orchidaceous plant (Gastrodia sesamoides) of Australia and Tasmania.",
    "yaf": "Gave. See Give. Chaucer.",
    "y current":
        "The current through one branch of the star arrangement of a three-phase circuit.",
    "yerne":
        "Eagerly; briskly; quickly. [Obs.] Piers Plowman. My hands and my tongue go so yerne. Chaucer.",
    "yokemate": "Same as Yokefellow.",
    "yelting":
        "The Florida and West Indian red snapper (Lutianus aya); also, sometimes, one of certain other allied species, as L. caxis.",
    "yumas":
        "A tribe of Indians native of Arizona and the adjacent parts of Mexico and California. They are agricultural, and cultivate corn, wheat, barley, melons, etc. Note: The a wider sense, the term sometimes includes the Mohaves and other allied tribes.",
    "ypight": "See Pight.",
    "yeared":
        "Containing years; having existed or continued many years; aged. [Obs.] B. Jonson.",
    "yaffingale": "The yaffle. [Prov. Eng.]",
    "yellowlegs":
        "Any one of several species of long-legged sandpipers of the genus Totanus, in which the legs are bright yellow; -- called also stone snipe, tattler, telltale, yellowshanks; and yellowshins. See Tattler, 2.",
    "yataghan":
        "A long knife, or short saber, common among Mohammedan nations, usually having a double curve, sometimes nearly straight. [Written also ataghan, attaghan.] Chaucer.",
    "yardwand": "A yardstick. Tennyson.",
    "ya": "Yea. [Obs.] Chaucer.",
    "yang":
        "The cry of the wild goose; a honk.\n\nTo make the cry of the wild goose.",
    "yerba":
        "An herb; a plant. Note: This word is much used in compound names of plants in Spanish; as, yerba buena Etym: [Sp., a good herb], a name applied in Spain to several kinds of mint (Mentha sativa, viridis, etc.), but in California universally applied to a common, sweet-scented labiate plant (Micromeria Douglasii). Yerba dol osa. Etym: [Sp., herb of the she-bear.] A kind of buckthorn (Rhamnus Californica). -- Yerba mansa. Etym: [Sp., a mild herb, soft herb.] A plant (Anemopsis Californica) with a pungent, aromatic rootstock, used medicinally by the Mexicans and the Indians. -- Yerba reuma. Etym: [Cf. Sp. reuma rheum, rheumatism.] A low California undershrub (Frankenia grandifolia).",
    "yowley": "The European yellow-hammer. [Prov. Eng.]",
    "yelk": "Same as Yolk.",
    "yellowtop": "A kind of grass, perhaps a species of Agrostis.",
    "yogism": "Yoga, or its practice.",
    "youngling":
        "A young person; a youth; also, any animal in its early life. \"More dear . . . than younglings to their dam.\" Spenser. He will not be so willing, I think, to join with you as with us younglings. Ridley.\n\nYoung; youthful. Wordsworth.",
    "ypsiliform": "Resembling the",
    "ygdrasyl": "See in the Dictionary of Noted Names in Fiction.",
    "ye":
        "an old method of printing the article the (AS. þe), the \"y\" being used in place of the Anglo-Saxon thorn. It is sometimes incorrectly pronounced ye. See The, and Thorn, n., 4.\n\nAn eye. [Obs.] From his yën ran the water down. Chaucer.\n\nThe plural of the pronoun of the second person in the nominative case. Ye ben to me right welcome heartily. Chaucer. But ye are washed, but ye are sanctified. 1 Cor. vi. 11. This would cost you your life in case ye were a man. Udall. Note: In Old English ye was used only as a nominative, and you only as a dative or objective. In the 16th century, however, ye and you became confused and were often used interchangeably, both as nominatives and objectives, and you has now superseded ye except in solemn or poetic use. See You, and also the first Note under Thou. Vain pomp and glory of this world, I hate ye. Shak. I come, kind gentlemen, strange news to tell ye. Dryden.\n\nYea; yes. [Obs.] Chaucer.",
    "yahoo":
        "1. One of a race of filthy brutes in Swift's \"Gulliver's Travels.\" See in the Dictionary of Noted Names in Fiction. 2.  Hence, any brutish or vicious character. 3.  A raw countryman; a lout; a greenhorn. [U. S.]",
    "yon":
        "At a distance, but within view; yonder. [Poetic] Read thy lot in yon celestial sign. Milton. Though fast yon shower be fleeting. Keble.\n\nYonder. [Obs. or Poetic] But, first and chiefest, with thee bring Him that yon soars on golden wing. Milton.",
    "yield":
        "1. To give in return for labor expended; to produce, as payment or interest on what is expended or invested; to pay; as, money at interest yields six or seven per cent. To yelde Jesu Christ his proper rent. Chaucer. When thou tillest the ground, it shall not henceforth yield unto thee her strength. Gen. iv. 12. 2. To furnish; to afford; to render; to give forth. \"Vines yield nectar.\" Milton. [He] makes milch kine yield blood. Shak. The wilderness yieldeth food for them and for their children. Job xxiv. 5. 3. To give up, as something that is claimed or demanded; to make over to one who has a claim or right; to resign; to surrender; to relinquish; as a city, an opinion, etc. And, force perforce, I'll make him yield the crown. Shak. Shall yield up all their virtue, all their fame. Milton. 4. To admit to be true; to concede; to allow. I yield it just, said Adam, and submit. Milton. 5. To permit; to grant; as, to yield passage. 6. To give a reward to; to bless. [Obs.] Chaucer. Tend me to-night two hours, I ask no more, And the gods yield you for 't. Shak. God yield thee, and God thank ye. Beau. & Fl. To yield the breath, the ghost, or the life, to die; to expire; -- often followed by up. One calmly yields his willing breath. Keble.\n\n1. To give up the contest; to submit; to surrender; to succumb. He saw the fainting Grecians yield. Dryden. 2. To comply with; to assent; as, I yielded to his request. 3. To give way; to cease opposition; to be no longer a hindrance or an obstacle; as, men readily yield to the current of opinion, or to customs; the door yielded. Will ye relent, And yield to mercy while 't is offered you Shak. 4. To give place, as inferior in rank or excellence; as, they will yield to us in nothing. Nay tell me first, in what more happy fields The thistle springs, to which the lily yields Pope.\n\nAmount yielded; product; -- applied especially to products resulting from growth or cultivation. \"A goodly yield of fruit doth bring.\" Bacon.",
    "yours": "See the Note under Your.\n\nSee the Note under Your.",
    "yode":
        "Went; walked; proceeded. [Written also yede.] See Yede. Quer [whether] they rade [rode] or yoke. Cursor Mundi. Then into Cornhill anon I yode. Lydgate.",
    "yell":
        "To cry out, or shriek, with a hideous noise; to cry or scream as with agony or horror. They yelleden as feendes doon in helle. Chaucer. Nor the night raven, that still deadly yells. Spenser. Infernal ghosts and hellish furies round Environed thee; some howled, some yelled. Milton.\n\nTo utter or declare with a yell; to proclaim in a loud tone. Shak.\n\nA sharp, loud, hideous outcry. Their hideous yells Rend the dark welkin. J. Philips.",
    "yaourt": "A fermented drink, or milk beer, made by the Turks.",
    "young":
        "1. Not long born; still in the first part of life; not yet arrived at adolescence, maturity, or age; not old; juvenile; -- said of animals; as, a young child; a young man; a young fawn. For he so young and tender was of age. Chaucer. \"Whom the gods love, die young,\" has been too long carelessly said; . . . whom the gods love, live young forever. Mrs. H. H. Jackson. 2. Being in the first part, pr period, of growth; as, a young plant; a young tree. While the fears of the people were young. De Foe. 3. Having little experience; inexperienced; unpracticed; ignorant; weak. Come, come, elder brother, you are too young in this. Shak.\n\nThe offspring of animals, either a single animal or offspring collectively. [The egg] bursting with kindly rupture, forth disclosed Their callow young. Milton. With young, with child; pregnant.",
    "yest": "See Yeast. Shak.",
    "yesternight":
        "The last night; the night last past.\n\nOn the last night. B. Jonson.",
    "younker":
        "A young person; a stripling; a yonker. [Obs. or Colloq.] That same younker soon was overthrown. Spenser.",
    "yufts": "Russia leather.",
    "yestreen":
        "Yester-evening; yesternight; last night. [R. or Scot.] Yestreen I did not know How largely I could live. Bp. Coxe.",
    "yu": "Jade.",
    "yellowshins": "See Yellolegs.",
    "yearnings":
        "The maws, or stomachs, of young calves, used a rennet for curdling milk. [Scot.] YEAR'S PURCHASE Year's purchase.  The amount that is yielded by the annual income of property; -- used in expressing the value of a thing in the number of years required for its income to yield its purchase price, in reckoning the amount to be paid for annuities, etc.",
    "yis": "Yes. [Obs.] \"Yis, sir,\" quod he, \"yis, host.\" Chaucer.",
    "youl": "To yell; to yowl. [Obs.] Chaucer."
  };

